var book = {
	"name": "နဲၪဖျီၪ",
	"numChapters": 22,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> ယ့ၫရှူၬဎရံၬအဆၧနဲၪဖျီၪလၧယွၩဖ့ၪလၫ့ဝ့ၫ, ဘဲၫ ၥိၭအမိဒုၭနဲၪ အဎီးအၡၩလဖၪ လၧဆၧလၧအဘၪ မၩအၥၭချဲၫ့ချဲၫ့တၭ, မွဲအအၪ့မၧၫ့လၩ့ဝ့ၫ အၥီၫ့တၭ",
			"2": "<sup>2</sup> ဒုၭနဲၪဝ့ၫလၧ အဎီးအၡၩစယီဟၫ့,- လၧအထိးအၥၭ လၧယွၩအလူအထၫ, ဒဲယ့ၫရှူၬဎရံၬ အဆၧထိးအၥၭ",
			"3": "<sup>3</sup> ဒဲကယဲဆၧလၧအဒၪဘၪဝ့ၫနီၪ ထီးအလူၬလီၫ.-ၦလၧ အဖီဘၪဒဲၦနါဂၧၫ့မီၪအလူအထၫယီၩ, ဒဲထီးန့ဖံၭထၬ ဆၧကွ့ၭအၥၭလဖၪအီၪလၧအဖၧၩ့နီၪဘၪဆိၪဂ့ၩဝ့ၫ လီၫ. အဂဲးဘဲၫယီၩ ဆၧအမုအလၩ လၩ့ဘူၭဝ့ၫဒၪ လီၫ.",
			"4": "<sup>4</sup> ယၧၩ, စယီဟၫ့ယီၩ, ယစံၭဆၧအီၪကီၪ့နွ့ၫစီၪ့အီၪ လၧအ့ၡၫအဖၧၩ့နီၪ, ဆၧအခိးအတၩ, ဒဲဆၧဘၪလိၬ အိၭလိၬဂဲၫလၧၦလဂၩလၧအအီၪ,ဒဲလၧအအီၪယူၭ ဝ့ၫဒဲလၧအမိဂဲၫလဂၩနီၪ, ဒဲလၧၥၭနွ့ၫဖျိၪ့ အီၪဝ့ၫလၧ",
			"5": "<sup>5</sup> အလးဆီၩ့ဆီအမ့ၬယၫ,- ဒဲဂၪ့ခိၪအစဎွၩၥံၪအခိၪ, ဒဲလၧၦလၧအထိးအၥၭ လၧအလူတီၩယ့ၫရှူၬဎရံၬ လၧအအီၪဖျဲၪဆိၫလၧဆၧၥံၫအဖၧၩ့နီၪ,မွဲအအီၪ လၧနၥံၪဆံၭ. ၦလၧအအဲၪပၧၩဒဲၥူၫဝၭဆံၫ့ပဆၧဒဲၩဘၭ",
			"6": "<sup>6</sup> လၧအၥွံၪဒၪဝ့ၫတၭ,- မွဲအမၩကဲၪထၪ့ပၧၩလၧဆၧဘၩ့မုး, ၦလုဆၧလဖၪလၧယွၩဒဲအဖါအမ့ၬယၫ လဂၩနီၪ, မွဲဆၧလၩဆၧဖၩ့အီၪလၧအလီၩ့အဆိၩဆိၩ အကၠၪကၠၪဆံၭ. အၩမံၩ့.",
			"7": "<sup>7</sup> ယိခွါ, အဝ့ၫဒၪဂဲၫလၩ့လၧဆၧအုၪ့အကျၩတၭ,ၦ လၧအဆ့ၭဘၪဝ့ၫ, ဒဲကယဲဆၧအမ့ၬလဂၩလါလါမိ ဒၪဘၪအဝ့ၫ,ဒဲကယဲၦကိၭဆၨၩဒ့ၭလၧဂၪ့ခိၪချိၫ့မိ",
			"8": "<sup>8</sup> ဂၪ့ဝ့ၫလၧအကၠီၩ့လီၫ. မွဲယူၭ,အၩမံၩ့.- ကဆါ လၧအၥ့ၪဆၧလူၬ, လၧအအီၪဝ့ၫ,ဒဲလၧအအီၪယူၭဝ့ၫ, ဒဲလၧအမိဂဲၫလဂၩ, စံၭဝ့ၫဒၪး ယမွဲက, ဒဲ ဧ, ဎဆၧ အခၪ့ထံၭ, ဒဲဆၧအထုၬ လီၫ.",
			"9": "<sup>9</sup> ၦလၧအထၧၫ့ထံၩထၧၫ့ၥိၭ လၧနၥံၪလၧဆၧၡၪ့ဆၧ နၭအဖၧၩ့ ဒဲလၧယ့ၫရှူၬဎရံၬ အဘၩ့အမုးအဖၧၩ့ဒဲ လၧဆၧအွံၪၥၭဆၧၩ့ အဖၧၩ့, နၥံၪအထၧၫ့ဖုဝဲ ယၧၩ, စယီဟၫ့ယီၩ, ယအီၪလၧကျိၩ့လဖျိၪ့အဖၧၩ့ ကိၭဝ့ၫအ မံၩ့ပၭမၧၭလၧယွၩအလူအထၫအကၠီၩ့, ဒဲလၧယ့ၫရှူၬ ဎရံၬအဆၧထိးအၥၭအကၠီၩ့လီၫ.",
			"10": "<sup>10</sup> လၧကဆါ အမုနံၩနီၪ, ယအီၪလၧၥၭမုအဖၧၩ့ တၭ, ယနါဂၧၫ့ဆၧၥီၫဖၭဒိၪ လၧယချိၫ့ ဘဲၫခွ့ၩအၥိၭ",
			"11": "<sup>11</sup> တၭ,- စံၭဝ့ၫဒၪ, ဆၧလၧနဒၪဘၪယီၩကွ့ၭလၩ့လၧလံၬ ဖၧၩ့တၭ, ဖ့ၪယူလၧဆၧအီၪကီၪ့, နွ့ၫစီၪ့အီၪလၧ အ့ဖစၧၭ, ဒဲစမၧနၫ,ဒဲပဂၧမီၭ,ဒဲၥဲၫအတဲရၫ, ဒဲစၫဒံၭ, ဒဲဖံၫလဒ့လဖံၫ,ဒဲလအီၫဒစံအၫအ ဖၧၩ့ဆံၭ.",
			"12": "<sup>12</sup> ဘဲၫၥိၭယမိဒၪဘၪဆၧၥီၫ လၧအချဲၩ့ဆၧလၧယၧၩ တၭ,ယကၠၪစိၩယၥၭလီၫ. ယကၠၪစိၩယၥၭဂီၩ့တၭ,",
			"13": "<sup>13</sup> ယဒၪဘၪမ့ၪဒိၩ့ထီၫ့အလးနွ့ၫဖျိၪ့,- ဒဲၦလၩ့ဂၬလၧ ၦၡၩအဖိၪခွၫကီၩ့ၥိၭဆၧထီၩ့လၩ့လၧအခၪ့ယၫၥၭ တၭ, ခဲးထူၬအခၧၩ့ယး ထီၫ့လၧအၥၭနၫလဂၩ, အီၪ",
			"14": "<sup>14</sup> လၧမ့ၪဒိၩ့အလၫ့အကျၩလီၫ.- အခိၪ, ဒဲအခိၪၥူၫဘွၩ ဘဲၫၥိၪအဆီၪ့အၥိၭတၭ, ဘွၩဝ့ၫဘဲၫမူၭခိၪဖီၫ အၥိၭ",
			"15": "<sup>15</sup> တၭ,အမ့ၬၥၪဘဲၫမ့ၪလၪအၥိၭနီၪလီၫ.- အခၪ့ယၫ ၥၭလၩ့ဂၬထီၫ့ယုၩ့ယဲဘဲၫအဘၪမၩဆံၫ့အၥၭလၧ မ့ၪအၥိၭတၭ, အလူၥီၫမၩအၥၭဘဲၫထံၫအၪအၪ",
			"16": "<sup>16</sup> လ့ၬအၥိၭနီၪလီၫ.- တၭၡၪနွ့ၫဖျိၪ့အီၪ လၧအစူၪထွ့ၪ ဖၧၩ့ဒဲနၭ လၧအနါအီၪနံၫခီၫ လၧအအဲၪ့ဝ့ၫလဘံၪ့ဂဲၫ ထၪ့လၧအနိၭဖၧၩ့တၭ, အမ့ၬအနၫမၩအၥၭဘဲၫ မုမ့ၬဖၩ့ထၪ့လၧအစီၩ့အမၩ့အၥိၭနီၪလီၫ.",
			"17": "<sup>17</sup> ထီးယဒၪဘၪယဝ့ၫတၭ, ယလၩ့ထံၩဖါလၧအခၪ့ ထံၭဘဲၫဆၧၥံၫအၥိၭနီၪလီၫ. အဝ့ၫနီၪအီၪက့ၪအစူၪ ထွ့ၪလၧယလီၩ့တၭ, စံၭယၧၩ, ထီးၥၭမဲၪလဂ့ၩ,ယမွဲ",
			"18": "<sup>18</sup> ဆၧအခၪ့ထံၭ, ဒဲဆၧအထုၬလီၫ.- ဒဲယမွဲၦလၧအမၧၫ့ ဝ့ၫ ဒဲၦလၧအၥံၫယူၭတၭ, ယိခွါ,ယမၧၫ့ထၪ့အဆိၩ ဆိၩအကၠၪကၠၪတၭ ယအီၪလၧဆၧၥံၫ, ဒဲဖျႃဖၧၩ့အ",
			"19": "<sup>19</sup> နိၪဝံၬလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧလၧနဒၪဘၪ ယူၭလဖၪ, ဒဲဆၧလၧအမိမၩအၥၭ လၧယၫလဖၪနီၪ",
			"20": "<sup>20</sup> ကွ့ၭလၩ့န့ဝ့ၫဆံၭ.- ဆၧအီၪၥူၪဘၪဆဲၫ့ လၧၡၪနွ့ၫဖျိၪ့ လၧနဒၪဘၪလၧယစူၪထွ့ၪအဖၧၩ့, ဒဲမ့ၪဒိၩ့ထီၫ့အ လးနွ့ၫဖျိၪ့နီၪ မွဲအယီၩး ၡၪနွ့ၫဖျိၪ့နီၪ မွဲဆၧအီၪကီၪ့ နွ့ၫစီၪ့အၥီၫ့လဖၪတၭ, မ့ၪဒိၩ့အလးနွ့ၫဖျိၪ့နီၪမွဲဆၧ အီၪကီၪ့နွ့ၫစီၪ့လီၫ."
		},
		"2": {
			"1": "<sup>1</sup> ကွ့ၭန့ဆၧအီၪကီၪ့အၥီၫ့ အီၪလၧအ့ဖစၧၭအဖၧၩ့နီၪ ဆံၭး ၦလၧအဖီၪ့ထၬၡၪနွ့ၫဖျိၪ့ လၧအစူၪထွ့ၪအဖၧၩ့ တၭ စဲၪ့လၧမ့ၪဒိၩ့ထီၫ့အလး နွ့ၫဖျိၪ့အကျၩလဂၩနီၪ,",
			"2": "<sup>2</sup> စံၭဆၧဘဲၫယီၩ,- ယၥ့ၪယၫနဆၧဖံၭဆၧမၩတၭ, နမၩ ဆၧထီးဆၧပွံၭနၥၭတၭ, နအွံၪၥၭဆၧၩ့ဆၧ ဒဲၦအၧၩ့ ၦၥၫ့လဖၪ နထိးဆၧၫ့လကဲၪဘၪ, ဒဲၦလၧအစံၭလၩ့အ ၥၭလၧအမွဲ ၦဆၧအၪ့မၧၫ့ဖိၪတၭ, လမွဲဘၪလဖၪနီၪ, နမၩခွါအဝ့ၫၥံၪတၭ, နဒၪန့လၧအမွဲၦချဲၩ့ဘျံၭ ချဲၩ့",
			"3": "<sup>3</sup> ဘျၪဆၧ,- နအီၪလၧဆၧအွံၪၥၭဆၧၩ့တၭ, နထိးဘၪ ဆၧလၧယမံၩ့အကၠီၩ့တၭ, ဆၧလပွံၭဘၪနၥၭလီၫ.",
			"4": "<sup>4</sup> မွဲလါနၫ့ဘိၩ ယအီၪက့ၪဆၧမၪလမံၩ့ယီၩ လၧနလီၩ့,",
			"5": "<sup>5</sup> အဂဲးဘဲၫယီၩ နစဲၪ့ဒၪခွံၬနဆၧအဲၪ အခၪ့ထံၭလီၫ.- မၩ အၥၭဘဲၫနီၪတၭ, မွဲနလၩ့ထ့ၬခီၫခီၫလဲၪနီၪ နၪ့ထၪ့ထဲၩ့ တၭ, နီၫ့ယါလၩ့ထဲၩ့နၥၭတၭ, မၩထဲၩ့ဆၧလၧနမၩ ထၪ့လၧအၥၫ့နီၪဆံၭ. အ့ၪလမွဲဘၪဘဲၫနီၪတၭ,ယမိ လ့ၩလၧနအီၪချဲၫ့ချဲၫ့တၭ, နအ့ၪလနီၫ့ယါလၩ့ထဲၩ့ဘၪ နၥၭတၭ, ယမိလ့ၩဆိၬခွံၬနမ့ၪဒိၩ့အလးလၧအဖၧၩ့",
			"6": "<sup>6</sup> လီၫ.- မွဲလါနၫ့ဘိၩနအီၪလၧဆၧယီၩလမံၩ့,လၧနမ့ၬ လဲၩၦနံၫကလ့ၩတၫ့ၥံၪအဆၧမၩလဖၪလၧယမ့ၬလဲၩ",
			"7": "<sup>7</sup> ယဝ့ၫဆ့လီၫ.- ၦအီၪလၧအနါနီၪး မွဲအနါဂၧၫ့ဆၧလၧ ၥၭမုစံၭဆၧအီၪကီၪ့လဖၪဆံၭ. ၦလၧအမၩနၧၩ့မၩ စၪဆၧနီၪယမိဖ့ၪအၪ့ အဝ့ၫဒၪလၧၥံၪ့မၧၫ့အၥၪအီၪလၧ ယွၩအပၫရဒဲၭ အဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> တၭကွ့ၭန့ ဆၧအီၪကီၪ့အၥီၫ့အီၪလၧစမၧနၫအ ဖၧၩ့နီၪဆံၭး ၦလၧအမွဲ ဆၧအခၪ့ထံၭဒဲဆၧအထုၬ, ဒဲၦလၧအၥံၫယူၭဝ့ၫ, ဒဲမၧၫ့ထၪ့ဝ့ၫလဂၩနီၪ စံၭဆၧဘဲၫ",
			"9": "<sup>9</sup> ယီၩ,- ယၥ့ၪယၫလၧနဆၧဖံၭဆၧမၩဒဲနဆၧကၪဆၧ ဂဲၩ, ဒဲဆၧၡၪ့ဆၧယၬ (လါနၫ့တၭနလၧၫ့နဎွ့ၩ) ဒဲၦ ဒုၪဒွ့ၪဆၧလၧအစံၭလၩ့အၥၭလၧအမွဲၦယုဒၫဖိၪနီၪ, လမွဲဘၪတၭ,မွဲၦလၧမုၪခီၩလဲးအဆၧအီၪကီၪ့",
			"10": "<sup>10</sup> လီၫ.- ဆၧၡၪ့ဆၧနၭ လၧအမိဘၪနၧၩနီၪ ထီးၥၭမဲၪနး မံၩ့လဂ့ၩ. ယိခွါ, ဘဲၫၥိၭနၥံၪမိဘၪဆၧကျဲၩ့ဖစီၩ့တၭ, မုၪခီၩလဲး မိဒုၭနုၬနၥံၪလနၩ့နၩ့လၧထီၫ့ဖၧၩ့တၭ, နၥံၪ မိဘၪဆၧၡၪ့ဆၧနၭဆံၫနံၩလီၫ. အီၪဂုးခၧၫ့နဝ့ၫလၧ နလူတီၩထီးနၥံၫဆံၭ. တၭယမိဖ့ၪလၫ့နၧၩၥရဖူၩ",
			"11": "<sup>11</sup> မၧၫ့လီၫ.- ၦအီၪလၧအနါနီၪ, မွဲအနါဂၧၫ့ဆၧလၧ ၥၭမုစံၭဆၧအီၪကီၪ့လဖၪဆံၭ. ၦလၧအမၩနၧၩ့မၩစၪ ဆၧနီၪ ဆၧၥံၫလၧအဎွ့ၩထၪ့နံၫဖၧၫ့လဖၧၫ့မၩဂၭဂီၩ့ အဝ့ၫအ့ၬ.",
			"12": "<sup>12</sup> တၭကွ့ၭန့ဆၧအီၪကီၪ့အၥီၫ့ လၧပၧဂမီၭအဖၧၩ့နီၪ ဆံၭ, ၦအီၪလၧအနၭလၧအအီၪလၧအနါနံၫခီၫလၧ",
			"13": "<sup>13</sup> အအဲၪ့ဝ့ၫလဘံၪ့လဂၩနီၪ, စံၭဆၧဘဲၫယီၩ, ယၥ့ၪယၫ နဆၧဖံၭဆၧမၩတၭ,နအီၪထီးမုၪခီၩလဲးအလးဆီၩ့ ဆီအီၪဝ့ၫအလးတၭ, နဖီၪ့ထၬယမံၩ့ဒဲလၧၦအလူတီၩ စအၪ့တပၭဘၪၥံၫဝ့ၫ လၧယကၠီၩ့ အမုနံၩဒၪလ့ၬ,လၧ မုၪခီၩလဲး အီၪဝ့ၫအလး လၧနၥံၪအကျၩ နလမီၪ့ဘံၭ",
			"14": "<sup>14</sup> ဘၪယဆၧနဲၩထဲၩ့ယၧၩနီၪလီၫ.- မွဲလါနၫ့ဘိၩ, ယအီၪက့ၪဆၧမၪအဆံၭအၡၩလၧနလီၩ့, အဂဲးဘဲၫ ယီၩနအီၪလၧၦလၧအဖီၪ့ထၬစဘၫလၫ့အဆၧၥီၪ့ဆၧ ၥၫ့လၧအၥီၪ့ထဲၩ့စဘၫလၭဘဲၫၥိၭအမိအီၪက့ၪဆၧ လၩ့ထံၩဖါအလးလၧၦအံၫစရ့လၭဖိၪအမ့ၬယၫ,ဘဲၫ ၥိၭအမိအၪ့ဆၧလၧၦလုဆၧဂၩ့ ဒဲၦမၩမၪမုၪမၩ",
			"15": "<sup>15</sup> မၪခွၫလီၫ.- ဘဲၫနီၪအၥိၭ ၦလၧအဖီၪ့ထၬ ၦနံၫက လ့ၩတၫ့ၥံၪအဆၧၥီၪ့ဆၧၥၫ့ လၧယမ့ၬလဲၩနီၪ, အီၪဝ့ၫ",
			"16": "<sup>16</sup> လၧနဖၧၩ့ဆ့လီၫ.- နီၫ့ယါလၩ့ထဲၩ့နၥၭဆံၭ. အ့ၪ လမွဲဘၪဘဲၫနီၪတၭ, ယမိလ့ၩလၧနအီၪ ချဲၫ့ချဲၫ့တၭ,",
			"17": "<sup>17</sup> ယမိဒုၭအဝ့ၫၥံၪလၧယနိၭအနၭလီၫ.- ၦအီၪလၧအ နါနီၪ, မွဲအနါဂၧၫ့ဆၧ လၧၥၭမုစံၭ ဆၧအီၪကီၪ့လဖၪ ဆံၭ. ၦလၧအမၩနၧၩ့မၩစၪဆၧနီၪ, ယမိဖ့ၪအၪ့အဝ့ၫ လၧမၪ့နၫလၧအအီၪၥူၪ, ဒဲယမိဖ့ၪလၫ့အဝ့ၫလၧလိး ဘွၩနးဖျိၪ့, ဒဲအမံၩ့အၥၫ့ကွ့ၭအၥၭလၧလိးအလီၩ့ လၧၦလၥ့ၪယၫဘၪနးဂၩ,ၥ့ၪယၫန့ၫၦလၧအန့ဘၪ ဝ့ၫလဂၩလီၫ.",
			"18": "<sup>18</sup> တၭကွ့ၭန့ဆၧအီၪကီၪ့အၥီၫ့ အီၪလၧၥဲၫအတဲရၫအ ဖၧၩ့နီၪဆံၭး ၦအီၪလၧအမ့ၬၥၪဘဲၫမ့ၪလၪ,ဒဲအခၪ့ ယၫၥၭဘဲၫထီးယုၩ့ယဲအၥိၭနီၪ ယွၩအဖိၪခွၫ လဂၩ",
			"19": "<sup>19</sup> စံၭဆၧဘဲၫယီၩ,- ယၥ့ၪယၫနဆၧဖံၭဆၧမၩ,ဒဲနဆၧ အဲၪဆၧကွံၩ, ဒဲနမၩအဎီးအၡၩအဆၧ,နဆၧနဲၩ,ဒဲဆၧ အွံၪၥၭဆၧၩ့ဆၧ, ဒဲနမၩဆၧလၧခဲၫ့ထုၬအၪနဲၪ့လၧအ",
			"20": "<sup>20</sup> ၥၫ့ဒံၭလီၫ.- မွဲလါနၫ့ဘိၩ, ယအီၪက့ၪဆၧမၪလၧနလီၩ့, ဘဲၫယီၩ, နဒုၭအီၪၦမုၪနးယ့ၭဇဘ့လၭလၧအစံၭလၩ့ အၥၭလၧအမွဲမီၪမုၪလဂၩတၭ,မွဲအၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ ဆၧဒဲအၪ့လီၫန့ယဎီးယၡၩလဖၪ, ဘဲၫၥိၭအမိမၩမၪ မုၪမၩမၪခွၫ, ဒဲအၪ့ဆၧလၧအလုထၪ့ဝ့ၫလၧဆၧဂၩ့",
			"21": "<sup>21</sup> လီၫ.- တၭဘဲၫၥိၭအမိနီၫ့ယါလၩ့ထဲၩ့အၥၭယဖ့ၪ လၫ့ဝ့ၫအဆၧၫ့ အထီနီၪ, မွဲအနီၫ့ယါလၩ့ထဲၩ့အၥၭ",
			"22": "<sup>22</sup> လၧဆၧမၩမၪမုၪမၩမၪခွၫအ့ၬ.- ယိခွါ,ယမိခွံၬၡိၭအ ဝ့ၫလၧအလးမံၫအဖၧၩ့တၭ,ၦလၧအမၩမၪဆၧလၧ အၥိၭလဖၪနီၪ အ့ၪလနီၫ့ယါလၩ့ထဲၩ့ဘၪ အဆၧမၪ တၭ, ယမိခွံၬၡိၭဝ့ၫ လၧဆၧၡၪ့ဆၧနၭဖၭဒိၪ အဖၧၩ့",
			"23": "<sup>23</sup> လီၫ.- ယမိမၩၥံၫအဖိၪအလံၩလဖၪလၧဆၧၥံၫ တၭ,ဆၧအီၪကီၪ့ထီးအလူၬမိၥ့ၪယၫလၧယမွဲၦလၧ အအၪ့ဎၬၥ့ၪယၫၦအၥုၪ့အၥၭလဂၩတၭ,ဘဲၫနၥံၪ မၩဆၧအၥိၭနီၪ ယမိဖ့ၪလၫ့နၥံၪကိၭဂၩဒ့ၭဆုၬ",
			"24": "<sup>24</sup> ဆုၬလီၫ.- မွဲလါနၫ့ဘိၩ, ယစံၭနၥံၪ,ဒဲၦဂူၫဂၩအီၪလၧ ၥဲၫအတဲရၫအဖၧၩ့လၧအလမၩန့ဘၪဆၧၥီၪ့ဆၧၥၫ့နီၪ တၭ,လၥ့ၪယၫဘၪမုၪခီၩလဲးအဆၧယိၬလဖၪနီၪ ဘဲၫအဝ့ၫၥံၪစံၭဆၧအၥိၭ, ဆၧအဎၧၫ့ဂူၫဂၩ လဖၪနီၪ",
			"25": "<sup>25</sup> ယအီၪက့ၪ လၧနၥံၪအလီၩ့အ့ၬ.- မွဲလါနၫ့ဘိၩ, ဆၧ",
			"26": "<sup>26</sup> လၧနၥံၪန့ဘၪနီၪ, ဖီၪ့ထၬထီးယလ့ၩထီၩ့ဆံၭ.- ၦ လၧအမၩနၧၩ့မၩစၪဆၧဒဲဖီၪ့ထၬယဆၧမၩထီးအထုၬ နီၪယမိဖ့ၪလၫ့အဝ့ၫလၧဆၧအစီၩ့အမၩ့လၧၦဆၨၩ",
			"27": "<sup>27</sup> လဖၪအဖၫ့ခိၪတၭ,- အဝ့ၫဒၪမိပၧၩ့ဆၧလၧအနိၪထး ထၭ,မိမၩလၩ့ဘျ့ၭဝ့ၫဘဲၫၦမၩလၩ့ဘျ့ၭဖၧၩ့ဂၪ့ခိၪ",
			"28": "<sup>28</sup> အၥိၭ,ဘဲၫယန့ဘၪဆၧလၧဖါအၥိၭနီၪလီၫ.- တၭ",
			"29": "<sup>29</sup> ယမိဖ့ၪလၫ့အဝ့ၫလၧၡၪထူဝီၩလီၫ.- ၦအီၪလၧအနါ နီၪ, မွဲအနါဂၧၫ့ဆၧလၧၥၭမုစံၭဆၧအီၪကီၪ့လဖၪဆံၭ."
		},
		"3": {
			"1": "<sup>1</sup> တၭကွ့ၭန့ဆၧအီၪကီၪ့အၥီၫ့ အီၪလၧစၫဒံၭအဖၧၩ့ နီၪဆံၭ, ၦအီၪလၧယွၩအၥၭနွ့ၫဖျိၪ့, ဒဲၡၪနွ့ၫဖျိၪ့လဂၩနီၪ, စံၭဆၧဘဲၫယီၩ,ယၥ့ၪယၫနဆၧဖံၭဆၧမၩဒဲ",
			"2": "<sup>2</sup> နမံၩ့အီၪဘဲၫနမၧၫ့အၥိၭတၭ, မွဲနၥံၫလီၫ.- အီၪခိၭဆၧ ဆံၭ, ဆၧလၧအအီၪလၩ့ထး လၧအမိၥံၫဝ့ၫလဖၪနီၪ, ဒုၭဆီၪ့ထၪ့အဂဲးအဘၭဆံၭ. အဂဲးဘဲၫယီၩယဒၪ ဘၪနဆၧဖံၭဆၧမၩ လၧၫ့ထၪ့ဎွ့ၩထၪ့ လၧယွၩအမ့ၬ",
			"3": "<sup>3</sup> ယၫအ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧလၧနန့ဘၪယူၭ, ဒဲနနါဂၧၫ့ဘၪယူၭ ဘဲၫၥ့ၪလဲၪ ဘဲၫၥ့ၪလဲၪနီၪ, နၪ့ထၪ့ ထဲၩ့တၭ, ထီးန့ဆၧတၭ, နီၫ့ယါလၩ့ထဲၩ့နၥၭဆံၭ. နအ့ၪလခိၭဘၪတၭ, ယမိလ့ၩလၧနအီၪ ဘဲၫဆၧဂူၪ ဆၧဘျၪအၥိၭတၭ, ယမိလ့ၩလၧနအီၪနၩရံၩဘဲၫၥ့ၪ လဲၪဘဲၫၥ့ၪလဲၪနီၪ နၥ့ၪယၫအ့ၬ.",
			"4": "<sup>4</sup> မွဲလါနၫ့ဘိၩ, နအီၪလၧၦအမံၩ့လၧစၫဒံၭအဖၧၩ့ ၡၩခိၬဂၩ လၧအလမၩစံၪစၪဘၪအကီၩ့အၥိၭနီၪတၭ, အဝ့ၫၥံၪမိလ့ၩဆၧလၧယၥိၭ လၧအကီၩ့အၥိၭအဘွၩ",
			"5": "<sup>5</sup> လီၫ. အဂဲးဘဲၫယီၩ မွဲအဂ့ၩအဘၪလီၫ.- ၦလၧအမၩ နၧၩ့မၩစၪဆၧနီၪ မိကီၩ့မိၥိၭဝ့ၫ လၧဆၧအဘွၩတၭ, ယမိထူၭခွံၬအမံၩ့ လၧလံၬမၧၫ့အဖၧၩ့အ့ၬ. မွဲယမိ အုၩ့လၩ့ဝ့ၫလၧယဖါအမ့ၬယၫ,ဒဲလၧအၥီၫ့လဖၪ",
			"6": "<sup>6</sup> အမ့ၬယၫလီၫ.- ၦအီၪလၧအနါနီၪ, မွဲအနါဂၧၫ့ဆၧလၧ ၥၭမုစံၭဆၧအီၪကီၪ့လဖၪ ဆံၭ.",
			"7": "<sup>7</sup> တၭကွ့ၭန့ ဆၧအီၪကီၪ့အၥီၫ့ အီၪလၧဖံလဒ့လဖံၫ အဖၧၩ့နီၪဆံၭ, ၦအဆံၫ့အဎံၪ,ၦအမွဲအတီၩၦအီၪ လၧစဒၫဝံၭအနိၪဝံၬဝဲထၪ့ဆၧတၭ, ၦကၭဘံၭထၬ လၥ့ၪဘၪနးဂၩ, ကၭဘံၭထၬဆၧနီၪ, ၦဝဲထၪ့လၥ့ၪ",
			"8": "<sup>8</sup> ဘၪနးဂၩ, ၦလဂၩနီၪစံၭဆၧဘဲၫယီၩ,- နဆၧဖံၭ ဆၧမၩယၥ့ၪယၫလီၫ. ယိခွါ, ယအီၪက့ၪဝဲထၪ့တရၫ့ လၧၦကၭဘံၭထၬ လၥ့ၪဘၪနးဂၩလၧနမ့ၬယၫနီၪ လီၫ. အဂဲးဘဲၫယီၩ နအီၪလၧနဂဲးနဘၭလၧအဆံၭ အၡၩတၭ, နထီးန့ယလူယထၫတၭ, နမီၪ့ဘံၭယမံၩ့",
			"9": "<sup>9</sup> အ့ၬ.- ယိခွါ, ယဖ့ၪလၫ့လၧနစူၪဖၧၩ့ ၦဘၪဆဲၫ့လၧမုၪ ခီၩလဲး အဆၧအီၪကီၪ့လနၩ့နၩ့ လၧအစံၭလၩ့အၥၭ လၧအမွဲၦယုဒၫဖိၪတၭ, လမွဲဘၪနီၪ,မွဲၦချဲၩ့ဘျံၭ ချဲၩ့ဘျၪဆၧတၭ, ယိခွါ,ယမိအၪ့မၧၫ့အလ့ၩလၧနအီၪ ဘဲၫၥိၭ အမိဘိၪ့ထၪ့ဘၩထၪ့ ဆၧလၧနခၪ့ထံၭတၭ,",
			"10": "<sup>10</sup> မိၥ့ၪယၫဘၪဝ့ၫလၧယအဲၪနၧၩလီၫ.- အဂဲးဘဲၫယီၩ မွဲနထီးန့ယလူယထၫ ဘၪဆဲၫ့လၧယဆၧအွံၪၥၭဆၧၩ့ တၭ, ယမိယိထဲၩ့ခွါထဲၩ့နၧၩလၧဆၧကျဲၩ့ဖစီၩ့အ နၩရံၩအဖၧၩ့ လၧဆၧမိကျဲၩ့ဖစီၩ့ ၦအီၪဎံၩ့ဎံၩ့လ့ၬ,",
			"11": "<sup>11</sup> လၧဂၪ့ခိၪချိၫ့ယီၩလီၫ.- ယိခွါ,ယထီၩ့ချဲၫ့ချဲၫ့တၭ, ဘဲၫၥိၭၦထီးမၩန့ဘၪ နၥရဖူၩလဂ့ၩတၭ, ဖီၪ့ထၬခၧၫ့",
			"12": "<sup>12</sup> ဆၧအီၪလၧနၧၩဆံၭ.- ၦလၧအမၩနၧၩ့မၩစၪဆၧ နီၪယမိဒုၭကဲၪထၪ့ဂံၪ့ထုၪ့လၧယယွၩအဆၧလုဂံၪ့အ ဖၧၩ့တၭ, စဲၪ့ထၪ့လၧၩ့လၧခီၫ့အ့ၬ. တၭယမိကွ့ၭန့ယ ယွၩအမံၩ့ ဒဲယယွၩအဒိၩ့ယရုစလံၫ့အၥၫ့လၧအ ဂဲၫလၩ့လၧမူၭခိၪလၧယယွၩအအီၪအမံၩ့, ဒဲယမံၩ့အ",
			"13": "<sup>13</sup> ၥၫ့လၧအလီၩ့နီၪလီၫ.- ၦအီၪလၧအနါနီၪ, မွဲအနါဂၧၫ့ ဆၧလၧၥၭမုစံၭဆၧအီၪကီၪ့လဖၪဆံၭ.",
			"14": "<sup>14</sup> တၭကွ့ၭန့ဆၧအီၪကီၪ့အၥီၫ့ အီၪလၧလအီၫဒစံအၫ အဖၧၩ့နီၪဆံၭ, စအၩမံၩ့, ၦအလူတီၩ,ဒဲၦထိးအ ၥၭလၧအတီၩအလီၩ့, ယွၩအဆၧတဲၩ့လၩ့အခၪ့ထံၭ",
			"15": "<sup>15</sup> နီၪစံၭဆၧဘဲၫယီၩ,- ယၥ့ၪယၫနဆၧဖံၭဆၧမၩ ရှူၪဧီၪ လရှူၪ,ခိဧီၪလခိလီၫ. နရှူၪမွဲဂ့ၩ, နခိမွဲဂ့ၩးယၥၭအီၪ",
			"16": "<sup>16</sup> လၧနမွဲဆၧလမံၩ့မံၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, နလရှူၪဘၪ,နလခိဘၪ, မွဲနလၧၩ့အကၠီၩ့တၭ,ယမိပၠိၭ",
			"17": "<sup>17</sup> ထၪ့ခွံၬနၧၩလၧယခိၬဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩ နစံၭ လၩ့နၥၭ, ယမွဲၦအလၧၫ့အဎွ့ၩဒဲယစူၪလးခၪ့ခိၪ အၪထၪ့ယူၭတၭ, ယန့ဒံၭဆၧလမံၩ့မံၩ့အလးလအီၪ ဘၪနီၪလီၫ. တၭနလၥ့ၪယၫဘၪ လၧနဘၪဆၧၡၪ့ဆၧ",
			"18": "<sup>18</sup> ယၬ, ဒဲနမ့ၬဘျီၪ, ဒဲနအီၪဘိၪ့လီၫ.- ယဒုၭကိၪ့ဘၪနၧၩ လၧနမိဎွ့ၩထီၫ့လၧအဘၪဆၧမၩဆံၫ့လၧမ့ၪလၧယ အီၪ, ဘဲၫၥိၭနမိလၧၫ့ထၪ့ဎွ့ၩထၪ့, ဒဲဘဲၫၥိၭနမိကီၩ့ဆၧ ၥိၭဆၧတၭ, နအီၪဘိၪ့ အဆၧမ့ၬမဲထီးအီၪလဂ့ၩ တၭ, ဎွ့ၩနကီၩ့နၥိၭဘွၩ လၧယအီၪဆံၭ. ဘဲၫၥိၭနမိ ဒၪထၪ့ထဲၩ့ဆၧတၭ, ဂုၪနမ့ၬၥၪ လၧၥံၪမ့ၬဆၫဆံၭ.",
			"19": "<sup>19</sup> ထီးဒၪၦလၧယအဲၪဝ့ၫလဖၪနီၪ, ယၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ ဝ့ၫ,ဒဲယအၪ့ၥီၪ့ဝ့ၫလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ဂဲၩလိၬ",
			"20": "<sup>20</sup> တၭနီၫ့ယါလၩ့ထဲၩ့နၥၭဆံၭ.- ယိခွါ,ယဆၧၫ့ထုၪ့လၧ တရၫ့ထံၭတၭ ဒိၪထိၬဆၧလီၫ. ၦအ့ၪနါဂၧၫ့ယလူ တၭ,ဝဲထၪ့တရၫ့လဂၩဂၩနီၪ, ယမိလ့ၩနုၬလၧအ အီၪတၭ, ယမိအၪ့ဎုၬဆၧ လၧအဝ့ၫဒၪအၥိၭလၧဂၪ",
			"21": "<sup>21</sup> အၪ့တၭ, အဝ့ၫဒၪမိအၪ့ဎုၬဝ့ၫလၧယၥိၭဆ့လီၫ.- ၦလၧ အမၩနၧၩ့မၩစၪဆၧနီၪယမိဒုၭဆၧၫ့နၩ့ဝ့ၫလၧယ ၥိၭလၧယလးဆီၩ့ဆီအဖၫ့ခိၪဘဲၫယမၩနၧၩ့မၩစၪ ဆၧဆ့တၭ, ယဆၧၫ့နၩ့ယဝ့ၫလၧယဖါအလးဆီၩ့ဆီ",
			"22": "<sup>22</sup> အဖၫ့ခိၪအၥိၭနီၪလီၫ.- ၦအီၪလၧအနါနီၪ,မွဲအ နါဂၧၫ့ဆၧလၧၥၭမု စံၭဆၧအီၪကီၪ့လဖၪနီၪဆံၭ."
		},
		"4": {
			"1": "<sup>1</sup> ဆၧလဖၪနီၪအလးခဲၫ့ယယိဆၧတၭ, ယိခွါ,တရၫ့ အီၪဝဲထၪ့အၥၭ လၧမူၭခိၪအဖၧၩ့နီၪ, ဆၧအလူၥီၫအ ခၪ့ထံၭလၧယနါဂၧၫ့အချဲၩ့ဆၧလၧယၧၩ, မၩအၥၭ ဘဲၫခွ့ၩၥီၫအၥိၭတၭ, စံၭဝ့ၫဒၪ,ဂဲၫထၪ့လၧယီၩဘီၪ, တၭယမိဒုၭနဲၪနၧၩလၧဆၧလၧအမိဘၪမၩအၥၭလၧ ယၫလခီၫလီၫ. တၭယအီၪလၧၥၭမုအဖၧၩ့ချဲၫ့မၬ",
			"2": "<sup>2</sup> လီၫ.- ယိခွါ,လးဆီၩ့ဆီအီၪက့ၪလၩ့အၥၭလၧမူၭခိၪ အဖၧၩ့တၭ, ၦဆၧၫ့နၩ့ဝ့ၫလၧအဖၫ့ခိၪလဂၩလီၫ.",
			"3": "<sup>3</sup> တၭၦလၧအဆၧၫ့နၩ့ဝ့ၫ လၧအဖၫ့ခိၪလဂၩနီၪလၩ့ဂၬ မနံၬနကၥွဲၭ ဒဲဘဲၫမဟူၩယၫအဝီၩအၥိၭ, ဒဲလၫ့လၩ့ အီၩထံၫအီၪဝၬဖီၩ့လးဆီၩ့ဆီနီၪ လၩ့ဂၬဘဲၫမနံၬမၠၬ အၥိၭလီၫ.",
			"4": "<sup>4</sup> လးဆီၩ့ဆီနံၫဆံၫလံဖျိၪ့အီၪဝၬဖီၩ့လးဆီၩ့ဆီနီၪ တၭ, ၦၥုၪ့က့ၭၥၭၡါကီၩ့ၥိၭဝ့ၫ လၧဆၧဘွၩဒဲချႃၬ ၥရဖူၩထီၫ့နံၫဆံၫလံဂၩဆၧၫ့နၩ့ဝ့ၫလၧအလးဆီၩ့ဆီ လဖၪအဖၫ့ခိၪလီၫ.",
			"5": "<sup>5</sup> လၫ့ဝဲအဒံၭ,ဒဲလၫ့ဎွံၩ့, ဒဲဆၧအလူၥီၫလဖၪစဲၪ့ထၪ့ ဝ့ၫလၧလးဆီၩ့ဆီအဖၧၩ့တၭ, မ့ၪဒိၩ့နွ့ၫဖျိၪ့လၧအမွဲ ယွၩအၥၭနွ့ၫဖျိၪ့ခဲၩထၪ့လၧလးဆီၩ့ဆီအမ့ၬယၫ",
			"6": "<sup>6</sup> လီၫ.- တၭမၫဆမံၭဘဲၫနွၫအၥိၭလၩ့ဂၬလၧလိးဖျီၪ ၥလၩအီၪဝ့ၫ လၧလးဆီၩ့ဆီအမ့ၬယၫလီၫ. ဆၧအ မၧၫ့လံဒုၩလၧၫ့ဎွ့ၩဝ့ၫ လၧအမ့ၬၥၪလၧအမ့ၬယၫ, ဒဲအချိၫ့လခီၫဆ့တၭ, အီၪဝ့ၫလၧလးဆီၩ့ဆီအကျၩဒဲ",
			"7": "<sup>7</sup> အီၪဝၬဖီၩ့ လးဆီၩ့ဆီလီၫ.- ဆၧအမၧၫ့အခၪ့ထံၭလ ဒုၩနီၪလၩ့ဂၬဆၬလၥၧၫ့တၭ, ဆၧအမၧၫ့နံၫဒုၩလဒုၩ နီၪ,လၩ့ဂၬချီဖိၪတၭ, ဆၧအမၧၫ့ၥၧၫ့ဒုၩလဒုၩနီၪ, အ မ့ၬလၩ့ဂၬၦၡၩတၭ, ဆၧအမၧၫ့လံဒုၩလဒုၩနီၪ, လၩ့",
			"8": "<sup>8</sup> ဂၬလံၬကျီၫ့ကျီၫ့ယူၩဝ့ၫလီၫ.- ဆၧအမၧၫ့လံဒုၩၥံၪအီၪ လၧအဒံၭ, လဒုၩအဒံၭ ဎူၫဘံၪ့ လဒုၩဎူၫဘံၪ့တၭ, လၧၫ့ဎွ့ၩလၧအမ့ၬၥၪဝၬဖီၩ့ဝ့ၫလၧအဖၧၩ့လီၫ. မု ဆၫမွဲဂ့ၩ,မုနၩမွဲဂ့ၩ, လအီၪထီဘၪဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ကဆါယွၩ, လၧအၥ့ၪဆၧလူၬနီၪ, လၧအအီၪယူၭဝ့ၫ, ဒဲအီၪဝ့ၫ, ဒဲမိဂဲၫလဂၩနီၪ, ဆံၫ့ဎံၪဝ့ၫ, ဆံၫ့ဎံၪဝ့ၫ, ဆံၫ့ ဎံၪဝ့ၫ နီၪလီၫ.",
			"9": "<sup>9</sup> တၭထီးဆၧအမၧၫ့လံဒုၩၥံၪ ဖ့ၪလၫ့ဆၧလၩဖၩ့,ဒဲ ဆၧယူၭဆၧယၪ့, ဒဲဆၧစံၭထၪ့အၪ့အူၭလၧဆၧလၧအ ဆၧၫ့နၩ့လၧလးဆီၩ့ဆီအဖၫ့ခိၪ,လၧၦအမၧၫ့ဝ့ၫအ",
			"10": "<sup>10</sup> ဆိၩဆိၩအကၠၪကၠၪတၭ,- ၦၥုၪ့က့ၭၥၭၡါ နံၫဆံၫလံ ဂၩထွံၩလၩ့လၧ ဆၧလၧအဆၧၫ့နၩ့ လၧအလးဆီၩ့ဆီ အဖၫ့ခိၪအမ့ၬယၫ, ဒဲဘိၪ့ထၪ့ဘၩထၪ့ ၦလၧအမၧၫ့ဝ့ၫ အဆိၩဆိၩအကၠၪကၠၪ, ဒဲခွံၬလၩ့အၥရဖူၩ လၧလးဆီၩ့",
			"11": "<sup>11</sup> ဆီအမ့ၬယၫတၭ,စံၭဝ့ၫဒၪ,- ပကဆါ, ဒဲပယွၩဧ့, နကြၨၭဒိၭန့ဘၪဆၧလၩဖၩ့, ဒဲဆၧယူၭယၪ့,ဒဲဆၧ စီၩ့ဆၧမၩ့လီၫ. အဂဲးဘဲၫယီၩ နမၩကဲၪထၪ့ဆၧထီး အလူၬတၭ, မွဲနၥၭအီၪဝ့ၫအကၠီၩ့, ဆၧလဖၪနီၪကဲၪ ထၪ့ဝ့ၫ, ဒဲဘၪဆၧမၩကဲၪထၪ့ဝ့ၫလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> ယဒၪဘၪလံၬကွ့ၭအၥၭ လၧအဖၧၩ့ဒဲလၧအချိၫ့ နံၫခီၫလူၬတၭ, စဲၩထၬအၥၭ လၧဆၧစဲၩနဲၪ့ထၬနွ့ၫဖျိၪ့ အီၪလၧၦဆၧၫ့နၩ့ဝ့ၫ လၧလးဆီၩ့ဆီအဖၫ့ခိၪအစူၪ",
			"2": "<sup>2</sup> ထွ့ၪလခီၫလီၫ.- ယဒၪဘၪအၥီၫ့အီၪ လၧအဂဲးဆီၪ့ ဘၭဆီၪ့လဂၩ လၧအကိၭထၪ့ ဆၧလၧအလူဖၭဒိၪ တၭစံၭဝ့ၫဒၪ, မွဲပလၫကြၨၭဝဲထၪ့လံၬတၭ, မၩထ့ဖၭ အဆၧစဲၩနဲၪ့ထၬ လဂၩလဲၪ.",
			"3": "<sup>3</sup> တၭၦအီၪလၧမူၭခိၪမွဲဂ့ၩ, လၧဂၪ့ခိၪမွဲဂ့ၩ, လၧဂၪ့ ခိၪလၬမွဲဂ့ၩ, ဝဲထၪ့လံၬတၭ, ယိဝ့ၫၥ့ၪနီၪ အီၪနးဂၩ",
			"4": "<sup>4</sup> အ့ၬ.- တၭယဂၪ့ထၪ့ဒိၪမၬလီၫ. အဂဲးဘဲၫယီၩၦလၧ အကြၨၭဝဲထၪ့လံၬ, ဒဲယိဝ့ၫနီၪအီၪနးဂၩအ့ၬ.",
			"5": "<sup>5</sup> တၭၦၥုၪ့က့ၭၥၭၡါလဂၩစံၭယၧၩ,ဂၪ့လဂ့ၩ, ယိ ခွါ,ဆၬလၥၧၫ့ ဘၪဆဲၫ့လၧယုဒၫအဒီၪ့, စဒၫဝံၭအဝံ လဂၩနီၪဘဲၫၥိၭအမိဝဲထၪ့လံၬတၭ, မၩထ့ဖၭအဆၧ စဲၩနဲၪ့ထၬနွ့ၫဖျိၪ့နီၪမၩနၧၩ့မၩစၪယူၭဆၧယူၭ.",
			"6": "<sup>6</sup> တၭယဒၪဘၪၥိၪဖိၪ ဘဲၫဆၧမၩၥံၫဝ့ၫအၥိၭဆၧၫ့ ထုၪ့ဝ့ၫလၧဆၧအလးဆီၩ့ဆီ ဒဲလၧဆၧအမၧၫ့လံဒုၩအ ကျၩ, ဒဲလၧၦၥုၪ့က့ၭၥၭၡါၥံၪအကျၩနီၪ အီၪဝ့ၫလၧအ နိၩ့နွ့ၫဘီၩ့ ဒဲအမ့ၬၥၪနွ့ၫတီၪ့ လၧအမွဲယွၩအၥၭနွ့ၫ ဖျိၪ့လၧဆၧအၪ့မၧၫ့လၩ့ဝ့ၫ လၧဂၪ့ခိၪချိၫ့ ဎံၩ့ဎံၩ့လ့ၬ",
			"7": "<sup>7</sup> လီၫ.- အဝ့ၫဒၪနီၪဂဲၫဝ့ၫတၭ, မၩန့လံၬလၧၦဆၧၫ့နၩ့ လၧအလးဆီၩ့ဆီအဖၫ့ခိၪအစူၪထွ့ၪလခီၫနီၪလီၫ.",
			"8": "<sup>8</sup> တၭလၧအမၩန့လံၬနီၪ ဆၧအမၧၫ့လံဒုၩ, ဒဲၦၥုၪ့ က့ၭၥၭၡါၥံၪ နံၫဆံၫလံဂၩနီၪ,အီၪဝ့ၫလၧနါဒံၩ့ဒဲလိၫ့ ထီၫ့လဖၪဎွ့ၩဝ့ၫလၧဆၧဆူၭခဲၩနၧၫ့မၧၫ့လၧအမွဲၦဆံၫ့ ဎံၪအဆၧဘၩဆိၪဖၪ, လဂၩလဖျိၪ့လဂၩလဖျိၪ့တၭ,",
			"9": "<sup>9</sup> ထွံၩလၩ့ဝ့ၫလၧၥိၪဖိၪအမ့ၬယၫလီၫ.- အဝ့ၫၥံၪနီၪဆၬ အလူလၧထၭခိၪအၥၫ့တၭ,စံၭဝ့ၫ, နကြၨၭမၩန့လံၬနီၪ, ဒဲဝဲထၪ့အဆၧစဲၩနဲၪ့ထၬၥံၪလီၫ. အဂဲးဘဲၫယီၩ နထိးၥံၫနၥၭတၭ, နဎွ့ၩန့ထဲၩ့ၦၡၩလၧနၥွံၪ, လၧ ယွၩအဂးလၧကယဲၦအဒီၪ့, ဒဲလၧၦအလၨၥံၪ,ဒဲလၧၦ ခမျၧးၥံၪ, ဒဲလၧကယဲၦကိၭဆၨၩဒ့ၭအကျၩလီၫ.",
			"10": "<sup>10</sup> နမၩကဲၪထၪ့အဝ့ၫၥံၪ လၧအဘၩ့အမုး, ဒဲၦလုဆၧလ ဖၪလၧယွၩအဂးတၭ, အဝ့ၫၥံၪမိပၧၩ့ဆၧလၧဂၪ့ခိၪ ချိၫ့လီၫ.",
			"11": "<sup>11</sup> ယယိဆၧတၭ, ယနါဂၧၫ့အၥီၫ့အၪဂၩ အီၪဝၬဖီၩ့အ လးဆီၩ့ဆီ ဒဲဆၧအမၧၫ့လဖၪ ဒဲၦၥုၪ့က့ၭၥၭၡါလဖၪ နီၪအလူလီၫ. အဆၧဝံဆၧနၬ အီၪဝ့ၫအလၬအဘျၩ့အ",
			"12": "<sup>12</sup> လၬဒဲအထီၫ့ၥံၪအဘျၩ့အထီၫ့လီၫ.- စံၭဝ့ၫလၧအ လူဖၭဒိၪ, ၥိၪဖိၪလၧအထိးၥံၫအၥၭနီၪ ကြၨၭန့ဘၪအ စီၩ့အမၩ့,ဒဲဆၧလၧၫ့ဆၧဎွ့ၩ, ဒဲဆၧကိၪ့ၥ့ၪကိၪ့ဘၪ ဒဲဆၧဂဲးဆၧဘၭ, ဒဲဆၧယူၭဆၧယၪ့, ဒဲဆၧလၩဆၧ ဖၩ့, ဒဲဆၧစံၭထၪ့အၪ့အူၭဝ့ၫလဖၪလီၫ.",
			"13": "<sup>13</sup> တၭကယဲဆၧလၧမူၭခိၪ, ဒဲလၧဂၪ့ခိၪချိၫ့, ဒဲလၧ ဂၪ့ခိၪလၬ, ဒဲလၧအအီၪလၧမၫဆမံၭဖၧၩ့, ဒဲကယဲဆၧ အီၪလၧဆၧနီၪလဖၪအဖၧၩ့ ထီးအလူၬနီၪယနါဂၧၫ့ လၧအစံၭဝ့ၫ, ဆၧစံၭထၪ့အၪ့အူၭ, ဒဲဆၧယူၭဆၧယၪ့, ဒဲဆၧလၩဆၧဖၩ့,ဒဲဆၧဂဲးဆၧဘၭလဖၪ, မွဲအအီၪ လၧၦလၧအဆၧၫ့နၩ့လၧလးဆီၩ့ဆီအဖၫ့ခိၪဒဲၥိၪဖိၪနီၪ",
			"14": "<sup>14</sup> အဆိၩဆိၩ အကၠၪကၠၪဆံၭ.- တၭဆၧအမၧၫ့ လံဒုၩ စံၭဝ့ၫ,အၩမံၩ့. ၦၥုၪ့က့ၭၥၭၡါၥံၪ ထွံၩလၩ့ဘိၪ့ ထၪ့ဘၩထၪ့ဝ့ၫလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> တၭယယိဆၧ, ထီးၥိၪဖိၪအီၪဝဲထၪ့ဆၧစဲၩနဲၪ့ထၬ လဖျိၪ့လၧဆၧစဲၩနဲၪ့ထၬနွ့ၫဖျိၪ့အကျၩနီၪ ယနါဂၧၫ့ ဆၧအမၧၫ့လဒုၩ စံၭဝ့ၫဘဲၫလၫ့ဎွံၩ့အၥိၭ, ဂဲၫဘီၪ.",
			"2": "<sup>2</sup> ယယိဆၧတၭ, ယိခွါ,ကၥ့ၪဘွၩ,ဒဲၦလၧအဆၧၫ့နၩ့ လၧအလီၩ့လဂၩ အီၪလၧအချံၪလီၫ. တၭဆၧဖ့ၪလၫ့ ဝ့ၫၥရဖူၩနီၪ မွဲဘဲၫၥိၭအမိမၩနၧၩ့မၩစၪဆၧတၭ, စဲၪ့ ထၪ့မၩနၧၩ့မၩစၪဆၧလီၫ.",
			"3": "<sup>3</sup> တၭထီးအဝဲထၪ့ ဆၧစဲၩနဲၪ့ထၬနံၫဖျိၪ့လဖျိၪ့နီၪ, ယနါဂၧၫ့ဆၧ အမၧၫ့နံၫဒုၩလဒုၩ စံၭဝ့ၫဒၪ, ဂဲၫဘီၪ.",
			"4": "<sup>4</sup> ကၥ့ၪဝီၩစဲၪ့ထၪ့ဝ့ၫ လဒုၩဒၪတၭ, ၦလၧအဆၧၫ့နၩ့လၧ အလီၩ့လဂၩနီၪ, ဆၧဖ့ၪလၫ့ဝ့ၫ အထုၭခွံၬဆၧဘၪလိၬ အိၭလိၬ လၧဂၪ့ခိၪချိၫ့ ဒဲဘဲၫၥိၭ ၦမိမၩၥံၫလိၬအၥၭ နီၪ,ဆၧဖ့ၪလၫ့ဝ့ၫ လၧအနၭဖၭဒိၪလဘံၪ့လီၫ.",
			"5": "<sup>5</sup> တၭထီးအဝဲထၪ့ဆၧစဲၩနဲၪ့ထၬ ၥၧၫ့ဖျိၪ့လဖျိၪ့နီၪ, ယနါဂၧၫ့ဆၧအမၧၫ့ ၥၧၫ့ဒုၩလဒုၩနီၪ စံၭဝ့ၫ, ဂဲၫဘီၪ. တၭယယိဆၧနီၪ, ယိခွါ, ကၥ့ၪၥၧၫ့လဒုၩ, ဒဲၦလၧအ ဆၧၫ့နၩ့လၧအလီၩ့လဂၩ ဆၧခံၫ့အီၪဝ့ၫ လၧအစူၪဖၧၩ့",
			"6": "<sup>6</sup> လီၫ.- ယနါဂၧၫ့ဆၧအလူ လၧဆၧမၧၫ့လံဒုၩအကျၩ စံၭဝ့ၫဒၪ, ဘုၪကၠိၩ့လတလိၭ လၧဒန့ရံၫ လဘံၪ့အဂး, ဒဲဘုၪမုယီၩ ၥၧၫ့တလိၭ လၧဒန့ရံၫ လဘံၪ့အဂးလီၫ-. တၭထီးမၩဂၭဂီၩ့ၥိၪဒဲစဘံၭထံၫနီၪလဂ့ၩ.",
			"7": "<sup>7</sup> တၭထီးအဝဲထၪ့ ဆၧစဲၩနဲၪ့ထၬ လံဖျိၪ့လဖျိၪ့နီၪ, ယနါဂၧၫ့ဆၧအမၧၫ့ လံဒုၩလဒုၩနီၪစံၭဝ့ၫ, ဂဲၫဘီၪ.",
			"8": "<sup>8</sup> ယယိဆၧတၭ, ယိခွါ,ကၥ့ၪပၠူၭလဒုၩနီၪ ၦလၧအဆၧၫ့ နၩ့လၧအလီၩ့လဂၩ အမံၩ့မွဲဆၧၥံၫတၭ ဖျႃဖိၬထၪ့အ ခဲၫ့လီၫ. တၭဆၧဖ့ၪလၫ့ဝ့ၫလၧအစီၩ့အမၩ့ လၧဂၪ့ခိၪ လံစီၪ့လစီၪ့အဖၫ့ခိၪ, ဘဲၫၥိၭအမိမၩၥံၫဆၧလၧနၭ, ဒဲ လၧဆၧၥၭဝံလၩ့ဒိၩ, ဒဲလၧဆၧၥံၫ, ဒဲလၧဂၪ့ခိၪအ ဆၧမံၩ့လၬၥံၪလီၫ.",
			"9": "<sup>9</sup> တၭထီးအဝဲထၪ့ဆၧစဲၩနဲၪ့ထၬ ယဲဖျိၪ့လဖျိၪ့နီၪ,ယ ဒၪဘၪ ၦလၧအထိးၥံၫအၥၭလၧယွၩအလူအထၫအ ကၠီၩ့, ဒဲလၧအဆၧထိးအၥၭလၧအထိးဝ့ၫအကၠီၩ့လဖၪ",
			"10": "<sup>10</sup> အၥၭၡီၩ့ၥံၪအီၪလၧဆၧလုအလးအဖၫ့လၬလီၫ.- အ ဝ့ၫၥံၪကိၭထၪ့ လၧအလူဖၭဒိၪတၭစံၭဝ့ၫ, ဆၧဆံၫ့ဎံၪ, လၧအမွဲအတီၩအကဆါဧ့, နလစ့ၩရၫ့ဘၪၦအီၪလၧ ဂၪ့ခိၪချိၫ့လဖၪတၭ, နလဖ့ၪလၫ့ဘၪအဆၧဒဲၩဘၭလၧ",
			"11": "<sup>11</sup> ပၥွံၪအကၠီၩ့တၭ,မွဲနမိအီၪဆံၭယံၬလဲၪ.- ဆၧဖ့ၪလၫ့ ဝ့ၫလဂၩဘၪလဂၩလၧအဝိၬလိၫ့ဘွၩတၭ, ဆၧလီၩ ဘၪအဝ့ၫၥံၪလၧအမိဘၪအီၪပွံၭလဆိဖိၪထီးအဎီး အၡၩ ခီၫဎီး အၡၩး ဒဲထၧၫ့ဖုဝဲခီၫအထၧၫ့ဖုဝဲၥံၪလၧ အမိဘၪဆၧမၩၥံၫဝ့ၫ, ဘဲၫအဝ့ၫၥံၪအၥိၭနီၪဝံထၪ့ နၬထၪ့မိလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫလီၫ.",
			"12": "<sup>12</sup> တၭယယိဆၧ, ထီးအဝဲထၪ့ဆၧစဲၩနဲၪ့ထၬဎူၫဖျိၪ့ လဖျိၪ့နီၪတၭ, ဂၪ့ခိၪဝၭဒိၪမၬ,ဒဲမုမ့ၬၥၧၫ့တၪ့ဘဲၫ ရၧၬအဆၧယၬထၭဝ့ၫလၧဆၧဆီၪ့ၥၧၫ့အၥိၭတၭ,",
			"13": "<sup>13</sup> လၩကဲၪထၪ့ဘဲၫဆၧၥွံၪအၥိၭ,- တၭၡၪၥံၪလၧမူၭဖိၭ ဖၫ့လၩ့ဎွံၪခွံၬဝ့ၫလၧမူၭခိၪ, ဘဲၫချိၪ့ဒိၩ့ၥၪလၧအလ မံၫ့ဒံၭဘၪ, လၧအဘၪဆၧမၩဝၭဝ့ၫလၧလံၩမုအၥိၭနီၪ",
			"14": "<sup>14</sup> လီၫ.- မူၭခိၪဒံၩခွံၬ, ဘဲၫလံၬလၧဆၧထူၫထၪ့ဝ့ၫအ ၥိၭတၭ, ကယဲခိၪလီၩ့ထိၩ့ချိၬ, ဒဲကယဲကျိၩ့လဖၪၥုၭ",
			"15": "<sup>15</sup> ခွံၬအၥၭလီၫ.- တၭဂၪ့ခိၪအစဎွၩၥံၪ, ၦဒိၪၦၡၩၥံၪ, ဒဲၦၥုၭဖိၪလထီၫ့အခိၪၥံၪ ဒဲၦၥထံၫလဖၪ, ဒဲၦအီၪလၧ ဆၧအစီၩ့အမၩ့ၥံၪ, ဒဲကယဲအဎီးအၡၩ,ဒဲကယဲၦပျီၩ ဖျ့ၭလဂၩလါလါနီၪ အီၪက့ၪၥူၪအၥၭလၧဆၧအိၩ",
			"16": "<sup>16</sup> ဖၧၩ့,ဒဲလိးဆူၭလၧခိၪလီၩ့ လဖၪအလီၩ့တၭ,- စံၭလိး ၥံၪလဲၫ့ၥံၪ, ဒဲခိၪလီၩ့ထိၩ့ချိၬၥံၪနီၪ, လၩ့ထ့ၬလၧပလီၩ့ တၭ,မၩဘံၭခွံၬပၧၩလၧၦဆၧၫ့နၩ့လၧလးဆီၩ့ဆီ အဖၫ့ခိၪလဂၩ အမ့ၬယၫ, ဒဲလၧၥိၪဖိၪ အဆၧၥၭထၪ့",
			"17": "<sup>17</sup> ဆံၭ.- အဂဲးဘဲၫယီၩ မုနံၩဖၭဒိၪဘၪဆဲၫ့ လၧအဆၧၥၭ ထၪ့ဘၪယူၭဝ့ၫယူၭတၭ, မွဲပလၫဆၧၫ့ထုၪ့ဝ့ၫမိ ၥ့ၪလဂၩလဲၪ."
		},
		"7": {
			"1": "<sup>1</sup> တၭလၧဆၧယီၩလဖၪအလးခဲၫ့နီၪ, ယဒၪဘၪအၥီၫ့ လံဂၩ ဆၧၫ့ထုၪ့လၧဂၪ့ခိၪ အနိၪ့လံနိၪ့တၭ, ဂၪ့ခိၪမွဲ ဂ့ၩ,မၫဆမံၭမွဲဂ့ၩ, ကယဲၥံၪ့မွဲဂ့ၩ, ဘဲၫၥိၭလံၩထီးအူၪ ဘၪလၧအလီၩ့လဂ့ၩတၭ, ဖီၪ့ထၬလံၩလံဖျီၩ့လီၫ.",
			"2": "<sup>2</sup> တၭယဒၪဘၪအၥီၫ့အဂူၫဂၩ အီၪလၧယွၩလၧအမၧၫ့ ဝ့ၫအဆၧစဲၩနဲၪ့ထၬလဂၩဂဲၫထၪ့လၧမုထၪ့လခီၫ တၭ,ကိၭၡၭထၪ့နီၪ, စံၭအၥီၫ့လံဂၩ လၧဆၧဒုၭမၩ",
			"3": "<sup>3</sup> ဂၭဂီၩ့ဂၪ့ခိၪ, ဒဲမၫဆမံၭ,- တၭစံၭအဝ့ၫဒၪ, ပလချႃၭ စဲၩနဲၪ့ထၬယွၩအဎီးအၡၩၥံၪ လၧအမ့ၬထုးခိၪအလီၩ့ ဒံၭဘၪတၭ, ဂၪ့ခိၪမွဲဂ့ၩ, မၫဆမံၭမွဲဂ့ၩ, ၥံၪ့ၥံၪမွဲဂ့ၩ, ထီးမၩဂၭဂီၩ့လဂ့ၩ.",
			"4": "<sup>4</sup> တၭယနါဂၧၫ့ ၦလၧအဘၪဆၧစဲၩနဲၪ့ထၬ လဖၪအ ဆၧဝံဆၧနၬ, မွဲအအီၪလကုၬလံလၬလံထီၫ့လၧက ယဲၦအံၫစရ့လၭဖိၪ အဒီၪ့အကျၩလီၫ.",
			"5": "<sup>5</sup> လၧယုဒၫအဒီၪ့နီၪ ၦဘၪစဲၩနဲၪ့ထၬဝ့ၫ ၦလလၬနံၫ ထီၫ့တၭး လၧရူဘံၫ့အဒီၪ့နီၪ ၦလလၬနံၫထီၫ့တၭး လၧဂၭအဒီၪ့နီၪ ၦလလၬနံၫထီၫ့တၭး",
			"6": "<sup>6</sup> လၧအၭၡၧၫ့အဒီၪ့နီၪ ၦလလၬနံၫထီၫ့တၭး လၧနၭၥလဲၫအဒီၪ့နီၪ ၦလလၬနံၫထီၫ့တၭး လၧမနၬစ့ၫအဒီၪ့နီၪ ၦလလၬနံၫထီၫ့တၭး",
			"7": "<sup>7</sup> လၧစံမအၧၫ့အဒီၪ့နီၪ ၦလလၬနံၫထီၫ့တၭး လၧလံဝဲၫအဒီၪ့နီၪ ၦလလၬနံၫထီၫ့တၭး လၧအံစခၫအဒီၪ့နီၪ ၦလလၬနံၫထီၫ့တၭး",
			"8": "<sup>8</sup> လၧဇ့ၭဘလၧၫ့အဒီၪ့နီၪ ၦလလၬနံၫထီၫ့တၭး လၧယိၥၭအဒီၪ့နီၪ ၦလလၬနံၫထီၫ့တၭ, လၧဘံၪ့ယမံၫ့အဒီၪ့နီၪ ၦလလၬနံၫထီၫ့တၭး အဝ့ၫၥံၪဘၪဆၧစဲၩ နဲၪ့ထၬဝ့ၫလီၫ.",
			"9": "<sup>9</sup> ဆၧလဖၪနီၪအလးခဲၫ့ ယယိဆၧတၭ, ယိခွါ,ၦခမျၧး ဖၭဒိၪလၧၦဝံထၪ့နၬထၪ့ဝ့ၫလၥ့ၪဘၪနးဂၩနီၪ ဂဲၫလၧ ကယဲၦအဆၨၩၥံၪ,ဒဲလၧကယဲၦအဒီၪ့ၥံၪ, ဒဲလၧက ယဲၦခမျၧးၥံၪ,ဒဲလၧကယဲၦချဲၩ့ဆၧကိၭဆၨၩဒ့ၭအဒီၪ့ အကျၩလဖၪနီၪ,ဆၧၫ့ထုၪ့လၧလးဆီၩ့ဆီ, ဒဲၥိၪဖိၪအ မ့ၬယၫကီၩ့ၥိၭဝိၬလိၫ့ဘွၩတၭ, အီၪလၧစီၩ့မလီၫ့အ",
			"10": "<sup>10</sup> လၪလၧအစူၪဖၧၩ့,- အဝ့ၫၥံၪကိၭၡၭထၪ့ လၧအလူ ဖၭဒိၪတၭ,စံၭဝ့ၫဒၪ, မွဲဆၧထိးထဲၩ့တၩ့ထဲၩ့ အီၪလၧ ပယွၩလၧအဆၧၫ့နၩ့လၧလးဆီၩ့ဆီအဖၫ့ခိၪ ဒဲလၧ ၥိၪဖိၪနီၪဆံၭ.",
			"11": "<sup>11</sup> တၭကယဲအၥီၫ့ဆၧၫ့ထုၪ့ဝၬဖီၩ့ လးဆီၩ့ဆီ,ဒဲၦၥုၪ့ က့ၭၥၭၡါ, ဒဲဆၧအမၧၫ့လံဒုၩလဖၪနီၪ ထွံၩလၩ့လၧ",
			"12": "<sup>12</sup> လးဆီၩ့ဆီအမ့ၬယၫတၭ, ဘိၪ့ထၪ့ဘၩထၪ့ယွၩ,-စံၭ ဝ့ၫဒၪ, အၩမံၩ့. ဆၧစံၭထၪ့အၪ့အူၭဒဲဆၧလၩဆၧ ဖၩ့,ဒဲဆၧကိၪ့ဘၪကိၪ့ၥ့ၪ, ဒဲဆၧစံၭထၪ့အၪ့အူၭအခိး အတၩ, ဒဲဆၧယူၭဆၧယၪ့ ဒဲဆၧအစီၩ့အမၩ့ဒဲဆၧအ ဂဲးအဘၭနီၪ, မွဲအအီၪ လၧပယွၩ အဆိၩဆိၩအကၠၪ ကၠၪဆံၭ. အၩမံၩ့.",
			"13": "<sup>13</sup> ၦၥုၪ့က့ၭၥၭၡါလဂၩ ချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭယၧၩၦ လၧအကီၩ့ဆၧၥိၭဆၧအဂ့ၩအဘွၩနီၪ, မွဲပလၫလဖၪ",
			"14": "<sup>14</sup> လဲၪ.မွဲအဂဲၫအထံၭခီၫခီၫလဲၪ.- တၭယစံၭအဝ့ၫ, က ဆါဧ့,နၥ့ၪယၫနဝ့ၫလီၫ. တၭအဝ့ၫဒၪနီၪစံၭယၧၩ, အ ဝ့ၫၥံၪမွဲၦလၧအဂဲၫထၪ့လၧဆၧၡၪ့ဆၧနၭအဖၧၩ့,",
			"15": "<sup>15</sup> ဒဲအၪ့ဆူၫဝၭဘွၩအဝိၬလိၫ့လၧၥိၪဖိၪအၥွံၪလီၫ.- မၩ အၥၭဘဲၫနီၪတၭ, အီၪဝ့ၫလၧယွၩအလးဆီၩ့ဆီအမ့ၬ ယၫတၭ, မၩအဆၧလၧဆၧလုအဂံၪ့ဖၧၩ့ မုဆၫဆၫမု နၩနၩလီၫ. တၭၦလၧအဆၧၫ့နၩ့လၧလးဆီၩ့ဆီအဖၫ့",
			"16": "<sup>16</sup> ခိၪလဂၩနီၪ မိအီၪဝ့ၫလၧအကျၩလီၫ.- တၭဆၧမိ ၥၭဝံလၧၩ့အၥၭအ့ၬ, တၭဆၧလမိၥူၫအီၩလၧၩ့ဘၪ အၥၭလၧထံၫ, မုမ့ၬလဆ့ၭလၩ့ဘၪလၧအဝ့ၫၥံၪ, တၭ",
			"17": "<sup>17</sup> ဆၧခိဘၪလၧၩ့နးမံၩ့အ့ၬ.- အဂဲးဘဲၫယီၩၥိၪဖိၪအီၪ လၧလးဆီၩ့ဆီအၥၭကျၩနီၪမိယိထဲၩ့ခွါထဲၩ့အဝ့ၫ ၥံၪတၭ,မိၥိၫ့ဝ့ၫ လၧထံၫမၧၫ့အဖၧၩ့ၥံၪ အအီၪတၭ, ယွၩမိထူၭခွံၬအမ့ၬထံၫလၩ့ လၧအမ့ၬၥၪဖၧၩ့ ထီးအ လူၬလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> တၭထီးအဝဲထၪ့ဆၧစဲၩနဲၪ့ထၬ နွ့ၫဖျိၪ့လဖျိၪ့နီၪ, ဆၧအီၪလၩ့မါပံၭလၧမူၭခိၪဘူၭကၪလခီၫနၩရံၩလီၫ.",
			"2": "<sup>2</sup> ယဒၪဘၪအၥီၫ့ၥံၪ လၧအဆၧၫ့ထုၪ့လၧယွၩအမ့ၬယၫ နွ့ၫဂၩတၭ ဆၧဖ့ၪလၫ့ဝ့ၫခွ့ၩနွ့ၫဖျိၪ့လီၫ.",
			"3": "<sup>3</sup> အၥီၫ့လဂၩဒၪအီၪ လၧဆၧဆူၭခဲၩနၧၫ့မၧၫ့ အထွ့ၫ ထီၫ့ဂဲၫဝ့ၫတၭ, ဆၧၫ့ထုၪ့လၧဆၧလုလး အနဲၩ့ထံၭ တၭ,ဆၧဖ့ၪလၫ့ဝ့ၫ လၧဆၧဆူၭခဲၩနၧၫ့မၧၫ့အၪ, ဘဲၫၥိၭ အမိဖ့ၪလၫ့ဝ့ၫ လၧၦဆံၫ့ဎံၪထီးအလူၬအဆၧဘၩ ဆိၪဖၪလၧအဆၧလုလးထီၫ့အဖၫ့ခိၪ,လၧအအီၪလၧ",
			"4": "<sup>4</sup> လးဆီၩ့ဆီအမ့ၬယၫလီၫ.- ဆၧဆူၭခဲၩနၧၫ့မၧၫ့အခူၪ, ဒဲၦဆံၫ့ဎံၪအဆၧဘၩဆိၪဖၪစဲၪ့ထၪ့ လၧအၥီၫ့အစူၪ",
			"5": "<sup>5</sup> ဖၧၩ့တၭ, လ့ၩထၪ့လၧယွၩ အမ့ၬယၫလီၫ.- အၥီၫ့နီၪ မၩန့ဆၧဆူၭခဲၩနၧၫ့မၧၫ့အထွ့ၫတၭ, မၩဎွ့ၩဝ့ၫလၧမ့ၪ အၧၩ့အီၪလၧဆၧလုလးအဖၫ့ခိၪတၭ ခွံၬၡိၭခွံၬဝ့ၫလၧ ဂၪ့ခိၪချိၫ့လီၫ. တၭမၩအၥၭလၧလၫ့ဎွံၩ့ၥံၪ, ဒဲလၫ့ဝဲအ ဒံၭ,ဒဲဆၧအလူၥီၫၥံၪ, ဒဲဂၪ့ခိၪဝၭဝ့ၫလဖၪလီၫ.",
			"6": "<sup>6</sup> အၥီၫ့နွ့ၫဂၩ အီၪလၧခွ့ၩနွ့ၫဖျိၪ့နီၪ, တဲၩ့ဝဲၩအၥၭ ဘဲၫၥိၭအမိအူၪထၪ့ဝ့ၫလီၫ.",
			"7": "<sup>7</sup> အၥီၫ့လၧအခၪ့ထံၭလဂၩနီၪ အူၪထၪ့ခွ့ၩတၭဆၧ ဆၧၩ့လၩ့မုၥၪ ဒဲမ့ၪလဲၩဎုၬအၥၭလၧဆၧၥွံၪတၭ,ဆၧ ခွံၬလၩ့ဝ့ၫလၧဂၪ့ခိၪချိၫ့တၭ, အၪ့ခွံၬဂၪ့ခိၪၥၧၫ့ပိၩ့လ ပိၩ့တၭ,မ့ၪအၪ့ခွံၬ ၥံၪ့ၥၧၫ့ပိၩ့လပိၩ့တၭ, မ့ၪအၪ့ ခွံၬနၪ့အၥံၪ့ထီးအလူၬ လီၫ.",
			"8": "<sup>8</sup> အၥီၫ့နံၫဂၩလဂၩနီၪ အူၪထၪ့ခွ့ၩတၭ, ဆၧလၩ့ဂၬ လၧခိၪလီၩ့ဖၭဒိၪ လၧမ့ၪအၪ့ဝ့ၫနီၪ,ဘၪခွံၬၡိၭခွံၬ အၥၭလၧမၫဆမံၭဖၧၩ့တၭ,မၫဆမံၭၥၧၫ့ပိၩ့လပိၩ့",
			"9": "<sup>9</sup> ကဲၪထၪ့ဆၧၥွံၪလီၫ.- တၭဆၧအီၪလၧမၫဆမံၭဖၧၩ့ လၧအမၧၫ့ဝ့ၫၥၧၫ့ပိၩ့လပိၩ့ၥံၫဝ့ၫတၭ, ကဘၩ့ၥံၪၥၧၫ့ ပိၩ့လပိၩ့ဂၭဂီၩ့ဝ့ၫလီၫ.",
			"10": "<sup>10</sup> အၥီၫ့ၥၧၫ့ဂၩလဂၩနီၪ အူၪထၪ့ခွ့ၩတၭ, ၡၪဖၭဒိၪခဲၩ ဖၩ့ထၪ့ဝ့ၫ ဘဲၫမ့ၪဒိၩ့လဖျိၪ့အၥိၭလၩ့ထ့ၬလၧမူၭ ခိၪတၭ, လၩ့ထ့ၬလၧထံၫချိၬၥၧၫ့ပိၩ့လပိၩ့, ဒဲလၧထံၫ",
			"11": "<sup>11</sup> ဖၧၩ့လဖၪအဖၫ့ခိၪလီၫ.- တၭၡၪလဖျိၪ့နီၪ အမံၩ့မွဲရီး ခၥီၫလီၫ. တၭထံၫၥၧၫ့ပိၩ့လပိၩ့ကဲၪထၪ့ ဎဘဲၫၭ ရီးခၥီၫအၥိၭတၭ, မွဲထံၫခၪအကၠီၩ့နီၪၦၥံၫဝ့ၫအၪဂၩလီၫ.",
			"12": "<sup>12</sup> အၥီၫ့လံဂၩလဂၩနီၪအူၪထၪ့ခွ့ၩတၭ, ဆၧဖ့ၬခွံၬမု မ့ၬၥၧၫ့ကဲၩ့လကဲၩ့,ဒဲလၩၥၧၫ့ကဲၩ့လကဲၩ့, ဒဲၡၪၥၧၫ့ ပိၩ့လပိၩ့, ဘဲၫၥိၭၥၧၫ့ပိၩ့လပိၩ့ မိခံၭလၩ့ဝ့ၫလီၫ. မု ဆၫလဖၩ့ဘၪလၧၥၧၫ့စီၪ့လစီၪ့တၭ, မုနၩမွဲဘဲၫနီၪၥိၭ ဆ့လီၫ.",
			"13": "<sup>13</sup> ယယိဆၧတၭ, ယနါဂၧၫ့လံၬကျီၫ့ကျီၫ့ယူၩဝ့ၫလၧ မူၭဖိၭဖၫ့နီၪ, စံၭဝ့ၫလၧအလူဖၭဒိၪ,လၧအၥီၫ့လၧ အအီၪလၩ့ထးၥၧၫ့ဂၩ လၧအမိအူၪထၪ့ခွ့ၩအၥီၫအ ကၠီၩ့နီၪ,ဆၧအၡၪ့, ဆၧအၡၪ့, ဆၧအၡၪ့အီၪလၧၦၡၩ လၧအအီၪဝ့ၫ လၧဂၪ့ခိၪအလီၩ့လီၫ."
		},
		"9": {
			"1": "<sup>1</sup> အၥီၫ့ယဲဂၩလဂၩနီၪ အူၪထၪ့ခွ့ၩတၭ,ယဒၪဘၪၡၪ လဖျိၪ့လၩ့ထ့ၬလၧမူၭခိၪတၭ,ထီၩ့လၩ့လၧဂၪ့ခိၪချိၫ့ လီၫ. တၭဆၧဖ့ၪလၫ့ဝ့ၫလၧဆၧဖၧၩ့ယိၬအနိၪဝံၬ,",
			"2": "<sup>2</sup> မွဲအဝဲထၪ့ဆၧဖၧၩ့ယိၬနီၪ, ဆၧခူၪဂဲၫထၪ့လၧဆၧဖၧၩ့ ဘဲၫဖံၫ့ချၪဖၧၩ့ဖၭဒိၪအခူၪအၥိၭတၭ, မုမ့ၬဒဲဆၧဖိၭဖၫ့",
			"3": "<sup>3</sup> ခံၭလၩ့ဝ့ၫလၧဆၧဖၧၩ့ခူၪအကၠီၩ့နီၪလီၫ.- ထွ့ၥံၪဂဲၫ ထၪ့လၧဆၧအခူၪအဖၧၩ့လၧဂၪ့ခိၪချိၫ့တၭ, ဆၧဖ့ၪ လၫ့ဝ့ၫလၧအစီၩ့အမၩ့ ဘဲၫဆၧကဲၪ့မ့ၥံၪလၧဂၪ့ခိၪချိၫ့",
			"4": "<sup>4</sup> အီၪလၧအစီၩ့အမၩ့အၥိၭနီၪလီၫ.- တၭဆၧမၪလူၬ အဝ့ၫၥံၪဘဲၫၥိၭအထီးမၩဂၭဂီၩ့နၪ့ၥံၪမံၩ့ၥံၪလၧဂၪ့ ခိၪချိၫ့ဒဲဆၧအၥံၫ့ဆ့ၬ လမံၩ့လါလါ, ဒဲၥံၪ့လမံၩ့လါလါ နီၪနးမံၩ့လဂ့ၩတၭ, အ့ၪမွဲန့ၫၦၡၩ လၧယွၩအဆၧစဲၩ နဲၪ့ထၬ လအီၪဘၪ လၧအမ့ၬထုးခိၪအလီၩ့လဖၪ",
			"5": "<sup>5</sup> လီၫ.- ဘဲၫၥိၭအမိမၩၥံၫဝ့ၫတၭ, ဆၧဒုၭမၩဝ့ၫအ့ၬ. အ့ၪမွဲဘဲၫၥိၭ အမိမၩၡၪ့မၩနၭဝ့ၫ လၩယဲဘံၪ့လီၫ. တၭအဆၧၡၪ့ဆၧနၭနီၪ မၩအၥၭဘဲၫဆၧကဲၪ့မ့ဖျံၬၦ",
			"6": "<sup>6</sup> ၡၩအဆၧၡၪ့ဆၧနၭအၥိၭနီၪလီၫ.- တၭလၧမုနံၩလ ဖၪနီၪ,ၦၡၩအၪ့ဎၬၥံၫလါနၫ့ဒၪန့ဝ့ၫအ့ၬ. တၭဆၧမိ",
			"7": "<sup>7</sup> ၥံၫဘၪအၥၭလါနၫ့ဘိၩဆၧၥံၫမိစဲၪ့ဒၪဝ့ၫလီၫ.- တၭထွ့ ၥံၪအခံးအဂၩ့နီၪလၩ့ဂၬကၥ့ၪအီၪတဲၩ့ဝဲၩအၥၭလၧ အမိဒုၭၥုၭအဂးတၭ, ဆၧအီၪလၧအခိၪဎွံၪလၩ့ဂၬၥရ",
			"8": "<sup>8</sup> ဖူၩထီၫ့နီၪ,အမ့ၬလၩ့ဂၬၦၡၩအမ့ၬ,- အီၪဝ့ၫလၧ အခိၪၥူၫလၩ့ဂၬၦမုၪအခိၪၥူၫတၭ, အၥွၫလၩ့ဂၬဆၬ",
			"9": "<sup>9</sup> လၥၧၫ့အၥွၫ,- အီၪဝ့ၫလၧထၩ့ဖံၭလၩ့ဂၬ ထၩ့ဖံၭထၭ တၭ,အဒံၭၥီၫထၪ့ဘဲၫလဲၪ့ၥံၪ အီၪလၧကၥ့ၪအၪဒုၩစဲၪ့",
			"10": "<sup>10</sup> လၧဆၧဒုၭၥုၭအဖၧၩ့အၥီၫအၥိၭနီၪလီၫ.- အမ့နီၪ လၩ့ဂၬဆၧကဲၪ့မ့ အမ့အီၪလၧအဆူၪတၭ, အီၪလၧအ စီၩ့အမၩ့လၧအမ့ၥံၪအဖၧၩ့ ဘဲၫၥိၭအမိမၩၡၪ့မၩ",
			"11": "<sup>11</sup> နၭၦၡၩလၩယဲဘံၪ့လီၫ.- အဝ့ၫၥံၪအစဎွၩလၧအ ဖၫ့ခိၪမွဲဆၧယိၬအၥီၫ့လဂၩတၭ, အမံၩ့လၧဟံဘြုၫအ ဆၧချဲၩ့မွဲအဘၭဒၧၫ့တၭ, အ့ၪမွဲအမံၩ့လၧဂံစၭအဆၧ ချဲၩ့မွဲအပီလယၧၫ့လီၫ.",
			"12": "<sup>12</sup> ဆၧၡၪ့ဆၧနၭလမံၩ့ဖီၩ့ခွံၬယူၭ. ယိခွါ,ဆၧလ ဖၪအလးခဲၫ့နီၪ ဆၧၡၪ့မိဂဲၫဒံၭနံၫမံၩ့လီၫ.",
			"13": "<sup>13</sup> အၥီၫ့ဎူၫဂၩလဂၩနီၪ အူၪထၪ့ခွ့ၩတၭယနါဂၧၫ့ဆၧ ၥီၫဂဲၫထၪ့လၧဆၧလုလးထီၫ့အဆၧနိၩ့လံနိၩ့ အကျၩ",
			"14": "<sup>14</sup> လၧအအီၪလၧယွၩအမ့ၬယၫ,- တၭစံၭအၥီၫ့ဎူၫဂၩ လဂၩလၧအအီၪလၧခွ့ၩနီၪ, ကွဲၪလၩ့ခွံၬအၥီၫ့လံဂၩ လၧအဘၪဆၧစၧၩ့ထၬအၥၭ လၧထံၫချိၬဖၭဒိၪယုၫဖ့ ထံၫအဖၧၩ့ဆံၭ.",
			"15": "<sup>15</sup> တၭအၥီၫ့လံဂၩၥံၪ လၧအတဲၩ့ဝဲၩယူၭအၥၭလၧအ နၩရံၩဒဲအနံၩ, ဒဲအလၩ, ဒဲအနံၪ့အဂးနီၪ, ဘၪဆၧကွဲၪ လၩ့ခွံၬဝ့ၫ, ဘဲၫၥိၭအမိမၩၥံၫ ၦၡၩၥၧၫ့ပိၩ့လပိၩ့",
			"16": "<sup>16</sup> လီၫ.- ၦကၥ့ၪၥုၭဖိၪအဆၧဝံဆၧနၬနီၪမွဲနံၫကုၬအဘျၩ့ လထီၫ့တၭ,ယနါဂၧၫ့အဆၧဝံဆၧနၬလီၫ.",
			"17": "<sup>17</sup> ဘဲၫနီၪအၥိၭယဒၪဘၪဆၧ လၧယၫလခီၫတၭ,ယဒၪ ဘၪကၥ့ၪလဖၪ, ဒဲၦလၧအဆၧၫ့နၩ့ လၧအလီၩ့အီၪလၧ အထၩ့ဖံၭမ့ၪ ဒဲၥၧၫ့ဝီၩ, ဒဲလၩ့ဂၬကးဒဲကၥ့ၪအခိၪဎွံၪ လၩ့ဂၬလၧဆၬလၥၧၫ့အခိၪဎွံၪတၭ,မ့ၪဒဲဆၧအခူၪ,",
			"18": "<sup>18</sup> ဒဲကးၥံၪဂဲၫထၪ့ လၧအခိၬဖၧၩ့လီၫ.- တၭၦၡၩၥၧၫ့ပိၩ့ လပိၩ့ဘၪၥံၫလၧမ့ၪ, ဒဲဆၧအခူၪ, ဒဲကးလၧအဂဲၫထၪ့",
			"19": "<sup>19</sup> လၧအခိၬဖၧၩ့ၥၧၫ့မံၩ့နီၪ အကၠီၩ့လီၫ.- အဂဲးဘဲၫယီၩ ကၥ့ၪလဖၪ အစီၩ့အမၩ့ အီၪလၧအနိၭဖၧၩ့ဒဲလၧ အမ့လီၫ. အဂဲးဘဲၫယီၩ မွဲအမ့ဒဲအခိၪဎွံၪလၩ့ဂၬဂူနီၪ",
			"20": "<sup>20</sup> တၭ, မၩၡၪ့မၩနၭဆၧ လၧအဝ့ၫၥံၪလီၫ.- တၭၦၡၩအီၪ လၩ့ထးလၧဆၧၡၪ့ဆၧနၭယီၩ လမၩၥံၫဘၪဝ့ၫလဖၪ နီၪ,လနီၫ့ယါလၩ့ထဲၩ့ဘၪအၥၭလၧအစူၪအဆၧမၩ, ဘဲၫၥိၭအထီးဘၩထၪ့ဆၧနၪ,ဒဲဆၧဂၩ့ထီး,ဒဲဆၧ ဂၩ့စ့ၩ,ဒဲဆၧဂၩ့ထီၫ့,ဒဲဆၧဂၩ့လိး,ဒဲဆၧဂၩ့ၥံၪ့လၧအ ဒၪဆၧလၥ့ၪ,နါဂၧၫ့ဆၧလၥ့ၪ,စဲၪ့လၥ့ၪဘၪလဖၪနီၪ",
			"21": "<sup>21</sup> လဂ့ၩလီၫ.- တၭအဝ့ၫၥံၪနီၫ့ယါလၩ့ထဲၩ့အၥၭလၧဆၧ မၩၥံၫၦၡၩ,ဒဲလၧဆၧအူၪဆၧပီၩ,ဒဲလၧအဆၧမၩ မၪမုၪမၩမၪခွၫ, ဒဲလၧအဆၧအၪ့ဂူၪအၪ့ဘျၪၥံၪနီၪဆ့ အ့ၬ."
		},
		"10": {
			"1": "<sup>1</sup> ယဒၪဘၪအၥီၫ့ ဂူၫဂၩလဂၩ လၧအဂဲးဆီၪ့အဘၭ ဆီၪ့တၭ, ကီၩ့ၥိၭဆၧအုၪ့ဂဲၫလၩ့လၧမူၭခိၪတၭ, လၫ့ လၩ့အီၩထံၫအီၪလၧအခိၪဎွံၪအလီၩ့တၭ, အမ့ၬအ နၫလၩ့ဂၬမုမ့ၬတၭ, အခၪ့လၩ့ဂၬမ့ၪအၧၩ့ အထုၪ့",
			"2": "<sup>2</sup> လီၫ.- လံၬဖိၪအီၪဝဲထၪ့အၥၭ လဘံၪ့အီၪဝ့ၫလၧအစူၪ ဖၧၩ့လီၫ. မွဲအအီၪက့ၪလၩ့ အခၪ့ထွ့ၪလခီၫ လၧမၫ",
			"3": "<sup>3</sup> ဆမံၭအဖၫ့ခိၪ, ဒဲအခၪ့စ့ၪလခီၫလၧခီၫ့,- တၭကိၭၡၭ ထၪ့လၧအလူဖၭဒိၪ, ဘဲၫဆၬလၥၧၫ့ယုၩ့ဆၧအၥိၭ နီၪလီၫ. ထီးအကိၭၡၭထၪ့တၭ,လၫ့ဎွံၩ့ထၪ့နွ့ၫထံၪ လီၫ.",
			"4": "<sup>4</sup> တၭလၧလၫ့ဎွံၩ့ထၪ့ နွ့ၫထံၪနီၪ, ဘူၭလၧယမိကွ့ၭ ဆၧတၭ, ယနါဂၧၫ့ဆၧၥီၫလၧမူၭခိၪ, စံၭဝ့ၫ,စဲၩနဲၪ့ထၬ ဆၧလၧလၫ့ဎွံၩ့ထၪ့ နွ့ၫထံၪစံၭဝ့ၫနီၪ,ကွ့ၭလၩ့လဂ့ၩ,",
			"5": "<sup>5</sup> တၭအၥီၫ့လၧယဒၪဘၪ အဆၧၫ့ထုၪ့လၧမၫဆမံၭအ ဖၫ့ခိၪ, ဒဲလၧခီၫ့လဂၩနီၪ, ယူၬထၪ့အစူၪလၧမူၭခိၪ",
			"6": "<sup>6</sup> တၭ,-ဆိၪလၩ့အၥၭ လၧဆၧလၧအမၧၫ့ဝ့ၫအဆိၩဆိၩ အကၠၪကၠၪတၭ,ၦလၧအမၩကဲၪထၪ့မူၭခိၪဒဲဆၧအီၪ ဝ့ၫလၧအဖၧၩ့, ဒဲဂၪ့ခိၪဒဲဆၧအီၪဝ့ၫလၧအချိၫ့ခိၪ, ဒဲမၫ ဆမံၭ, ဒဲဆၧအီၪဝ့ၫလၧအဖၧၩ့လဂၩအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ, ဆၧအဆၧၫ့အထီလမိအီၪလၧၩ့ဘၪလီၫ.",
			"7": "<sup>7</sup> ဆၧအၥီၫ့နွ့ၫဂၩလဂၩအမုနံၩလဖၪအၥီၫနီၪ, ထီးအ လၩ့ဘူၭလၧအမိအူၪထၪ့ခွ့ၩတၭ, ထီးနီၪလဖၧၫ့ယွၩ အဆၧအီၪၥူၪမိလၧၫ့ထၪ့ဎွ့ၩထၪ့ဘဲၫအလီၩဘၪဝ့ၫ လၧအခ့ၫအၡၩမီၪၥံၪအၥိၭနီၪလီၫ.",
			"8": "<sup>8</sup> တၭဆၧၥီၫလၧယနါဂၧၫ့ လၧမူၭခိၪချဲၩ့ထၪ့ဒီၭဆၧ လၧယၧၩတၭ, စံၭဝ့ၫဒၪ, လ့ၩမၩန့လံၬဖိၪလၧအ အီၪဝဲထၪ့အၥၭ လၧအၥီၫ့လၧအဆၧၫ့ထုၪ့လၧမၫဆမံၭ",
			"9": "<sup>9</sup> အဖၫ့ခိၪဒဲ လၧခီၫ့လဂၩအစူၪဖၧၩ့နီၪဆံၭ.- ယလ့ၩလၧ အၥီၫ့နီၪအအီၪတၭ, ယစံၭအဝ့ၫ, ဖ့ၪလၫ့ယၧၩလၧလံၬ ဖိၪနီၪဆံၭ. အဝ့ၫဒၪနီၪ စံၭယၧၩ, မၩန့တၭအၪ့ခွံၬ ဘီၪ.တၭမိမၩခၪနဂူၭဖိၫ့, အ့ၪမွဲလၧနနိၭဖၧၩ့နီၪ, မိဆၧၫ့ဝ့ၫဘဲၫန့ၫစၩ့အၥိၭလီၫ.",
			"10": "<sup>10</sup> တၭယမၩန့လံၬဖိၪ လၧအၥီၫ့အစူၪဖၧၩ့နီၪ, ယအၪ့ ခွံၬအဝ့ၫလီၫ. အီၪဝ့ၫလၧယနိၭဖၧၩ့ ဆၧၫ့ဝ့ၫဘဲၫန့ၫစၩ့ အၥိၭတၭ, ထီးယအၪ့ခွံၬဝ့ၫတၭ, ယဂူၭဖိၫ့ခၪထၪ့ဝ့ၫ",
			"11": "<sup>11</sup> လီၫ.- တၭအဝ့ၫဒၪစံၭယၧၩ, နဘၪချဲၩ့ဒီၭဆၧလၧမီၪ အချိၬလၧၦခမျၧးအၪ, ဒဲလၧၦအၪဆၨၩလဖၪ, ဒဲလၧ ၦချဲၩ့ဆၧအလၨအၪဆၨၩလဖၪ, ဒဲလၧစဎွၩအၪဂၩၥံၪ အဂဲးအကၠီၪ့လီၫ."
		},
		"11": {
			"1": "<sup>1</sup> တၭဆၧဖ့ၪလၫ့ယၧၩ လၧဖီးဘီၩ့လဘီၩ့လၩ့ဂၬနိၪ ထိၭဘီၩ့စံၭဝ့ၫဒၪ, ဂဲထုၪ့တၭ, ထိၪယွၩအဆၧလုအ ဂံၪ့,ဒဲဆၧလုအလး ဒဲၦလၧအဘိၪ့ထၪ့ဘၩထၪ့ဆၧလၧ",
			"2": "<sup>2</sup> အဖၧၩ့လဖၪဆံၭ.- အ့ၪမွဲဆၧလုဂံၪ့အဝၩ့လၧခီၫ့နီၪ ခွံၬၡိၭခွံၬဝ့ၫတၭ, ထီးထိၪလဂ့ၩး အဂဲးဘဲၫယီၩဆၧ ဖ့ၪလၫ့ဝ့ၫလၧၦဆၨၩလဖၪအစူၪဖၧၩ့တၭ,အဝ့ၫၥံၪမိ ယဲးလၩ့ဒိၩ့ဆံၫ့ဎံၪလၩလံဆံၫနံၫဘံၪ့လီၫ.",
			"3": "<sup>3</sup> တၭယမိဖ့ၪလၫ့ ဎအစီၩ့အမၩ့ၭ လၧယၡၩ ထိးအ ၥၭနံၫဂၩနီၪ,ကီၩ့ၥိၭဝ့ၫလၧရၧၬအဆၧယၬတၭ, ချဲၩ့ ဆၧလၧမီၪအချိၬ အနံၩလထီၫ့နံၫယၩဎူၫဆံၫလီၫ.",
			"4": "<sup>4</sup> အဝ့ၫၥံၪနီၪမွဲၥံၪ့အလဲအိၫ့နံၫထုၪ့, ဒဲမ့ၪဒိၩ့အလးနံၫ ဖျိၪ့လၧအဆၧၫ့ထုၪ့ဝ့ၫလၧဂၪ့ခိၪအကဆါအမ့ၬယၫ",
			"5": "<sup>5</sup> လီၫ.- ၦလဂၩဂၩအ့ၪမိမၩၡၪ့မၩနၭဘၪအၥၭ လၧအ ဝ့ၫၥံၪနီၪ,မ့ၪဂဲၫထၪ့လၧအဝ့ၫၥံၪအနိၭဖၧၩ့တၭ, အၪ့ ခွံၬအဒုၪအဒၩၥံၪတၭ, ၦအ့ၪမိမၩၡၪ့မၩနၭဘၪအၥၭ လၧအဝ့ၫၥံၪလဂၩဂၩနီၪ, မွဲအမိဘၪဆၧမၩၥံၫခွံၬဝ့ၫ",
			"6": "<sup>6</sup> ဘဲၫနီၪအၥိၭလီၫ.- အဝ့ၫၥံၪနီၪအီၪလၧအစီၩ့အမၩ့ လၧအကၭဘံၭထၬမူၭခိၪၥ့ၪ, ဘဲၫၥိၭထီးအမုနံၩလ ဖၪလၧအချဲၩ့ ဆၧလၧမီၪအချိၬနီၪ, ဆၧထီးဂဲၫဆၧၩ့ လၩ့ဘၪလဂ့ၩတၭး အီၪဝ့ၫလၧအစီၩ့အမၩ့လၧထံၫအ ဖၫ့ခိၪဘဲၫၥိၭအမိမၩကဲၪထၪ့ထံၫလၧဆၧၥွံၪတၭ, ထီးဒၪအဘၪအၥၭ လဖၧၫ့ဖၧၫ့နီၪ မွဲအဒိၪဂၪ့ခိၪလၧ",
			"7": "<sup>7</sup> ဆၧၡၪ့ဆၧနၭ လမံၩ့လါလါၥ့ၪဝ့ၫလီၫ.- ထိးအၥၭထီး အလူၬဂီၩ့တၭ, ဆၧမံၩ့လၬလၧအဂဲၫထၪ့လၧဆၧယိၬ အဖၧၩ့လဒုၩမိဒုၭလိၬအၥၭလၧအဝ့ၫၥံၪတၭ, မိ",
			"8": "<sup>8</sup> မၩနၧၩ့မၩစၪဝ့ၫ ဒဲမၩၥံၫဝ့ၫဒၪလီၫ.- အဝ့ၫၥံၪအစွၪလ ဖၪမိအီၪဝ့ၫလၧဒိၩ့ဖၭဒိၪအဖၧၩ့ၥၭ, လၧၦကိၭဝ့ၫ လၧၥၭအချိၬလၧစီဒၧၫ့ဒဲအံဇံၭနီၪ, ထီးပကဆါထိးၥံၫ",
			"9": "<sup>9</sup> အၥၭလၧထုၪ့စူၪယၫအလီၩ့အလးနီၪလီၫ.- တၭၦ ဘၪဆဲၫ့လၧၦခမျၧး, ဒဲၦအဒီၪ့, ဒဲၦချဲၩ့ဆၧအလၨအ ဂူၫဂၩလဖၪ, ဒဲၦဆၨၩလဖၪနီၪ, မိယိအစွၪၥၧၫ့နံၩဒဲ ဖိၭဖၫ့နံၩတၭ, မိဒုၭခုၪ့လၩ့ဘၧၩ့ဝ့ၫလၧဆၧၥွၪခိၪအဖၧၩ့",
			"10": "<sup>10</sup> အ့ၬ.- ၦလၧအအီၪဝ့ၫ လၧဂၪ့ခိၪချိၫ့ မိၥုၪ့ထိၬၥၭထိၬ တၭ,မိမုၬလၩဝ့ၫတၭ, မိဖ့ၪလၫ့လိၬအၥၭ လၧဆၧဖ့ၪ လၫ့ဆုၬဆုၬလီၫ. အဂဲးဘဲၫယီၩ မီၪနံၫဂၩနီၪ မၩၡၪ့ မၩနၭၦအီၪဝ့ၫ လၧဂၪ့ခိၪချိၫ့လီၫ.",
			"11": "<sup>11</sup> ၥၧၫ့နံၩ ဒဲဖိၭဖၫ့နံၩဖီၩ့ခွံၬနီၪ, ယွၩအၥၭမၧၫ့ဂဲၫ နုၬလၧအဝ့ၫၥံၪအဖၧၩ့တၭ, ဆၧၫ့ထုၪ့ထၪ့ဝ့ၫ လၧအခၪ့ တၭ, ၦလၧအဒၪဘၪလဖၪ ၥၭမဲၪၥၭဖျဲၩ့ဝ့ၫဒိၪမၬလီၫ.",
			"12": "<sup>12</sup> အဝ့ၫၥံၪနါဂၧၫ့ ဆၧအလူၥီၫဖၭဒိၪ လၧမူၭခိၪတၭ, စံၭ ဝ့ၫ,ဂဲၫထၪ့ထီးယီၩဆံၭ. မွဲအလ့ၩထၪ့ဝ့ၫ လၧမူၭခိၪ လၧဆၧအုၪ့အလီၩ့တၭ အဒုၪအဒၩၥံၪဒၪဘၪဝ့ၫ",
			"13": "<sup>13</sup> လီၫ.- တၭဆၧလၧနၩရံၩနီၪ ဂၪ့ခိၪဝၭဝ့ၫဖၭဒိၪလီၫ. ဒိၩ့ဆံၫပိၩ့လပိၩ့လၩ့ဎီးခွံၬဝ့ၫတၭ, ၦဘၪဆၧၥံၫလၧ ဂၪ့ခိၪဝၭဝ့ၫအဖၧၫ့ နွ့ၫထီၫ့လီၫ. ၦအီၪလၩ့ထးလဖၪ ၥၭမဲၪဝ့ၫတၭ, စံၭထၪ့အၪ့အူၭမူၭခိၪအယွၩလီၫ.",
			"14": "<sup>14</sup> ဆၧၡၪ့ဆၧနၭ နံၫမံၩ့လမံၩ့နီၪ ဖီၩ့ခွံၬယူၭ.ယိခွါ, ဆၧၡၪ့ဆၧနၭၥၧၫ့မံၩ့လမံၩ့ မိဂဲၫဝ့ၫဒၪ ချဲၫ့ချဲၫ့လီၫ.",
			"15": "<sup>15</sup> အၥီၫ့နွ့ၫဂၩလဂၩနီၪ, အူၪထၪ့ခွ့ၩတၭ, ဆၧၥီၫ ဖၭဒိၪလဖၪ အီၪဝ့ၫလၧမူၭခိၪတၭ, စံၭဝ့ၫဒၪ,ဂၪ့ခိၪအ ဘၩ့အမုးလဖၪနီၪကဲၪထၪ့ယူၭပကဆါအဆၧ,ဒဲအ ဎရံၬအဆၧတၭ, အဝ့ၫဒၪမိပၧၩ့ဝ့ၫအဆိၩဆိၩအကၠၪ",
			"16": "<sup>16</sup> ကၠၪလီၫ.- ၦၥုၪ့က့ၭၥၭၡါလၧအဆၧၫ့နၩ့လၧအလး ဆီၩ့ဆီ,လၧယွၩအမ့ၬယၫနံၫဆံၫလံဂၩနီၪထွံၩလၩ့",
			"17": "<sup>17</sup> တၭ,ဘိၪ့ထၪ့ဘၩထၪ့ယွၩ,- စံၭဝ့ၫဒၪ, ၦၥ့ၪဆၧလူၬ, ၦအီၪဝ့ၫ ဒဲလၧအအီၪယူၭ, ဒဲလၧအမိဂဲၫဝ့ၫ, ကဆါ ယွၩဧ့, ပစံၭထၪ့အၪ့အူၭနခိးနတၩလီၫ. အဂဲးဘဲၫ ယီၩနမၩန့ နစီၩ့နမၩ့ဒိၪတၭ,နပၧၩ့ယူၭဆၧလီၫ.",
			"18": "<sup>18</sup> ၦဆၨၩလဖၪအၥၭထၪ့တၭ, နဆၧၥၭထၪ့ဂဲၫထီၩ့ ယူၭတၭ,ၦလၧအၥံၫလဖၪနီၪ အထီဘၪဝ့ၫဘဲၫၥိၭအမိ ဘၪဆၧစ့ၩရၫ့တၭ, ဘဲၫၥိၭဆၧမိဖ့ၪလၫ့ဆၧအခိးအ တၭလၧနခ့ၫနၡၩမီၪလဖၪ, ဒဲၦဆံၫ့ဎံၪ, ဒဲၦလၧအ ၥၭမဲၪနမံၩ့, ဒဲဒိၪဒဲဆံၭၥံၪနီၪ, ဘဲၫၥိၭၦလၧအမၩ ဂၭဂီၩ့ဂၪ့ခိၪလဖၪနီၪ, မိဘၪဆၧမၩဂၭဂီၩ့ဝ့ၫလီၫ.",
			"19": "<sup>19</sup> ယွၩအဆၧလုအဂံၪ့အီၪဝဲထၪ့အၥၭလၧမူၭခိၪ တၭဆၧအုၩ့လၩ့အတလၫဖျီၪထၪ့လၧဆၧလုအဂံၪ့ဖၧၩ့, ဒဲလၫ့ဝဲအဒံၭ,ဒဲဆၧၥီၫထၪ့,ဒဲလၫ့ဎွံၩ့ထၪ့, ဒဲဂၪ့ခိၪ ဝၭ,ဒဲမုၥၪဖၭဒိၪလၩ့ဝ့ၫလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> တၭဆၧလၩ့လၭဖၭဒိၪအီၪထၪ့ လၧမူၭခိၪလီၫ.ၦမုၪ လဂၩကီၩ့ၥိၭဝ့ၫလၧမုမ့ၬ, ဒဲလၩအီၪလၧအခၪ့ယၫ ၥၭအဖၫ့လၬတၭ, အၥရဖူၩ အီၪလၧၡၪလဆံၫနံၫဖျိၪ့",
			"2": "<sup>2</sup> အီၪလၧအခိၪဎွံၪအလီၩ့လီၫ.- မွဲအဒၧၩ့ထၪ့ဝ့ၫတၭ, ကိၭၡၭထၪ့လၧအဂူၭဆၫတၭ, ဘၪၡၪ့ဘၪနၭလၧဆၧ ဆီၫ့အီၪန့အကၠီၩ့လီၫ.",
			"3": "<sup>3</sup> ဆၧလၩ့လၭအဂူၫဂၩအီၪထၪ့ လၧမူၭခိၪတၭ, ယိ ခွါ, ၡီၩ့ဝီၩဖၭဒိၪလဘီၩ့နီၪအီၪလၧအခိၪဎွံၪနွ့ၫဖျိၪ့, အနိၩ့ဆံၫဘီၩ့တၭ, ၥရဖူၩနွ့ၫဖျိၪ့ အီၪလၧအခိၪဎွံၪအ",
			"4": "<sup>4</sup> လီၩ့လီၫ.- တၭအမ့မီၩ့ကၠူၭလၩ့ခွံၬ ၡၪၥံၪလၧမူၭခိၪ ၥၧၫ့ပိၩ့လပိၩ့ထီၩ့လၩ့လၧဂၪ့ခိၪချိၫ့လီၫ. တၭၡီၩ့ ဆၧၫ့ထုၪ့ဝ့ၫ လၧၦမုၪလၧအမိဆီၫ့အီၪန့ဆၧလဂၩအ မ့ၬယၫဘဲၫၥိၭ, ထီးအဖိၪအီၪဖျဲၪဝ့ၫတၭ, မိအၪ့ခွံၬဝ့ၫ",
			"5": "<sup>5</sup> လီၫ.- ၦမုၪဆီၫ့အီၪန့အဖိၪခွၫလၧအမိစ့ၩရၫ့ၦကိၭ ဆၨၩဒ့ၭလၧအနိၪထိၭထၭလဘီၩ့တၭ, ဆၧဖျဲးန့အ ဖိၪဆိၬထၪ့ဝ့ၫလၧယွၩ ဒဲအလးဆီၩ့ဆီ အအီၪလီၫ.",
			"6": "<sup>6</sup> တၭၦမုၪနီၪ စဲၪ့ခွံၬထီၩ့လၧမံၩ့လၬကျၩ ထီးယွၩတဲၩ့ ဝဲၩအလး, ဘဲၫၥိၭဆၧမိလုအၪ့လုအီၩဝ့ၫအနံၩလ ထီၫ့နံၫယၩဎူၫဆံၫလီၫ.",
			"7": "<sup>7</sup> တၭဆၧဒုၭဆၧယၩ ဆၧလၧမူၭခိၪအီၪဝ့ၫလီၫ. မဲၫ ခအ့လၭဒဲအၥီၫ့ၥံၪ ဒုၭလိၬအၥၭလၧၡီၩ့တၭ, ၡီၩ့ဒဲအ",
			"8": "<sup>8</sup> ၥီၫ့ၥံၪနီၪဒုၭဝ့ၫဆ့လါနၫ့နီၪ,- လမၩနၧၩ့မၩစၪဘၪဆၧ",
			"9": "<sup>9</sup> တၭ,အလးလအီၪလၧၩ့ဘၪ လၧမူၭခိၪလီၫ.- တၭၡီၩ့ ဖၭဒိၪ,ဂူလးလံၩလၧဖျိၩ့လဘီၩ့, ကိၭဝ့ၫအမံၩ့လၧမုၪ ခီၩလဲးဒဲစၫတၫ့, လၧအအၪ့လီၫန့ ၦဂၪ့ခိၪဖိၪကိၭဂၩ ဒ့ၭနီၪ,ဆၧနၫ့လၩ့ခွံၬအဝ့ၫထီၩ့လၩ့လၧဂၪ့ခိၪချိၫ့ ယီၩ,ဒဲအၥီၫ့လဖၪ ဘၪဆၧနၫ့လၩ့ခွံၬဝ့ၫဆ့လီၫ.",
			"10": "<sup>10</sup> တၭယနါဂၧၫ့ဆၧအလူၥီၫဖၭဒိၪ လၧမူၭခိၪနီၪ,စံၭ ဝ့ၫဒၪ, ဘိၩ့နဲၪ့ယီၩဆၧထိးထဲၩ့တၩ့ထဲၩ့,ဒဲဆၧအစီၩ့ အမၩ့ဒဲပယွၩအဘၩ့အမုး, ဒဲအဎရံၬအဆၧစီၩ့ဆၧမၩ့ အီၪထၪ့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ ၦလၧအအီၪက့ၪဆၧ မၪလၧပထၧၫ့ဖုဝဲၥံၪ အလီၩ့လဂၩနီၪ ဘၪဆၧနၫ့လၩ့ ခွံၬဝ့ၫတၭ, မွဲအအီၪက့ၪဆၧမၪ လၧအဝ့ၫၥံၪအလီၩ့",
			"11": "<sup>11</sup> လၧယွၩအမ့ၬယၫ ကိၭနံၩကိၭနၩဒ့ၭလီၫ.- တၭၦလ ဖၪနီၪမၩနၧၩ့မၩစၪဝ့ၫလၧၥိၪဖိၪအၥွံၪအကၠီၩ့, ဒဲဆၧ အလူလၧအဝ့ၫၥံၪထိးအၥၭအကၠီၩ့လီၫ. တၭအဝ့ၫၥံၪ လလီၫ့ကီၩ့ဘၪအၥၭမၧၫ့နီၪ, ထီးအၥံၫဒၪလ့ၬလီၫ.",
			"12": "<sup>12</sup> မၩအၥၭဘဲၫနီၪတၭ, မူၭခိၪ, ဒဲၦအီၪဝ့ၫလၧအဖၧၩ့ ၥံၪဧ့, ၥုၪ့ဎွံၫၥၭယီၫနၥံၪဝ့ၫဆံၭ.ၦအီၪဝ့ၫလၧဂၪ့ခိၪ ဒဲလၧမၫဆမံၭအဖၧၩ့ၥံၪနီၪဘၪအၡၪ့လီၫ. အဂဲး ဘဲၫယီၩမုၪခီၩလဲးၥ့ၪယၫဝ့ၫလၧအဆၧၫ့အထီလၧအ ဂးမွဲလဆိဖိၪတၭ, ဂဲၫလၩ့ဝ့ၫလၧနၥံၪအအီၪလၧအ",
			"13": "<sup>13</sup> ၥၭထၪ့ဒိၪမၬလီၫ.- ထီးၡီၩ့နီၪ ဒၪဘၪဆၧနၫ့လၩ့ခွံၬဝ့ၫ လၧဂၪ့ခိၪချိၫ့တၭ, ဒုၪဒွ့ၪမၩအၧၩ့မၩၥၫ့ ၦမုၪလၧအဆီၫ့ အီၪန့အဖိၪခွၫနီၪလီၫ.",
			"14": "<sup>14</sup> တၭဆၧဖ့ၪလၫ့ၦမုၪ လၧလံၬကျီၫ့ကျီၫ့ဖၭဒိၪ အဒံၭ နံၫဘံၪ့ဘဲၫၥိၭအမိယူၩဝ့ၫ လၧမံၩ့လၬကျၩ ထီးအ လးလၧဆၧမိလုအၪ့လုအီၩဝ့ၫ, လၧဆၧအဆၧၫ့အထီ, ဒဲဆၧအဆၧၫ့အထီလဖၪ, ဒဲဆၧအဆၧၫ့အထီ ဖိၭဖၫ့ တၭ,ဖီၩ့ဖျ့ၭဝ့ၫ လၧဂူနီၪလီၫ.",
			"15": "<sup>15</sup> တၭဂူနီၪ ပြိၩထွ့ၫၦမုၪနီၪအခဲၫ့ လၧထံၫလၧအနိၭ ဖၧၩ့,ဘဲၫထံၫလုၬဘံၭဆၧအၥိၭ, ဘဲၫၥိၭထံၫမိဆ့ၭ",
			"16": "<sup>16</sup> ဘၪအဝ့ၫလီၫ.- ဂၪ့ခိၪမၩဆၧၩ့ၦမုၪတၭ, အၩ့ထၪ့အ နိၭ,အၪ့ယုလၩ့ခွံၬထံၫ လၧၡီၩ့ပြိၩထၪ့ဝ့ၫ လၧအနိၭ ဖၧၩ့ နီၪလီၫ.",
			"17": "<sup>17</sup> ၡီၩ့နီၪၥၭထၪ့ဆီၪ့ၦမုၪတၭ,လ့ၩဒုၭဆၧလၧအချံၫအၥၪ အဂူၫဂၩလဖၪ လၧအထီးန့ယွၩ အဆၧမၪ လူၬ,ဒဲအီၪလၧယ့ၫရှူၬ အဆၧထိးအၥၭလီၫ."
		},
		"13": {
			"1": "<sup>1</sup> ယဆၧၫ့ထုၪ့လၧမ့ၭခိၪ အီၪလၧမၫဆမံၭအနဲၩ့တၭ, ယဒၪဘၪဆၧမံၩ့လၬလဒုၩအီၪလၧအခိၪဎွံၪနွ့ၫဖျိၪ့, ဒဲအနိၩ့ဆံၫဘီၩ့ဂဲထုၪ့လၧမၫဆမံၭဖၧၩ့တၭ, အၥရ ဖူၩအီၪလဆံၫလၧအနိၩ့လဖၪအလီၩ့တၭ, ဆၧဒုၪဒွ့ၪ",
			"2": "<sup>2</sup> အမံၩ့အီၪဝ့ၫ လၧအခိၪဎွံၪလဖၪအလီၩ့လီၫ.- ဆၧမံၩ့ လၬလၧၦဒၪဘၪဝ့ၫလဒုၩနီၪ လၩ့ဂၬခ့ၫစံၫဖီးတၭ, အခၪ့လၩ့ဂၬ ဖုၫထၫ့အခၪ့တၭ, အနိၭလၩ့ဂၬဆၬလ ၥၧၫ့အနိၭလီၫ. တၭၡီၩ့နီၪဖ့ၪလၫ့ဝ့ၫလၧအစီၩ့အမၩ့,",
			"3": "<sup>3</sup> ဒဲအလးဆီၩ့ဆီ,ဒဲအကယးကဖးဖၭဒိၪလီၫ.- ယဒၪ ဘၪအခိၪဎွံၪလဖျိၪ့ ဘၪဆၧဖ့ၬဝ့ၫထီးအမိၥံၫတၭ,အ ဖၧၩ့လးလၧအမိၥံၫဝ့ၫနီၪ ဘျၪထဲၩ့ဝ့ၫလီၫ. ၦဂၪ့ခိၪဖိၪ ၥံၪထီးအလူၬထီၫမံၫထီၫမၪဖိၬထွ့ၫဆၧမံၩ့လၬလဒုၩ",
			"4": "<sup>4</sup> အခဲၫ့တၭ,- အဝ့ၫၥံၪဘိၪ့ထၪ့ဘၩထၪ့ၡီၩ့လၧအဖ့ၪ လၫ့အစီၩ့အမၩ့ လၧဆၧမံၩ့လၬ, ဒဲဘိၪ့ထၪ့ဘၩထၪ့ဆၧ မံၩ့လၬနီၪ, စံၭဝ့ၫဒၪ, မွဲပလၫမီၪ့ဎီၩ့ လၧဆၧမံၩ့လၬနီၪ လဂၩလဲၪ. မွဲပလၫဒုၭအဝ့ၫနီၪမိၥ့ၪလဂၩလဲၪ.",
			"5": "<sup>5</sup> တၭဆၧဖ့ၪလၫ့ဝ့ၫလၧအနိၭ လၧအချဲၩ့ဆၧဖၭဒိၪ, ဒဲဆၧဒုၪဒွ့ၪဆၧလီၫ. တၭဆၧဖ့ၪလၫ့ဝ့ၫအစီၩ့အမၩ့",
			"6": "<sup>6</sup> ဘဲၫၥိၭအမိမၩဆၧလၩလံဆံၫနံၫဘံၪ့လီၫ.- တၭမွဲအ အၩ့ထၪ့အနိၭလၧဆၧဒုၪဒွ့ၪယွၩ ဘဲၫၥိၭအမိဒုၪဒွ့ၪအ မံၩ့,ဒဲအတဲၩဆံၫ့ဎံၪနီၪ, ဒဲၦအီၪဝ့ၫလၧမူၭခိၪအဖၧၩ့",
			"7": "<sup>7</sup> လီၫ.-တၭဆၧဖ့ၪလၫ့ဝ့ၫဘဲၫၥိၭအမိဒုၭဆၧ လၧၦဆံၫ့ ဎံၪၥံၪဒဲမၩနၧၩ့မၩစၪအဝ့ၫၥံၪလီၫ. တၭဆၧဖ့ၪလၫ့ အစီၩ့အမၩ့လၧကယဲၦအဒီၪ့ၥံၪ,ဒဲၦအဖျ့ၩၥံၪ, ဒဲ ၦဆၨၩၥံၪထီးအလူၬ အဖၫ့ခိၪလီၫ.",
			"8": "<sup>8</sup> တၭကယဲၦလၧအအီၪဝ့ၫလၧဂၪ့ခိၪချိၫ့, လၧအမံၩ့ လဆ့ၭလၩ့ဘၪအၥၭလၧဂၪ့ခိၪလချႃၭကဲၪထၪ့ဒံၭ ဘၪလၧၥိၪဖိၪ လၧအထိးၥံၫအၥၭ အလံၬမၧၫ့အ ဖၧၩ့လဖၪနီၪ, မိဘိၪ့ထၪ့ဘၩထၪ့ အဝ့ၫနီၪလီၫ.",
			"9": "<sup>9</sup> ၦလဂၩဂၩအ့ၪအီၪလၧအနါတၭ, မွဲအနါဂၧၫ့ဆၧ",
			"10": "<sup>10</sup> ဆံၭ.- ၦလဂၩဂၩအ့ၪအၪ့မၧၫ့ဎီးဆၧတၭ, မိကဲၪဎီး ဝ့ၫလီၫ. ၦလဂၩဂၩ အ့ၪမၩၥံၫဆၧလၧနၭတၭ, မိဘၪ ဆၧမၩၥံၫဝ့ၫလၧနၭလီၫ. ထီးယီၩၦဆံၫ့ဎံၪလဖၪအ ဆၧအွံၪၥၭဆၧၩ့အလး,ဒဲအဆၧနဲၩအလးအီၪဝ့ၫ လီၫ.",
			"11": "<sup>11</sup> ယဒၪဘၪဆၧမံၩ့လၬအဂူၫဂၩ လဒုၩဂဲၫထၪ့လၧ ဂၪ့ခိၪလၬတၭ, အီၪဝ့ၫလၧအနိၩ့နံၫခီၫ, ဘဲၫၥိၪဖိၪအ",
			"12": "<sup>12</sup> ၥိၭတၭ, ချဲၩ့ဆၧဘဲၫၡီၩ့အၥိၭနီၪလီၫ.- မၩဆၧလၧ ဆၧမံၩ့လၬ အခၪ့ထံၭလဒုၩ အစီၩ့အမၩ့ထီးအလူၬ လၧအဝ့ၫဒၪအမ့ၬယၫတၭ, အၪ့မၧၫ့ၦအီၪဝ့ၫလၧဂၪ့ခိၪ ချိၫ့လဖၪ ဘိၪ့ထၪ့ဘၩထၪ့ဆၧလၧဆၧမံၩ့လၬ အခၪ့ ထံၭလၧအဘၪဆၧဖ့ၬဝ့ၫထီးအမိၥံၫတၭ,ဘျၪထဲၩ့ ဝ့ၫလီၫ.",
			"13": "<sup>13</sup> မွဲအမၩဆၧလၩ့လၭဖၭဒိၪၥံၪထီးအဒုၭဂဲၫလၩ့ ဆ့မ့ၪလၧမူၭခိၪတၭ, ထီၩ့လၩ့လၧဂၪ့ခိၪ လၧၦၡၩအ",
			"14": "<sup>14</sup> မ့ၬယၫလီၫ.- လၧဆၧလၩ့လၭ လၧဆၧဖ့ၪလၫ့ဘဲၫၥိၭ အမိမၩဝ့ၫ လၧဆၧမံၩ့လၬအမ့ၬယၫအကၠီၩ့တၭ, အဝ့ၫ ဒၪအၪ့လီၫန့ ၦအီၪဝ့ၫလၧဂၪ့ခိၪချိၫ့, ဒဲမၪလူၬၦအီၪဝ့ၫ လၧဂၪ့ခိၪချိၫ့, ဘဲၫၥိၭအမိတဲၩ့ဆၧမံၩ့လၬလၧအဘၪ ဆၧဖ့ၬဝ့ၫ လၧနၭတၭ, မၧၫ့ဝ့ၫလဒုၩနီၪအဂၩ့လီၫ.",
			"15": "<sup>15</sup> တၭဆၧဖ့ၪလၫ့ဝ့ၫ ဘဲၫၥိၭအမိဖ့ၪလၫ့ဆၧမံၩ့လၬအဂၩ့ လၧအၥၭမၧၫ့ ဘဲၫၥိၭဆၧမံၩ့လၬအဂၩ့နီၪ မိချဲၩ့ထၪ့ ဆၧ,ဒဲအၪ့မၧၫ့ဆၧမၩၥံၫၦလၧအလဘိၪ့ထၪ့ဘၩထၪ့ ဘၪဆၧမံၩ့လၬအဂၩ့ထီးအလူၬလီၫ.",
			"16": "<sup>16</sup> မွဲအအၪ့မၧၫ့ဝ့ၫ, ဘဲၫၥိၭၦကိၭဂၩဒ့ၭ, ဒဲဒိၪဒဲဆံၭ, ဒဲၦၥထံၫ, ဒဲၦအၡၪ့အယၬ, ဒဲၦပျီၩဖျ့ၭၥံၪ, ဒဲၦအဎီးၥံၪ မိန့ဘၪ ဆၧမၩနဲၪ့လမံၩ့, လၧအစူၪထွ့ၪအလီၩ့မွဲဂ့ၩ,",
			"17": "<sup>17</sup> ဒဲလၧအမ့ၬထုးခိၪအလီၩ့မွဲဂ့ၩ,- ဘဲၫၥိၭၦလၧဆၧမံၩ့ လၬအဆၧမၩနဲၪ့ လအီၪဘၪမွဲဂ့ၩ, အမံၩ့အဆၧဝံအ ဆၧနၬလအီၪဘၪမွဲဂ့ၩ, ထီးအၪ့ဆၫဆၧဎွ့ၩဆၧလ ဂ့ၩလီၫ.",
			"18": "<sup>18</sup> ဆၧကိၪ့ၥ့ၪကိၪ့ဘၪမွဲထီးယီၩး ၦအီၪလၧအနၪဆၧ ၥ့ၪနီၪမွဲအဝံထၪ့နၬထၪ့ ဆၧမံၩ့လၬအဆၧဝံဆၧနၬဆံၭး အဂဲးဘဲၫယီၩ မွဲၦၡၩအဆၧဝံဆၧနၬတၭ, အဆၧဝံဆၧ နၬနီၪ မွဲဎူၫယၩဎူၫဆံၫဎူၫ လီၫ."
		},
		"14": {
			"1": "<sup>1</sup> ယယိဆၧတၭ, ယိခွါ,ၥိၪဖိၪဆၧၫ့ထုၪ့ဝ့ၫလၧခိၪလီၩ့ ဇံအိၫ့အလီၩ့တၭ,ၦလၧအအီၪလၧၥိၪဖိၪအမံၩ့, ဒဲအ ဖါအမံၩ့ကွ့ၭအၥၭ လၧအမ့ၬထုးခိၪအလီၩ့ အၡၩလ",
			"2": "<sup>2</sup> ကုၬလံလၬလံထီၫ့အီၪလၧအၥိၭလီၫ.- ယနါဂၧၫ့ဆၧ ၥီၫလၧမူၭခိၪ, ဘဲၫထံၫအၪအၪလ့ၬအၥိၭတၭ,ဒဲဘဲၫ လၫ့ဎွံၩ့ဖၭဒိၪအၥိၭလီၫ. ဒဲယနါဂၧၫ့ ၦဒံၩ့နါဒံၩ့လ",
			"3": "<sup>3</sup> ဖၪ,- ဆၬထၪ့အထၭခိၪအၥၫ့ လၧလးဆီၫ့ဆီ အမ့ၬ ယၫ,ဒဲလၧဆၧအမၧၫ့လံဒုၩနီၪ,ဒဲၥုၪ့က့ၭၥၭၡါၥံၪအ မ့ၬယၫလီၫ. အ့ၪလမွဲဘၪ, ၦလၧဆၧဎွ့ၩန့ထဲၩ့ဝ့ၫလၧ ဂၪ့ခိၪချိၫ့လကုၬလံလၬလံထီၫ့လဖၪနီၪၦမၩလိၪထၭ ခိၪနီၪၥ့ၪနးဂၩအ့ၬ.",
			"4": "<sup>4</sup> ၦလဖၪနီၪ မွဲၦလၧအလဘၪစံၪစၪဘၪလၧၦမုၪ တၭ,အဂဲးဘဲၫယီၩ မွဲၦမုၪနၩ့လီၫ. ၦလဖၪနီၪမွဲၦလၧ အဖိၬၥိၪဖိၪအခဲၫ့ထီးဒၪအလးလၧအၥိၫ့ဝ့ၫလစီၪ့လါ လါလီၫ. ၦလဖၪနီၪမွဲၦလၧဆၧဎွ့ၩန့ထဲၩ့ဝ့ၫလၧၦၡၩ အကျၩတၭ, မွဲဆၧၥၪဆိၫလၧယွၩဒဲၥိၪဖိၪအဂးလီၫ.",
			"5": "<sup>5</sup> တၭဆၧလဒၪန့ဘၪ ဆၧအဘျံၭအဘျၪ လၧအနိၭဖၧၩ့ နးမံၩ့တၭး အဂဲးဘဲၫယီၩဆၧအီၪက့ၪဆၧမၪလၧ အလီၩ့အလးအီၪအ့ၬ.",
			"6": "<sup>6</sup> တၭယဒၪဘၪအၥီၫ့ဂူၫဂၩ ယူၩဝ့ၫလၧဆၧဖိၭဖၫ့လ ဂၩ, အီၪလၧဆၧၥၭထိၬအပရၧၫ့လၩ့ဆိၩလၩ့ကၠၪ,ဘဲၫ ၥိၭအမိလီၩလၩ့လၬလၩ့ဝ့ၫလၧၦအီၪလၧဂၪ့ခိၪချိၫ့ ဒဲကယဲၦအဆၨၩ, ဒဲၦအဒီၪ့,ဒဲၦအဖျ့ၩ,ဒဲၦခမျၧး",
			"7": "<sup>7</sup> ထီးအလူၬ,- စံၭဝ့ၫလၧအလူဖၭဒိၪ, ၥၭမဲၪယွၩတၭစံၭ ထၪ့အၪ့အူၭ အဝ့ၫဒၪဆံၭ. အဂဲးဘဲၫယီၩမွဲအစ့ၩ ရၫ့ဆၧအနၩရံၩ ဘၪယူၭဝ့ၫယူၭ. ဒဲဘိၪ့ထၪ့ဘၩထၪ့ ၦလဂၩ လၧအမၩကဲၪထၪ့မူၭခိၪ, ဒဲဂၪ့ခိၪ, ဒဲမၫဆမံၭ, ဒဲထံၫမၧၫ့လဖၪ နီၪဆံၭ.",
			"8": "<sup>8</sup> တၭအၥီၫ့ဂူၫဂၩလဂၩဖိၬအခဲၫ့နီၪ, စံၭဝ့ၫဒၪ,ဘၭ ဘလၧၫ့ဖၭဒိၪလၩ့ဎီးခွံၬယူၭ, လၩ့ဎီးခွံၬယူၭ,အဂဲး ဘဲၫယီၩမွဲအအၪ့မၧၫ့ၦကိၭဆၨၩဒ့ၭ အီၩဆၧၥၭထၪ့အ စဘံၭထံၫဘၪဆဲၫ့ လၧအဆၧမၩမၪမုၪ မၩမၪခွၫလီၫ.",
			"9": "<sup>9</sup> တၭအၥီၫ့ၥၧၫ့ဂၩလဂၩ ဖိၬထၪ့အခဲၫ့နီၪ, ကိၭၡၭထၪ့ ဆၧလၧအလူဖၭဒိၪ, ၦလဂၩဂၩအ့ၪဘၩထၪ့ဆၧမံၩ့ လၬ,ဒဲအဂၩ့, ဒဲဒိၭဆၧမၩနဲၪ့ လၧအမ့ၬထုးခိၪမွဲဂ့ၩ,",
			"10": "<sup>10</sup> လၧအစူၪလီၩ့မွဲဂ့ၩတၭ,- မိဘၪအီၩယွၩအဆၧၥၭ ထၪ့အစဘံၭထံၫလၧအလကၠၪဎုၬဘၪဝ့ၫတၭ, ဘၪ ဆၧလူၫလၩ့အၥၭ လၧအဆၧၥၭထၪ့အလိၫ့ဖၧၩ့, ဒဲမိ ဘၪဆၧၡၪ့ဆၧနၭလၧမ့ၪဒဲကးအဖၧၩ့ အီၪလၧအၥီၫ့",
			"11": "<sup>11</sup> ဆံၫ့ဎံၪလဖၪ, ဒဲလၧၥိၪဖိၪအမ့ၬယၫလီၫ.- ၦလၧအ ဘၩထၪ့ဆၧမံၩ့လၬ, ဒဲအဂၩ့ဒဲၦလၧအဒိၭန့ အမံၩ့အ ဆၧမၩနဲၪ့နီၪတၭ, လအီၪပွံၭဘၪ လၧမုနၩနၩ မုဆၫ ဆၫတၭ, အဆၧၡၪ့ဆၧနၭအခူၪထၪ့ဝ့ၫအဆိၩဆိၩ အကၠၪကၠၪလီၫ.",
			"12": "<sup>12</sup> ထီးယီၩ မွဲၦဆံၫ့ဎံၪၥံၪ အဆၧအွံၪၥၭဆၧၩ့, ၦလၧ အထီးန့ယွၩအဆၧမၪလူၬလဖၪ, ဒဲဆၧနဲၩဘၪဆဲၫ့လၧ ယ့ၫရှူၬအီၪဝ့ၫလီၫ.",
			"13": "<sup>13</sup> တၭယနါဂၧၫ့ဆၧၥီၫလၩ့လၧမူၭခိၪတၭ, စံၭဝ့ၫဒၪး ကွ့ၭဘီၪ, ထီးယီၩလၧယၫၦၥံၫလၧအၥံၫဝ့ၫ လၧကဆါ အဖၧၩ့လဖၪနီၪ, ဘၪဆိၪဂ့ၩဝ့ၫလီၫ. မွဲယူၭ, ၥၭမု နီၪစံၭဝ့ၫဒၪ, ဘဲၫၥိၭအမိအီၪပွံၭဝ့ၫ လၧအဆၧမၩတၭ, အဆၧမၩလဖၪ ဖိၬထၪ့အဝ့ၫၥံၪ အခဲၫ့လီၫ.",
			"14": "<sup>14</sup> ယယိဆၧတၭ, ယိခွါ, ဆၧအုၪ့ဘွၩ, ဒဲၦဆၧၫ့နၩ့ လၧအလီၩ့လၩ့ဂၬၦၡၩအဖိၪခွၫ အီၪလၧၥရဖူၩထီၫ့ လၧအခိၪဎွံၪအလီၩ့, ဒဲထၭဂ့ၬ လၧအနါအဲၪ့လဘံၪ့",
			"15": "<sup>15</sup> အီၪလၧအစူၪဖၧၩ့လီၫ.- အၥီၫ့ဂူၫဂၩ လဂၩဂဲၫစဲၪ့ထၪ့ ခွံၬ လၧဆၧလုအဂံၪ့ဖၧၩ့တၭ, ကိၭၡၭထၪ့ လၧအလူ ဖၭဒိၪလၧၦလၧအဆၧၫ့နၩ့ လၧဆၧအုၪ့အလီၩ့လဂၩ နီၪ,ပခိၬလၩ့နထၭဂ့ၬတၭကူၭဆၧဆံၭ, အဂဲးဘဲၫ ယီၩ ကူၭဆၧအမုအလၩဘၪယူၭဝ့ၫယူၭ, အဂဲးဘဲၫ",
			"16": "<sup>16</sup> ယီၩဘုၪလၧဂၪ့ခိၪချိၫ့ဝီၩယူၭ.- ၦလၧအဆၧၫ့နၩ့ လၧ ဆၧအုၪ့အလီၩ့လဂၩ ပခိၬလၩ့အထၭဂ့ၬ လၧဂၪ့ခိၪချိၫ့ တၭ, ဂၪ့ခိၪဘၪဆၧကူၭဝ့ၫ လီၫ.",
			"17": "<sup>17</sup> အၥီၫ့အဂူၫဂၩလဂၩ ဂဲၫထၪ့လၧယွၩ အဆၧလုအ ဂံၪ့ဖၧၩ့လၧအအီၪ လၧမူၭခိၪအဖၧၩ့တၭ, အဝ့ၫနီၪအီၪ",
			"18": "<sup>18</sup> လၧထၭဂ့ၬ လၧအအဲၪ့လဘံၪ့ဆ့လီၫ.- အၥီၫ့လၧအဂူၫ ဂၩလဂၩ အီၪလၧအစီၩ့အမၩ့ လၧမ့ၪအဖၫ့ခိၪလဂၩဂဲၫ ထၪ့လၧဆၧလုအလးအအီၪတၭ, ကိၭၡၭထၪ့ဆၧလၧ အလူဖၭဒိၪလၧၦလၧအအီၪလၧအထၭဂ့ၬလၧအ အဲၪ့တၭ, စံၭဝ့ၫ, ပခိၬလၩ့နထၭဂ့ၬ လၧအနါအဲၪ့တၭ, အၪ့ထုၫ့ကီၪ့ စဘံၭမုအဆူၬလဖၪ လၧဂၪ့ခိၪချိၫ့ဆံၭ.",
			"19": "<sup>19</sup> အဂဲးဘဲၫယီၩ စဘံၭအၥၪမံၫ့ယူၭဝ့ၫယူၭ.- အၥီၫ့နီၪ ပခိၬလၩ့ အထၭဂ့ၬ လၧဂၪ့ခိၪချိၫ့တၭ, အၪ့ထုၫ့ကီၪ့ စဘံၭမုလၧဂၪ့ခိၪချိၫ့တၭ, ဒုၭလၩ့ဝ့ၫလၧယွၩအဆၧ",
			"20": "<sup>20</sup> ၥၭထၪ့အစဘံၭထံၫချိၭဖၭဒိၪအဖၧၩ့လီၫ.- ဆၧယဲး လၩ့စဘံၭထံၫချိၭလၧဒိၩ့ချိၫ့တၭ, အၥွံၪဂဲၫထၪ့လၧ ချိၭဖၧၩ့တၭ,ထၪ့ဘၭလၧကၥ့ၪအနိၭ, ဖိးလၧစတ့ဒ အၧၫ့လထီၫ့ဎူၫယၩလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> တၭဆၧဖၭဒိၪဆၧထီၫမံၫထီၫမၪ အလးလၩ့လၭအ ဂူၫဂၩလမံၩ့ယဒၪဘၪ လၧမူၭခိၪအဖၧၩ့နီၪ, အၥီၫ့နွ့ၫ ဂၩအီၪလၧဆၧၡၪ့ဆၧနၭ လၧခဲၫ့ထုၬနွ့ၫမံၩ့လီၫ. အဂဲး ဘဲၫယီၩ ယွၩအဆၧၥၭထၪ့နီၪ, လၧၫ့ထၪ့ဎွ့ၩထၪ့ လၧ အဖၧၩ့လီၫ.",
			"2": "<sup>2</sup> တၭယဒၪဘၪ ဆၧလၩ့ဂၬမၫဆမံၭနွၫလဲၩဎုၬအ ၥၭလၧမ့ၪ,ဒဲၦလၧအမၩနၧၩ့မၩစၪဆၧမံၩ့လၬ,ဒဲအ ဂၩ့,ဒဲအမံၩ့ အဆၧဝံဆၧနၬနီၪ ဆၧၫ့ထုၪ့လၧမၫဆမံၭ နွၫအဖံၭခိၪနီၪ,အီၪလၧယွၩအနါဒံၩ့လဖၪနီၪလီၫ.",
			"3": "<sup>3</sup> တၭအဝ့ၫၥံၪဆၬယွၩအဎီးအၡၩ စမိစ့ၭအထၭခိၪ, ဒဲၥိၪဖိၪအထၭခိၪတၭ, စံၭဝ့ၫ,ၥ့ၪဆၧလူၬကဆါယွၩဧ့, နဆၧမၩလဖၪနီၪမွဲအဒိၪ, မွဲဆၧအၪ့မၧၫ့ပၥၭ ထီၫမံၫ ထီၫမၪလီၫ. ၦဆၨၩၥံၪအစဎွၩလဂၩဧ့, နဖၧၩ့ၥၭလ",
			"4": "<sup>4</sup> ဖၪနီၪမွဲအတီၩအလီၩ့ဒဲအမွဲအတီၩလီၫ.- ကဆါဧ့, မွဲပလၫလၥၭမဲၪဘၪနၧၩတၭ, လစံၭထၪ့အၪ့အူၭဘၪ နမံၩ့လဂၩလဲၪ. အဂဲးဘဲၫယီၩ နဝ့ၫဒၪယီၩ နမွဲၦဆံၫ့ဎံၪ လဂၩဎးလီၫ. အဂဲးဘဲၫယီၩကယဲၦကိၭဆၨၩဒ့ၭၥံၪ မိဂဲၫဘၩထၪ့ဆၧလၧနမ့ၬယၫလီၫ. အဂဲးဘဲၫယီၩ နဆၧစ့ၩရၫ့လဖၪအီၪဖျီၪဝ့ၫလီၫ.",
			"5": "<sup>5</sup> တၭဆၧလဖၪနီၪအလးခဲၫ့ယယိဆၧနီၪ, ဆၧလုဂံၪ့ အဆၧထိးအၥၭအတဲၩအီၪဝဲထၪ့အၥၭ လၧမူၭခိၪ",
			"6": "<sup>6</sup> လီၫ.- တၭအၥီၫ့နွ့ၫဂၩ အီၪလၧဆၧၡၪ့ဆၧနၭ နွ့ၫမံၩ့ ဂဲၫထၪ့လၧဆၧလုဂံၪ့ဖၧၩ့နီၪ ကီၩ့ၥိၭထၪ့အၥၭ လၧဆၧ ဘွၩဂိးရှ့ၭဂိးၡီၫတၭ, ခဲးထူၬအခၧၩ့ယး ထီၫ့လၧအၥၭ",
			"7": "<sup>7</sup> နၫၡါလီၫ.- တၭလၧဆၧအမၧၫ့ လံဒုၩအကျၩ လဒုၩ ဖ့ၪလၫ့အၥီၫ့နွ့ၫဂၩ လၧလိၫ့ထီၫ့နွ့ၫဖျိၪ့ ဎွ့ၩလၧယွၩလၧ အမၧၫ့ဝ့ၫ အဆိၩဆိၩအကၠၪကၠၪ အဆၧၥၭထၪ့လီၫ.",
			"8": "<sup>8</sup> တၭဆၧလုအဂံၪ့ဖၧၩ့နီၪ ဎွ့ၩဝ့ၫလၧဆၧအခူၪ ဘၪဆဲၫ့ လၧယွၩအလၩအဖၩ့,ဒဲအစီၩ့အမၩ့တၭ, အၥီၫ့ နွ့ၫဂၩအဆၧၡၪ့ဆၧနၭ နွ့ၫမံၩ့နီၪ လချႃၭလူၬဒံၭဘၪ တၭ,ၦလ့ၩနုၬ လၧဆၧလုအဂံၪ့ဖၧၩ့ၥ့ၪ နးဂၩအ့ၬ."
		},
		"16": {
			"1": "<sup>1</sup> တၭယနါဂၧၫ့ဆၧၥီၫဖၭဒိၪ လၧဆၧလုအဂံၪ့နီၪ,စံၭ အၥီၫ့နွ့ၫဂၩ, လ့ၩထၪ့ဘီၪ, လူၫလၩ့ယွၩအဆၧၥၭ ထၪ့အလိၫ့နွ့ၫဖျိၪ့ လၧဂၪ့ခိၪချိၫ့ဆံၭ.",
			"2": "<sup>2</sup> အခၪ့ထံၭလဂၩနီၪလ့ၩထၪ့တၭ, လူၫလၩ့အလိၫ့လၧ ဂၪ့ခိၪချိၫ့တၭ, ဆၧမၩအၥၭလၧဆၧဆၫအုၪလၩ့လ့ၭ အအၧၩ့လၩ့ဘၪလၧၦအီၪလၧဆၧမံၩ့လၬအဆၧမၩ နဲၪ့လၧအလီၩ့, ဒဲၦလၧအဘၩထၪ့အဂၩ့လဖၪအလီၩ့ နီၪလီၫ.",
			"3": "<sup>3</sup> နံၫဂၩလဂၩနီၪ လူၫလၩ့အလိၫ့လၧမၫဆမံၭဖၧၩ့ တၭ, မွဲအမၩအၥၭ ဘဲၫၦၥံၫအၥွံၪအၥိၭတၭ, ဆၧ မၧၫ့လၧမၫဆမံၭဖၧၩ့ ၥံၫဝ့ၫထီးအလူၬလီၫ.",
			"4": "<sup>4</sup> ၥၧၫ့ဂၩလဂၩနီၪလူၫလၩ့အလိၫ့ လၧထံၫချိၬၥံၪ,ဒဲလၧ ထံၫမၧၫ့အဖၧၩ့တၭ, အဝ့ၫၥံၪကဲၪထၪ့ဆၧၥွံၪလီၫ.",
			"5": "<sup>5</sup> တၭယနါဂၧၫ့ထံၫအၥီၫ့လဂၩနီၪ, စံၭဝ့ၫဒၪ, ၦလၧအ အီၪ,ဒဲလၧအအီၪယူၭဝ့ၫၦဆံၫ့ဎံၪလဂၩ, ကဆါဧ့,မွဲ နစ့ၩရၫ့ဆၧယီၩလဖၪအကၠီၩ့တၭ, နမွဲၦတီၩၦလီၩ့",
			"6": "<sup>6</sup> လီၫ.- အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪနီၪ လူၫလၩ့ၦဆံၫ့ဎံၪ,ဒဲ မီၪၥံၪအၥွံၪတၭ, နဒုၭအီၩအဝ့ၫၥံၪလၧဆၧၥွံၪလီၫ. အဂဲးဘဲၫယီၩ မွဲအကြၨၭဘၪဆၧဘဲၫနီၪလီၫ.",
			"7": "<sup>7</sup> တၭယနါဂၧၫ့ အဂူၫဂၩလဂၩလၧဆၧလုအလးအ ဖၧၩ့နီၪ, စံၭဝ့ၫဒၪ, မွဲယူၭ, ၥ့ၪဆၧလူၬ ကဆါယွၩဧ့, နစ့ၩရၫ့ဆၧ နီၪမွဲအတီၩအလီၩ့လီၫ.",
			"8": "<sup>8</sup> လံဂၩလဂၩနီၪ, လူၫလၩ့အလိၫ့လၧမုမ့ၬအလီၩ့",
			"9": "<sup>9</sup> တၭ, ဆၧဒုၭခိဎီၩၦၡၩလၧမ့ၪလီၫ.- ၦလၧအဘၪ ဆၧခိဎီၩ လၧဆၧခိဖၭဒိၪတၭ, ဒုၪဒွ့ၪယွၩအမံၩ့လၧ အအီၪလၧအစီၩ့အမၩ့လၧဆၧၡၪ့ဆၧနၭလဖၪယီၩ အဖၫ့ခိၪတၭ, အဝ့ၫၥံၪလနီၫ့ယါ လၩ့ထဲၩ့ဘၪအၥၭ ဘဲၫၥိၭအမိစံၭထၪ့အၪ့အူၭဝ့ၫဒၪလီၫ.",
			"10": "<sup>10</sup> ယဲဂၩလဂၩနီၪ လူၫလၩ့အလိၫ့ လၧဆၧမံၩ့လၬအ လးဆီၩ့ဆီအဖၫ့ခိၪတၭ, အဘၩ့အမုး ခံၭလၩ့ဝ့ၫ တၭ,အဝ့ၫၥံၪ ဘၪဆၧၡၪ့ဆၧနၭအကၠီၩ့နီၪ အဲၪ့ထံးအ",
			"11": "<sup>11</sup> ဖျ့ၩတၭ,- မွဲအဘၪဆၧၡၪ့ဆၧနၭ, ဒဲဆၧဆၫအုၪ လၩ့လ့ၭတၭ, ဒုၪဒွ့ၪမူၭခိၪအကဆါတၭ, နၪ့ထၪ့ နီၫ့ယါလၩ့ထဲၩ့အၥၭ လၧအဆၧဖံၭ ဆၧမၩအကၠီၩ့ အ့ၬ.",
			"12": "<sup>12</sup> ဎူၫဂၩလဂၩနီၪလူၫလၩ့အလိၫ့ လၧထံၫချိၬဖၭဒိၪယုၫ ဖ့တံၫအဖၧၩ့တၭ, ထံၫလၩ့ၥံၭခွံၬ,ဘဲၫၥိၭစဎွၩလၧ မုထၪ့လခီၫလဖၪအဖၧၩ့ၥၭမိတဲၩ့ဝဲၩဘၪအၥၭလီၫ.",
			"13": "<sup>13</sup> တၭယဒၪဘၪ ဆၧၥၭစံၪစၪၥၧၫ့ဒုၩ လၩ့ဂၬဒ့ၪဂဲၫထၪ့ လၧၡီၩ့အနိၭဖၧၩ့,ဒဲလၧဆၧမံၩ့လၬအနိၭဖၧၩ့,",
			"14": "<sup>14</sup> ဒဲလၧမီၪအဘျၪအနိၭဖၧၩ့လီၫ.- အဝ့ၫၥံၪမွဲဆၧနၪ အၥၭလၧအမၩလၩ့လၭဆၧတၭ,လ့ၩဝ့ၫလၧဂၪ့ ခိၪအစဎွၩၥံၪလၧဂၪ့ခိၪချိၫ့ထီးအလူၬအအီၪ, ဘဲၫ ၥိၭအမိဒုၭအီၪကိၩ့အီၪကီၪ့ဝ့ၫ လၧယွၩလၧအၥ့ၪဆၧ",
			"15": "<sup>15</sup> လူၬအနံၩဖၭဒိၪဒုၭဆၧအအီၪလီၫ.- ယိခွါ, ယဂဲၫ ဘဲၫဆၧအၪ့ဂူၪအၥိၭနီၪလီၫ. ၦလၧအအီၪခိၭဆၧ, ဒဲယိအကီၩ့အၥိၭလဖၪ, ဘဲၫၥိၭအထီးလ့ၩအီၪဘိၪ့, ဒဲၦထီးဒၪဘၪအဆၧမ့ၬမဲလဂ့ၩနီၪ, ဘၪဆၧဆိၪဂ့ၩ",
			"16": "<sup>16</sup> ဝ့ၫလီၫ.- တၭဆၧဒုၭအီၪကီၪ့အဝ့ၫၥံၪ လၧအလးကိၭ ဝ့ၫလၧဟံဘၫအလၨနီၪ အၫမဂ့ၭဒၧၫ့လီၫ.",
			"17": "<sup>17</sup> နွ့ၫဂၩလဂၩနီၪ လူၫလၩ့အလိၫ့ လၧဆၧဖိၭဖၫ့တၭ, ဆၧအလူၥီၫဖၭဒိၪၥီၫလၩ့ လၧအလးဆီၩ့ဆီ အီၪလၧ ဆၧလုအဂံၪ့ဖၧၩ့ လၧမူၭခိၪတၭ, စံၭဝ့ၫဒၪ,ဆၧမၩယူၭ",
			"18": "<sup>18</sup> အၥၭယူၭ,- တၭဆၧအလူလဖၪၥီၫထၪ့, ဒဲလၫ့ဎွံၩ့, ဒဲလၫ့ဝဲအဒံၭ, ဒဲဂၪ့ခိၪဝၭဖၭဒိၪလၧၦၡၩအီၪလၧဂၪ့ ခိၪချိၫ့လံၩလံၩနီၪ, ဂၪ့ခိၪဝၭဒိၪဒိၪလ့ၬလါနၫ့တၭ, ဒိၪ",
			"19": "<sup>19</sup> န့ၫနီၪအၥိၭနးဆိၭအ့ၬ.- ဒိၩ့ဖၭဒိၪလဖျိၪ့နီၪလၩ့မု လၩ့ဖၭခွံၬဝ့ၫၥၧၫ့စီၪ့တၭ, ၦၡၩအဆၨၩလဖၪအဒိၩ့ လၩ့ဎီးဝ့ၫတၭ, ဆၧနၪ့ထၪ့ထဲၩ့ ဘၭဘလၧၫ့ဖၭဒိၪလၧ ယွၩအမ့ၬယၫ, ဘဲၫၥိၭအမိဖ့ၪလၫ့ဝ့ၫ လၧလိၫ့အီၪလၧ",
			"20": "<sup>20</sup> အဆၧၥၭထၪ့ဆီၪ့အစဘံၭထံၫလီၫ.- ကယဲကျိၩ့ လဖျိၪ့လါလါစဲၪ့ခွံၬဝ့ၫတၭ, ခိၪလီၩ့ထိၩ့ချိၬၥံၪဆၧ",
			"21": "<sup>21</sup> ဒၪန့ဝ့ၫအ့ၬ.- တၭဆၧဆၧၩ့လၩ့မုၥၪဖၭဒိၪ လၧမူၭခိၪ, အလယၧးဘဲၫလတၩလၫ့ ဎၥၧၫ့မၧၫ့ကၪယူၭၭ အၥိၭ တၭ,ဘၪၦၡၩလီၫ. မွဲဆၧၡၪ့ဆၧနၭဘၪဆဲၫ့လၧမု ၥၪအကၠီၩ့,ၦၡၩဒုၪဒွ့ၪယွၩနီၪ, အဂဲးဘဲၫယီၩ ဆၧၡၪ့ ဆၧနၭနီၪဒိၪမၬလီၫ."
		},
		"17": {
			"1": "<sup>1</sup> လၧအၥီၫ့နွ့ၫဂၩ လၧအအီၪလၧလိၫ့နွ့ၫဖျိၪ့အကျၩ နီၪ, အလဂၩ ချဲၩ့ဆၧလၧယၧၩတၭ, စံၭဝ့ၫဒၪ, ဂဲၫ လၧယီၩဘီၪ, ယမိဒုၭနဲၪနၧၩ လၧဆၧစ့ၩရၫ့ဘၪဆဲၫ့ လၧမဲၩဎွဲၩမုၪဖၭဒိၪလၧအဆၧၫ့နၩ့လၧထံၫအၪအၪ",
			"2": "<sup>2</sup> လ့ၬအဖၫ့ခိၪလီၫ.- ဂၪ့ခိၪအစဎွၩလဖၪ မၩမၪအၥၭ လၧအၥိၭဒဲၦအီၪဝ့ၫ လၧဂၪ့ခိၪချိၫ့လဖၪ အီၩမၧၩ့အၥၭ",
			"3": "<sup>3</sup> လၧအဆၧမၩမၪမုၪမၩမၪခွၫအစဘံၭထံၫလီၫ.- အ ဝ့ၫဒၪလ့ၩၥိၫ့ယၧၩ လၧၥၭအဖၧၩ့ ထီၩ့လၧမံၩ့လၬကျၩ တၭ,ယဒၪဘၪ ၦမုၪလဂၩဆၧၫ့နၩ့ လၧဆၧမံၩ့လၬဝီၩ လုၭဖုၭလဒုၩအဖၫ့ခိၪတၭ, လၧၫ့ဎွ့ၩဝ့ၫလၧဆၧဒုၪ ဒွ့ၪယွၩအမံၩ့လဖၪ, အီၪလၧအခိၪဎွံၪနွ့ၫဖျိၪ့ဒဲအနိၩ့",
			"4": "<sup>4</sup> ဆံၫဘီၩ့လီၫ.- တၭၦမုၪနီၪကီၩ့ၥိၭဝ့ၫ လၧဆၧလုၭဖုၭ ဒဲဆၧဝီၩလုၭဖုၭ, ဒဲကယၧၩ့အၥၭလၧထီၫ့ ဒဲလိးအဂ့ၩ, မနံၬလဖၪလိၫ့ထီၫ့အီၪဝ့ၫ လၧအစူၪဖၧၩ့ လၧၫ့ဎွ့ၩဝ့ၫ လၧဆၧအၧၩ့ဆၧၥၫ့, လၧဆၧမၩစံၪစၪ ဘၪဆဲၫ့လၧဆၧ",
			"5": "<sup>5</sup> မၩမၪမုၪမၩမၪခွၫလီၫ.- တၭအမံၩ့အီၪကွ့ၭအၥၭ လၧအမ့ၬထုးခိၪ, ဆၧအီၪၥူၪ, ဘၭဘလၧၫ့ဖၭ ဒိၪ,ၦမဲၩဎွဲၩမုၪ, ဒဲဂၪ့ခိၪအဆၧစံၪစၪလဖၪအ",
			"6": "<sup>6</sup> မိလီၫ.- တၭယဒၪဘၪၦမုၪ အီၩမၧၩ့အၥၭလၧၦဆံၫ့ ဎံၪအၥွံၪ, ဒဲၦလၧအထိးအၥၭ လၧယ့ၫရှူၬဎရံၬ အဂဲး အကၠီၪ့လဖၪအၥွံၪလီၫ. ယဒၪဘၪတၭ, ယထီၫမံၫ ထီၫမၪ လၧဆၧထီၫမံၫထီၫမၪ ဖၭဒိၪအဖၧၩ့လီၫ.",
			"7": "<sup>7</sup> တၭအၥီၫ့လဂၩနီၪစံၭယၧၩ, နထီၫမံၫထီၫမၪမွဲဘၪ လဲၪးယမိဒုၭနဲၪနၧၩ လၧဆၧအီၪၥူၪ ဘၪဆဲၫ့လၧၦမုၪ ဒဲဆၧမံၩ့လၬလၧအဆိၬအဝ့ၫလၧအအီၪလၧအခိၪ",
			"8": "<sup>8</sup> နွ့ၫဖျိၪ့, ဒဲအနိၩ့ဆံၫဘီၩ့နီၪလီၫ.- ဆၧမံၩ့လၬလၧနဒၪ ဘၪဝ့ၫလဒုၩနီၪအီၪယူၭ, ဒဲလအီၪဘၪ, ဒဲမိဂဲၫထဲၩ့ထၪ့ လၧဆၧယိၬအဖၧၩ့လီၫ. တၭၦအီၪဝ့ၫလၧဂၪ့ခိၪ ချိၫ့လၧအမံၩ့လအီၪကွ့ၭလၩ့ဘၪအၥၭ လၧလံၬမၧၫ့အ ဖၧၩ့လၧဂၪ့ခိၪအခၪ့ထံၭလံၩလံၩလဖၪနီၪ, ထီးအဒၪ ဘၪဆၧမံၩ့လၬလၧအအီၪယူၭ, ဒဲလအီၪဘၪ, ဒဲမိဂဲၫ ဝ့ၫလဒုၩတၭ, မိထီၫမံၫထီၫမၪဝ့ၫလီၫ.",
			"9": "<sup>9</sup> အယီၩမွဲၥၭကိၪ့ၥ့ၪ အီၪလၧဆၧကိၪ့လီၫ. အခိၪဎွံၪ နွ့ၫဖျိၪ့နီၪမွဲခိၪလီၩ့နွ့ၫဖျိၪ့လၧၦမုၪဆၧၫ့နၩ့လၧအ",
			"10": "<sup>10</sup> လီၩ့လီၫ.- တၭစဎွၩၥံၪအီၪဝ့ၫနွ့ၫဂၩလီၫ. ယဲဂၩလ ဂၩလၩ့ထ့ၬခွံၬယူၭ, တၭအလဂၩအီၪဝ့ၫ, ဒဲအဝ့ၫဒၪ လဂၩလဂဲၫဒံၭဘၪ, ထီးအ့ၪဂဲၫခိၬတၭ, ဘၪအီၪဝ့ၫလ",
			"11": "<sup>11</sup> ဆိလီၫ.- တၭဆၧမံၩ့လၬ လၧအအီၪယူၭဝ့ၫ, လၧအလ အီၪဘၪလဒုၩနီၪ, မွဲအဎွ့ၩထၪ့ဎိၭဂၩလဂၩတၭ, အီၪ ဝ့ၫလၧနွ့ၫဂၩအကျၩတၭ, မိလ့ၩလၩ့လၧဆၧဂၭဂီၩ့ဂၭ",
			"12": "<sup>12</sup> စၪအဖၧၩ့လီၫ.- အနိၩ့ဆံၫဘီၩ့လၧနဒၪဘၪနီၪ, မွဲ စဎွၩဆံၫဂၩ လၧအလန့ဒံၭဘၪ အဘၩ့အမုးတၭန့ဘၪ, အစီၩ့အမၩ့ ဘဲၫစဎွၩအၥိၭနီၪ လၧဆၧမံၩ့လၬအၥိၭ",
			"13": "<sup>13</sup> လနၩရံၩလီၫ.- အဝ့ၫၥံၪနီၪအၥၭအီၪဖျိၪ့ဎးတၭ, ဖ့ၪ လၫ့အစီၩ့အမၩ့, ဒဲအကယးအကဖး လၧဆၧမံၩ့လၬ",
			"14": "<sup>14</sup> လီၫ.- အဝ့ၫၥံၪနီၪမိဒုၭၥိၪဖိၪတၭ, ၥိၪဖိၪမိမၩနၧၩ့ မၩစၪအဝ့ၫၥံၪလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫဒၪနီၪ မွဲက ဆါၥံၪအကဆါ,ဒဲစဎွၩၥံၪအစဎွၩတၭ, ၦအီၪလၧ အၥိၭလဖၪနီၪ,မွဲၦလၧဆၧကိၭန့ဝ့ၫ,လၧဆၧရွံန့ ဝ့ၫဒဲၦလၧအလူတီၩလီၫ.",
			"15": "<sup>15</sup> တၭအဝ့ၫဒၪစံၭယၧၩ, ထံၫလဖၪလၧနဒၪဘၪဝ့ၫ လၧမဲၩဎွဲၩမုၪဆၧၫ့နၩ့ လၧအဖၫ့ခိၪနီၪမွဲၦၡၩၥံၪ ဒဲၦ ခမျၧးၥံၪ,ဒဲၦဆၨၩလဖၪ, ဒဲၦချဲၩ့ဆၧလၧအလၨအ",
			"16": "<sup>16</sup> ဂူၫဂၩလဖၪလီၫ.- တၭအနိၩ့ဆံၫဘီၩ့ လၧနဒၪဘၪဝ့ၫ လၧဆၧမံၩ့လၬအလီၩ့နီၪမိမ့ၬလဲၩမဲၩဎွဲၩမုၪဒဲမိမၩ ယူဝ့ၫ,ဒဲမိဒုၭအီၪဘိၪ့ဝ့ၫ,ဒဲမိအၪ့ဝ့ၫအယၪ, ဒဲမိဆူၭ",
			"17": "<sup>17</sup> ခဲၩဝ့ၫလၧမ့ၪလီၫ.- အဂဲးဘဲၫယီၩ ယွၩအီၪက့ၪဆၧ လၧအဝ့ၫၥံၪအၥၭခံဖၧၩ့, ဘဲၫၥိၭအမိမၩထီးဒၪအ ၥၭ,ဒဲအအီၪအၥၭလဖျိၪ့ဎးတၭ, ယွၩအလူအထၫလ ချႃၭလၧၫ့ထၪ့ဎွ့ၩထၪ့ဒံၭဘၪတၭ, မိဖ့ၪလၫ့အဘၩ့",
			"18": "<sup>18</sup> အမုးလၧဆၧမံၩ့လၬလီၫ.- တၭၦမုၪလၧနဒၪဘၪဝ့ၫနီၪ, မွဲဒိၩ့ဖၭဒိၪလၧအစ့ၩရၫ့ဂၪ့ခိၪအစဎွၩလဖၪလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> ဆၧနီၪလဖၪအလးခဲၫ့တၭ, ယဒၪဘၪအၥီၫ့အဂူၫဂၩ အီၪလၧအစီၩ့အမၩ့ ဖၭဒိၪလဂၩ ဂဲၫလၩ့လၧမူၭခိၪ တၭ,ဂၪ့ခိၪအီၪဖၩ့ထၪ့အၥၭလၧအဆၧဂိးၡ့ၭဂိးၡီၫ",
			"2": "<sup>2</sup> လီၫ.- အဝ့ၫဒၪကိၭၡၭထၪ့ လၧအလူဖၭဒိၪတၭ,စံၭဝ့ၫ ဒၪ,ဘၭဘလၧၫ့လၩ့ဎီးခွံၬယူၭ,လၩ့ဎီးခွံၬယူၭ, ဒဲကဲၪ ထၪ့ဝ့ၫလၧဆၧနၪလဖၪအီၪဝ့ၫအလး, ဒဲလၧကယဲ ဆၧၥၭလၧအဘၪၥၭလိၪဘၪၥလံၭအဖၧၩ့, ဒဲလၧထိၪ ၥံၪလၧအလဆံၫ့ဘၪ လၧၦမ့ၬလဲၩဝ့ၫ ထီးအအီၪဝ့ၫအ",
			"3": "<sup>3</sup> လးလီၫ.- အဂဲးဘဲၫယီၩ ကယဲၦကိၭဆၨၩဒ့ၭအီၩမၧၩ့ ယူၭအၥၭ လၧဆၧၥၭထၪ့အစဘံၭထံၫဘၪဆဲၫ့လၧ အဆၧမၩမၪမုၪ မၩမၪခွၫတၭ, ဂၪ့ခိၪအစဎွၩလဖၪ မၩမၪအၥၭ လၧအဝ့ၫဒၪတၭ, မွဲအဎၧၩ့အဎီအၪအ ကၠီၩ့တၭ, ၦဖနံၬဖိၪလၧဂၪ့ခိၪချိၫ့လဖၪကဲၪထၪ့ၦၥထံၫ ၥံၪလီၫ.",
			"4": "<sup>4</sup> ယနါဂၧၫ့ဆၧအလူဂူၫဂၩလၧမူၭခိၪတၭ, စံၭဝ့ၫဒၪ, ယခ့ၫယၡၩၥံၪဧ့, ဘဲၫၥိၭနၥံၪထီးဘၪဆဲၫ့ လၧအဆၧ ဒဲၩဘၭလဂ့ၩတၭ, ဘဲၫၥိၭနၥံၪထီးဘၪဎုၬဘၪလၧအ ဆၧၡၪ့ဆၧနၭလဂ့ၩတၭ, စဲၪ့ထၪ့ခွံၬလၧအဖၧၩ့ဆံၭ.",
			"5": "<sup>5</sup> အဂဲးဘဲၫယီၩ အဆၧဒဲၩဘၭထၪ့ဘၭယူၭလၧမူၭခိၪ တၭ,ယွၩနၪ့ထၪ့ထဲၩ့အဆၧလတီၩလလီၩ့ဘၪလီၫ.",
			"6": "<sup>6</sup> ဘဲၫအဖ့ၪလၫ့ဆၧလၧနၥံၪအၥိၭနီၪဖ့ၪလၫ့အဝ့ၫနီၪ ဆံၭ. တၭဘဲၫအမၩဝ့ၫအၥိၭနီၪ ဖ့ၪလၫ့ဝ့ၫအၪနဲၪ့အ နီၪနံၫစၩဆံၭ. လိၫ့လၧအမၩဎွ့ၩထၪ့ဝ့ၫနီၪ မၩဎွ့ၩထၪ့",
			"7": "<sup>7</sup> န့အဂးနံၫဖၧၩ့ဆံၭ.- ထီးဒၪအစံၭထၪ့အၪ့အူၭလၩ့အ ၥၭ,ဒဲမုၬလၩဝ့ၫ လၧအဎၧၩ့အဎီအဖၧၩ့နီၪ ဖ့ၪလၫ့အ ဝ့ၫလၧဆၧၡၪ့ဆၧနၭ, ဒဲဆၧၥုၪ့အုၭၥၭအုၭ န့ၫဎီၩ့ဆံၭ. အဂဲးဘဲၫယီၩမွဲအစံၭလၩ့အၥၭ, ယဆၧၫ့နၩ့ကဲၪဝ့ၫ နးဎွၩမုၪ,ယဝ့ၫတၭ, ယလမွဲဘၪၦမုၪမဲၫ, ယလၥၭအုၭ လၧၩ့ဘၪလီၫ.",
			"8": "<sup>8</sup> မၩအၥၭဘဲၫနီၪတၭ, အဆၧၡၪ့ဆၧနၭ, ဆၧၥံၫဆၧ ၡါ,ဆၧၥုၪ့အုၭၥၭအုၭ, ဆၧၥၭဝံလၩ့ဒိၩလဖၪနီၪ မိဂဲၫ ထၪ့လနံၩဎးတၭ, မ့ၪမိအၪ့ခွံၬအဝ့ၫဒၪလီၫ. အဂဲး ဘဲၫယီၩကဆါယွၩ လၧအစ့ၩရၫ့ဝ့ၫနီၪ အီၪလၧအဂဲး ဆီၪ့အဘၭဆီၪ့လီၫ.",
			"9": "<sup>9</sup> ဂၪ့ခိၪအစဎွၩၥံၪလၧအမၩမၪအၥၭလၧအဝ့ၫနီၪ တၭ,မုၬလၩဎုၬလၧအၥိၭ လၧအဎၧၩ့အဎီလဖၪနီၪ, ထီးအဒၪဘၪမ့ၪ လၧအအၪ့ခွံၬဝ့ၫအခူၪတၭ, မိဂၪ့ထၪ့",
			"10": "<sup>10</sup> တၭ, မိဒဲၩလၩ့အၥၭ,- တၭဆၧၫ့ထုၪ့လၧအယဲၩ့လၧ အၥၭမဲၪအဆၧၡၪ့ ဆၧနၭအကၠီၩ့နီၪ, မိစံၭဝ့ၫ,အၩလါ, အၩလါ. ဒိၩ့ဖၭဒိၪဘၭဘလၧၫ့ အီၪလၧအစီၩ့အမၩ့ ဧ့,အဂဲးဘဲၫယီၩ ဆၧစ့ၩရၫ့စၪဂဲၫဘၪနၧၩ လၧလနၩ ရံၩအထးဖၧၩ့လီၫ.",
			"11": "<sup>11</sup> ၦဖနံၬဖိၪလၧဂၪ့ခိၪချိၫ့မိဂၪ့မိယၧၩ့ဝ့ၫ, ဒဲမိမီၪ့မိမၭ ဝ့ၫလၧအကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩ ၦဎွ့ၩလၧၩ့အ",
			"12": "<sup>12</sup> ဆၧအၪ့ဆၫနီၪနးဂၩအ့ၬ.- မွဲအအၪ့ဆၫထီၫ့,ဒဲစ့ၩ, ဒဲလိးဂ့ၩ, ဒဲမနံၬထၫ့မျါ, ဒဲဆၧဘွၩဖျ့ၫလံၬကံၭ,ဒဲဆၧ လုၭဖုၭ, ဒဲထိ, ဒဲဆၧဝီၩလုၭဖုၭး ဒဲၥံၪ့ပၧၭကိၭမံၩ့ဒ့ၭ, ဒဲထွ့ၫကဆၫ့မဲၪကိၭမံၩ့ဒ့ၭ, ဒဲထွ့ၫၥံၪ့ဂ့ၩကိၭမံၩ့ဒ့ၭ, ဒဲ",
			"13": "<sup>13</sup> ထွ့ၫထီးဘၩ့, ဒဲထွ့ၫထၭ, ဒဲထွ့ၫလိးဘွၩ,- ဒဲၥံၪ့ခဒၩ့ရၫ အဖံၭ, ဒဲဆၧနၧၫ့မၧၫ့, ဒဲဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ, ဒဲမူၫရၫ့. ဒဲလီဘၩ့,ဒဲစဘံၭထံၫ, ဒဲၥိၪ,ဒဲကိၪမုၬ, ဒဲဘုၪကၠိၩ့,ဒဲဆၧ ဖိၪဆၧဎါၥံၪ,ဒဲၥိၪၥံၪ, ဒဲကၥ့ၪၥံၪ,ဒဲလဲၪ့ၥံၪ, ဒဲဎီးၥံၪ, ဒဲၦၡၩအၥၭၡီၩ့ၥံၪလီၫ.",
			"14": "<sup>14</sup> တၭဆၧၥၪလၧနၥၭကွံၩဝ့ၫလဖၪနီၪ စဲၪ့ဒၪယူၭနၧၩ ယူၭ. တၭကယဲဆၧအဘီၪ့, ဒဲဆၧအအွံၪၥိၪလဖၪလၩ့ မါယူၭလၧနအီၪယူၭတၭ, နမိဒၪဘၪလၧၩ့နးဆိၭအ့ၬ.",
			"15": "<sup>15</sup> တၭၦလၧအလ့ၩမၩဖနံၬ လၧဆၧနီၪလဖၪ ကဲၪထၪ့ၦ ၥထံၫလၧအဝ့ၫဒၪအကၠီၩ့လဖၪနီၪ, မိဆၧၫ့ထုၪ့လၧအ ယဲၩ့လၧအၥၭမဲၪ အဆၧၡၪ့ဆၧနၭအကၠီၩ့နီၪ, မိဂၪ့ဝ့ၫ",
			"16": "<sup>16</sup> ယၧၩ့ဝ့ၫ, ဒဲမီၪ့ဝ့ၫမၭဝ့ၫတၭ,- မိစံၭဝ့ၫ, အၩလါ, အၩ လါ, ဒိၩ့ဖၭဒိၪလၧအကီၩ့ဝ့ၫၥိၭဝ့ၫ လၧဆၧဘွၩဖျ့ၫလံၬ ကံၭဒဲဆၧလုၭဖုၭ,ဒဲဆၧဝီၩလုၭဖုၭ, ဒဲကယၧၩ့အၥၭ",
			"17": "<sup>17</sup> လၧထီၫ့ဒဲလိးဂ့ၩ, ဒဲမနံၬထၫ့မျါၥံၪလီၫ.- အဂဲးဘဲၫယီၩ ဆၧလၧၫ့ဆၧဎွ့ၩဒိၪဖိၭဘိၭယီၩ, ဆၧမၩယူဝ့ၫလၧလ နၩရံၩအထးဖၧၩ့နီၪလီၫ. တၭကယဲကဘၩ့ ဒဲၦထူၬ ကဘၩ့, ဒဲကယဲကဘၩ့ဖိၪ, ဒဲထီးဒၪၦလၧအလ့ၩမၩ ဖနံၬလၧမၫဆမံၭဖၧၩ့လဖၪနီၪ, ဆၧၫ့ထုၪ့လၧအ",
			"18": "<sup>18</sup> ယဲၩ့,- ဒၪဘၪမ့ၪလၧအအၪ့ခွံၬဝ့ၫ အခူၪတၭ, ကိၭၡၭ ထၪ့တၭ, စံၭဝ့ၫဒၪ, ဆၧလၩ့ဂၬဒိၩ့ဖၭဒိၪယီၩမွဲဆၧ",
			"19": "<sup>19</sup> နီၪလမံၩ့လဲၪ.- အဝ့ၫၥံၪဎွံၪထၪ့ဂၪ့ခိၪအမုၬ လၧအခိၪ ဎွံၪလီၩ့တၭ, ဂၪ့ထၪ့ယၧၩ့ထၪ့, ဒဲမီၪ့ဒဲမၭတၭ, ကိၭ ၡၭထၪ့တၭ, စံၭဝ့ၫဒၪ, အၩလါ, အၩလါ, ဒိၩ့ဖၭဒိၪလၧ ကယဲၦအီၪလၧကဘၩ့ၥံၪ လၧမၫဆမံၭဖၧၩ့နီၪကဲၪထၪ့ ၦၥထံၫလၧအဆၧလူဒိၪဎွ့ၩဒိၪ လၧအဖၧၩ့လီၫ. အဂဲး ဘဲၫယီၩ ဆၧမၩယူဝ့ၫ လၧလနၩရံၩအထးဖၧၩ့လီၫ.",
			"20": "<sup>20</sup> မူၭခိၪ,ဒဲၦဆံၫ့ဎံၪၥံၪ, ဒဲၦဆၧအၪ့မၧၫ့ဖိၪၥံၪ,ဒဲမီၪၥံၪ ဧ့,ၥၭထိၬလၧအကၠီၩ့ဆံၭ. အဂဲးဘဲၫယီၩ မွဲယွၩ",
			"21": "<sup>21</sup> စ့ၩရၫ့စၪအဝ့ၫလၧနၥံၪအကၠီၩ့လီၫ.- အၥီၫ့လၧအဂဲး အဘၭဆီၪ့လဂၩ, မၩန့ထၪ့လိးဖၭဒိၪ ဘဲၫဆုၪ့ဂူၬလိး လဖျိၪ့အၥိၭတၭ, ခွံၬလၩ့ခွံၬဝ့ၫ လၧမၫဆမံၭဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, ဆၧမိခွံၬလၩ့ခွံၬ ဒိၩ့ဖၭဒိၪဘၭဘလၧၫ့ ဘဲၫယီၩၥိၭတၭ, ဆၧလမိဒၪလၧၩ့ဘၪအဝ့ၫလီၫ.",
			"22": "<sup>22</sup> တၭၦဒံၩ့နါဒံၩ့, ဒဲၦၥံၫကျံၩဆၧ,ဒဲၦအူၪပံၩ, ဒဲၦအူၪ ခွ့ၩၥံၪအၥီၫနီၪ, ဆၧနါဂၧၫ့လၧၩ့ လၧနဖၧၩ့အ့ၬ. တၭ ကယဲၦမၩဆၧၥ့ၪဘၪဆဲၫ့ လၧကယဲဆၧမၩနီၪ, ဆၧမိ ဒၪဘၪလၧနဖၧၩ့နးဂၩအ့ၬ. ဒဲဆၧဂူၬဆုၪ့ဂူၬအၥီၫနီၪ,",
			"23": "<sup>23</sup> ဆၧမိနါဂၧၫ့လၧၩ့လၧနဖၧၩ့အ့ၬ.- ဒဲမ့ၪဒိၩ့မိဖၩ့ထၪ့ လၧၩ့လၧနဖၧၩ့အ့ၬ. ဒဲတလၭမူၭအခွၫ, ဒဲတလၭမူၭ အမုၪအလူနီၪ, ဆၧမိနါဂၧၫ့လၧၩ့လၧနဖၧၩ့အ့ၬ. အ ဂဲးဘဲၫယီၩ နၡၩဖနံၬၥံၪနီၪ မွဲၦအဒိၪအထီၫလၧဂၪ့ခိၪ ချိၫ့လီၫ. အဂဲးဘဲၫယီၩ လၧနမၩကဒၩၦမ့ၬအကၠီၩ့ နီၪ,ၦကိၭဆၨၩဒ့ၭလ့ၩမၪဖၧၩ့ၥၭလီၫ.",
			"24": "<sup>24</sup> တၭမီၪလဖၪ,ဒဲၦဆံၫ့ဎံၪလဖၪ, ဒဲကယဲၦလၧအဘၪ ဆၧမၩၥံၫဝ့ၫ လၧဂၪ့ခိၪချိၫ့လဖၪအၥွံၪနီၪ,ဆၧဒၪ ဘၪဝ့ၫလၧအဖၧၩ့လီၫ."
		},
		"19": {
			"1": "<sup>1</sup> ဆၧလဖၪနီၪအလးခဲၫ့, ယနါဂၧၫ့ၦခမျၧးအၪအလူ ၥီၫဖၭဒိၪလၧမူၭခိၪအဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, ဟၫလလု ယၫ,မွဲဆၧထိးထဲၩ့တၩ့ထဲၩ့,ဒဲဆၧလၩဆၧဖၩ့ဒဲဆၧ ယူၭဆၧယၪ့ ဒဲဆၧအစီၩ့အမၩ့လဖၪအီၪလၧပယွၩ",
			"2": "<sup>2</sup> နီၪ,- အဂဲးဘဲၫယီၩ အဆၧစ့ၩရၫ့လဖၪနီၪ,မွဲအတီၩ, ဒဲမွဲအတီၩအလီၩ့လီၫ. အဂဲးဘဲၫယီၩ မွဲအစ့ၩရၫ့ၦ မဲၩဎွဲၩမုၪဖၭဒိၪ လၧအမၩအၧၩ့လၩ့ဂၪ့ခိၪဖိၪ လၧအ မၩမၪမုၪမၩမၪခွၫလဂၩတၭ, စ့ၩရၫ့န့ထဲၩ့ယူၭဝ့ၫလၧ",
			"3": "<sup>3</sup> အဎီးအၡၩအၥွံၪလၧအစူၪဖၧၩ့အကၠီၩ့ယူၭ.- တၭ အဝ့ၫၥံၪစံၭနံၫဖၧၫ့လဖၧၫ့, ဟၫလလုယၫတၭအဝ့ၫ ဒၪအဆၧခူၪထၪ့ဝ့ၫ အဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"4": "<sup>4</sup> ၦၥုၪ့က့ၭၥၭၡါနံၫဆံၫလံဂၩ, ဒဲဆၧအမၧၫ့လံဒုၩလ ဖၪနီၪထွံၩလၩ့တၭ, ဘိၪ့ထၪ့ဘၩထၪ့ယွၩ လၧအဆၧၫ့ နၩ့လၧလးဆီၩ့ဆီအဖၫ့ခိၪတၭ, စံၭဝ့ၫဒၪ, အၩမံၩ့,ဟၫ လလုယၫ.",
			"5": "<sup>5</sup> ဆၧၥီၫထၪ့လၧလးဆီၩ့ဆီအဖၧၩ့နီၪ, စံၭဝ့ၫဒၪ,ယွၩ အဎီးအၡၩထီးအလူၬ, ဒဲၦလၧအၥၭမဲၪဝ့ၫ ဒဲဒိၪဒဲဆံၭ ၥံၪဧ့, အၪ့အူၭပယွၩဆံၭ.",
			"6": "<sup>6</sup> ယနါဂၧၫ့ဆၧၥီၫ, ဘဲၫၦခမျၧးဖၭဒိၪ အၥီၫအၥိၭ တၭ,ဒဲဘဲၫထံၫအၪလ့ၬ အၥီၫအၥိၭ, ဒဲဘဲၫလၩ့ဎွံၩ့ဖၭဒိၪ အၥိၭနီၪစံၭဝ့ၫဒၪ, ဟၫလလုယၫး အဂဲးဘဲၫယီၩကဆါ",
			"7": "<sup>7</sup> ယွၩလၧအၥ့ၪဆၧလူၬနီၪပၧၩ့ဘၪဆၧလီၫ.- မွဲပၥုၪ့ ထိၬၥၭထိၬ, ဒဲၥုၪ့ဎွံၫၥၭယီၫတၭ, ဖ့ၪလၫ့ၡီၩ့အဝ့ၫဒၪ လၧဆၧလၩဆၧဖၩ့ဆံၭ. အဂဲးဘဲၫယီၩ ၥိၪဖိၪအဆၧ အီၪဎုၬဘၪယူၭတၭ,အမၫတဲၩ့ဝဲၩယူၭအၥၭယူၭ.",
			"8": "<sup>8</sup> တၭဆၧဒုၭကီၩ့ဒုၭၥိၭဝ့ၫ လၧဆၧဘွၩဖျ့ၫလံၬကံၭ, ဆံၫ့ ဒဲအဂိးၡ့ၭဂိးၡီၫလီၫ. အဂဲးဘဲၫယီၩ ဆၧဘွၩဖျ့ၫ လံၬကံၭနီၪ, မွဲၦဆံၫ့ဎံၪ အဆၧတီၩဆၧလီၩ့လီၫ.",
			"9": "<sup>9</sup> အဝ့ၫဒၪစံၭယၧၩ, ကွ့ၭဘီၪ, ၦလၧဆၧကိၭန့ဝ့ၫလၧ ၥိၪဖိၪအဆၧဖျၫ့လိၬအၥၭ အမူၭဖၧၩ့နီၪ ဘၪဆၧဆိၪ ဂ့ၩဝ့ၫလီၫ. အဝ့ၫဒၪစံၭယၧၩဆၧချဲၩ့လဖၪယီၩမွဲအ လူတီၩလီၫ.",
			"10": "<sup>10</sup> ဘဲၫၥိၭယမိဘၩထၪ့အဝ့ၫတၭ, ယထွံၩလၩ့လၧအ ခၪ့ထံၭလီၫ. အဝ့ၫဒၪစံၭယၧၩ,ထီးလၩ့နၥၭ, ဘဲၫ ၥိၭနထီးမၩဘဲၫနီၪလဂ့ၩ, ယမွဲဆၧအခ့ၫအၡၩ လၧန ၥိၭတၭ,အီၪလၧနထၧၫ့ဖုဝဲအကျၩ လၧအအီၪလၧယ့ၫ ရှူၬအဆၧထိးအၥၭလဖၪတၭ, ဘၩထၪ့ယွၩဆံၭ. အ ဂဲးဘဲၫယီၩ ယ့ၫရှူၬအဆၧထိးအၥၭနီၪ မွဲဆၧချဲၩ့လၧ မီၪအချိၬလီၫ.",
			"11": "<sup>11</sup> ယဒၪဘၪမူၭခိၪဝဲထၪ့အၥၭတၭ, ယိခွါ,ကၥ့ၪဘွၩ တၭၦဆၧၫ့နၩ့လၧအလီၩ့လဂၩကိၭဝ့ၫ လၧဆၧအလူ တီၩ, ဒဲဆၧအမွဲအတီၩလီၫ. စ့ၩရၫ့ဆၧ,ဒဲဒုၭဆၧ",
			"12": "<sup>12</sup> လၧဆၧတီၩတီၩလီၩ့လီၩ့အဖၧၩ့လီၫ.- အမ့ၬၥၪမၩ အၥၭဘဲၫမ့ၪလၪအၥိၭတၭ,ၥရဖူၩအၪဖျိၪ့အီၪလၧ အခိၪဎွံၪလီၩ့တၭ,အမံၩ့အီၪကွ့ၭအၥၭလၧၦလၥ့ၪ ယၫဘၪနးဂၩတၭ, ၥ့ၪယၫန့ၫအနၫ့ဆါဒၪဝ့ၫလီၫ.",
			"13": "<sup>13</sup> ကီၩ့ၥိၭဝ့ၫ လၧအဆဲၫ့စုၪလၩ့အၥၭ လၧဆၧၥွံၪအဖၧၩ့ တၭ, အမံၩ့ဘၪကိၭအၥၭ,ယွၩအလူလီၫ.",
			"14": "<sup>14</sup> မူၭခိၪအၥုၭမုခမျၧး အဒီၪ့ၥံၪကီၩ့ၥိၭဝ့ၫလၧဆၧဘွၩ ဖျ့ၫလံၬကံၭအဆံၫ့နီၪဖိၬထၪ့အခဲၫ့လၧကၥ့ၪဘွၩလ",
			"15": "<sup>15</sup> ဖၪအဖၫ့ခိၪလီၫ.- တၭနၭလၧအနါအဲၪ့လဘံၪ့ဂဲၫထၪ့ လၧအနိၭဖၧၩ့,ဘဲၫၥိၭအမိဖ့ၬခွံၬၦဆၨၩလဖၪလၧ ဆၧနီၪတၭ, မိပၧၩ့ၦဆၨၩလဖၪ လၧအနိၪထိၭထၭလ ဘီၩ့တၭ, မိယဲးဝ့ၫလၧယွၩလၧအၥ့ၪဆၧလူၬအဆၧ",
			"16": "<sup>16</sup> ၥၭထၪ့ဆီၪ့အစဘံၭထံၫအချိၭလီၫ.- တၭအမံၩ့ကွ့ၭအ ၥၭလၧအကီၩ့အၥိၭအလီၩ့, ဒဲလၧအကံၪဒုၪအလီၩ့, စဎွၩလဖၪအစဎွၩ, ဒဲကဆါလဖၪအက ဆါလီၫ.",
			"17": "<sup>17</sup> ယဒၪဘၪအၥီၫ့လဂၩ ဆၧၫ့ထုၪ့လၧမုမ့ၬအဖၧၩ့တၭ, ကိၭထၪ့ဆၧလၧအလူဖၭဒိၪနီၪ, လီၩဘၪထိၪၥံၪလံၪ ၥံၪလၧအယူၩဝ့ၫ လၧဆၧဖိၭဖၫ့ထီးအလူၬ, ဂဲၫဘီၪ, အီၪကီၪ့လၧယွၩအဆၧအၪ့ လၧဂၪအၪ့ဖၭဒိၪအ",
			"18": "<sup>18</sup> ဖၧၩ့ဆံၭ.- မွဲဘဲၫၥိၭနၥံၪမိအၪ့ဘၪ စဎွၩၥံၪအယၪ, ဒဲၥုၭဖိၪလထီၫ့ အခိၪၥံၪအယၪ, ဒဲၦလၧအဂဲးဆီၪ့အ ဘၭဆီၪ့ၥံၪအယၪ, ဒဲကၥ့ၪလဖၪအယၪ,ဒဲကယဲၦဆၧၫ့ နၩ့လၧအလီၩ့ၥံၪအယၪ, ဒဲကယဲၦပျီၩဖျ့ၭၥံၪအယၪ,",
			"19": "<sup>19</sup> ဒဲၦဎီးၥံၪအယၪ, ဒဲဒိၪဒဲဆံၭထီးအလူၬဘီၪ.- တၭယ ဒၪဘၪဆၧမံၩ့လၬ, ဒဲဂၪ့ခိၪအစဎွၩလဖၪ, ဒဲအၥုၭဖိၪ အဒီၪ့ၥံၪအီၪကိၩ့အီၪကီၪ့ ဘဲၫၥိၭအမိဒုၭၦလၧအဆၧၫ့",
			"20": "<sup>20</sup> နၩ့လၧကၥ့ၪအဖၫ့ခိၪဒဲအၥုၭမုခမျၧးနီၪလီၫ.- တၭ ဆၧဖီၪ့ထၬဆၧမံၩ့လၬ, ဒဲမီၪအဘျၪလၧအမၩဆၧ လၩ့လၭလၧအမ့ၬယၫ, ဒဲအၪ့လီၫန့ ၦအီၪလၧဆၧမံၩ့ လၬအဆၧမၩနဲၪ့လၧအလီၩ့း ဒဲၦလဖၪလၧအဘၩ ထၪ့အဆၧဂၩ့နီၪလီၫ. အဝ့ၫၥံၪနံၫဂၩ ဘၪဆၧခွံၬလၩ့ မၧၫ့ဝ့ၫလၧမ့ၪကွံၩဖၧၩ့လၧမ့ၪဒဲကးအၪ့ဆၧအဖၧၩ့",
			"21": "<sup>21</sup> လီၫ.- တၭၦအီၪလၩ့ထးလဖၪဘၪၥံၫလၧနၭလၧအ ဂဲၫထၪ့လၧၦလၧအဆၧၫ့နၩ့ လၧကၥ့ၪအဖၫ့ခိၪအနိၭ ဖၧၩ့,ဒဲထိၪၥံၪလံၪၥံၪ ထီးအလူၬအၪ့ဘျဲၩအၪ့အၥၭ လၧအဝ့ၫၥံၪအယၪလီၫ."
		},
		"20": {
			"1": "<sup>1</sup> တၭယဒၪဘၪအၥီၫ့ ဂဲၫလၩ့လၧမူၭခိၪလဂၩအီၪ လၧဆၧဖၧၩ့ယိၬအနိၪဝံၬ,ဒဲၥွ့ၫထၭဖၭဒိၪ လၧအစူၪ",
			"2": "<sup>2</sup> ဖၧၩ့လီၫ.- အဝ့ၫနီၪဖီၪ့ထၬၡီၩ့,ဂူလးလံၩ, လၧအမွဲ မုၪခီၩလဲး, ဒဲစၫတၫ့တၭ, စၧၩ့ထၬဝ့ၫအနံၪ့လထီၫ့",
			"3": "<sup>3</sup> လီၫ.- အနံၪ့လထီၫ့လချႃၭဎွ့ၩထၪ့ဒံၭဘၪနီၪ, ဘဲၫၥိၭ အထီးအၪ့လီၫန့ဘၪ ၦဆၨၩလဖၪလဂ့ၩတၭ, မွဲအခွံၬ လၩ့အဝ့ၫဒၪ လၧဆၧယိၬအဖၧၩ့နီၪတၭ, ကၭဘံၭထၬ ဒဲစဲၩနဲၪ့ထၬဝ့ၫလီၫ. ဆၧလဖၪနီၪအလးခဲၫ့တၭ, မိ ဘၪဆၧကွဲၪဖျါခွံၬဝ့ၫနးဆိဖိၪလီၫ.",
			"4": "<sup>4</sup> ယဒၪဘၪလးဆီၩ့ဆီလဖၪ, ဒဲၦဆၧၫ့နၩ့ဝ့ၫလၧအ လီၩ့တၭ, ဆၧဖ့ၪလၫ့အဝ့ၫၥံၪလၧဆၧစ့ၩရၫ့တၭ,ၦလၧ အလဘၩထၪ့ဘၪ ဆၧမံၩ့လၬဒဲအဂၩ့, ဒဲလဒိၭန့ဘၪ ဆၧမၩနဲၪ့လၧအမ့ၬထုးခိၪ, ဒဲလၧအစူၪအလီၩ့တၭထိး အၥၭလၧယ့ၫရှူၬဎရံၬ, ဒဲယွၩအလူအထၫအကၠီၩ့တၭ, ဆၧဖ့ၬခွံၬဝ့ၫအခိၬလဖၪနီၪ, ယဒၪဘၪအၥၭၡီၩ့လ ဖၪလီၫ. အဝ့ၫၥံၪနီၪမၧၫ့ဝ့ၫတၭ, ပၧၩ့ဘၪဎုၬဝ့ၫလၧ ဎရံၬအၥိၭအနံၪ့လထီၫ့လီၫ.",
			"5": "<sup>5</sup> တၭအနံၪ့လထီၫ့လချႃၭဎွ့ၩထၪ့ဒံၭဘၪနီၪ, ၦၥံၫအ ဂူၫဂၩလဖၪမၧၫ့ထၪ့ဘၪအ့ၬ. အယီၩမွဲဆၧဂဲထုၪ့ထဲၩ့",
			"6": "<sup>6</sup> လၧအခၪ့ထံၭလီၫ.- ၦလၧအလးအီၪလၧဆၧဂဲထုၪ့ထဲၩ့ လၧအခၪ့ထံၭနီၪ မွဲအဆံၫ့ဎံၪဝ့ၫတၭ, ဘၪဆၧဆိၪဂ့ၩ ဝ့ၫလီၫ. ၦဘဲၫနီၪၥိၭလဖၪဖီၩ့ဖျ့ၭဝ့ၫ လၧဆၧၥံၫနံၫဖၧၫ့ လဖၧၫ့အစီၩ့အမၩ့တၭ,အဝ့ၫၥံၪမိကဲၪထၪ့ယွၩ, ဒဲ ဎရံၬအၡၩလုဆၧလဖၪတၭ,မိပၧၩ့ဘၪဝ့ၫလၧအဝ့ၫ ဒၪအၥိၭအနံၪ့ လထီၫ့လီၫ.",
			"7": "<sup>7</sup> ထီးအနံၪ့လထီၫ့ဖီၩ့ခွံၬတၭ, မုၪခီၩလဲးမိဘၪဆၧဖျါ",
			"8": "<sup>8</sup> ထၪ့ခွံၬလၧအထီၫ့ဖၧၩ့နီၪ,- မိလ့ၩအၪ့လီၫန့ၦဆၨၩလ ဖၪအီၪလၧဂၪ့ခိၪအနိၪ့လံနိၪ့အဖၧၩ့,ဂီၭ, ဒဲမ့ဂီၭ နီၪဘဲၫၥိၭအမိအီၪကီၪ့ဝ့ၫလၧဆၧဒုၭဆၧယၩအဂး လီၫ.အဆၧဝံဆၧနၬ အၪဎွ့ၩဎီၩ့ဝ့ၫ လၧမ့ၭအဖျိၪ့အီၪ",
			"9": "<sup>9</sup> ဝ့ၫလၧမၫဆမံၭနဲၩ့ အၥိၭနီၪလီၫ.- အဝ့ၫၥံၪဂဲၫထၪ့လၧ ဂၪ့ခိၪချိၫ့တၭ, ဝၩ့ထၬၦဆံၫ့ဎံၪအလးဒဲဒိၩ့လၧဆၧ အဲၪဝ့ၫလဖျိၪ့တၭ, မ့ၪဂဲၫလၩ့လၧယွၩအအီၪ လၧမူၭခိၪ",
			"10": "<sup>10</sup> တၭ, အၪ့ခွံၬအဝ့ၫၥံၪလီၫ.- တၭမုၪခီၩလဲးလၧအအၪ့ လီၫန့အဝ့ၫၥံၪနီၪ, ဆၧခွံၬလၩ့ခွံၬဝ့ၫလၧမ့ၪဒဲကးအ ကွံၩဖၧၩ့,ထီးဆၧမံၩ့လၬ, ဒဲမီၪအဘျၪအီၪဝ့ၫဒၪအလး လီၫ. တၭအဝ့ၫၥံၪမိဘၪဆၧၡၪ့ဆၧနၭ မုနၩနၩ မုဆၫ ဆၫအဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"11": "<sup>11</sup> တၭယဒၪဘၪ လးဆီၩ့ဆီဖၭဒိၪယုၩ့ယဲဝ့ၫနီၪ, ဒဲၦလၧအဆၧၩ့နၩ့ဝ့ၫ လၧအလီၩ့လီၫ. ဂၪ့ခိၪ, ဒဲမူၭခိၪ စဲၪ့ခွံၬလၧအမ့ၬယၫတၭ, အီၪဝ့ၫအလးအီၪလၧၩ့အ့ၬ.",
			"12": "<sup>12</sup> ယဒၪဘၪၦၥံၫ, ဒဲဒိၪဒဲဆံၭလဖၪနီၪ ဆၧၫ့ထုၪ့လၧလး ဆီၩ့ဆီအမ့ၬယၫတၭ, လံၬလဖၪအီၪဝဲထၪ့အၥၭ, ဒဲ လံၬအဂူၫဂၩလၧအမွဲလံၬမၧၫ့လထူအီၪဝဲထၪ့ အၥၭတၭ, ၦအၥံၫလဖၪနီၪ, ဘဲၫအမၩဆၧအၥိၭ, ဘဲၫ ဆၧကွ့ၭအၥၭ လၧလံၬဖၧၩ့အၥိၭနီၪဘၪဆၧစ့ၩရၫ့",
			"13": "<sup>13</sup> ဝ့ၫဒၪလီၫ.- တၭမၫဆမံၭဖ့ၪလၫ့ထၪ့ထဲၩ့ ၦၥံၫအီၪလၧ အဖၧၩ့နီၪ, ဆၧၥံၫဒဲဖျႃဖၧၩ့နီၪ ဖ့ၪလၫ့ထၪ့ထဲၩ့ၦၥံၫအီၪ လၧအဖၧၩ့နီၪ, ဆၧစ့ၩရၫ့ဝ့ၫ ဘဲၫအမၩဆၧအၥိၭနီၪ, လဂၩအဂးလဂၩအဂး ကိၭဂၩဒ့ၭဆုၬဆုၬလီၫ.",
			"14": "<sup>14</sup> တၭဆၧခွံၬလၩ့ခွံၬဆၧၥံၫ ဒဲဖျႃဖၧၩ့နီၪလၧမ့ၪကွံၩအ ဖၧၩ့လီၫ. ဆၧယီၩမွဲဆၧၥံၫနံၫဖၧၫ့လဖၧၫ့တၭ,မွဲ",
			"15": "<sup>15</sup> မ့ၪကွံၩနီၪလီၫ.- တၭၦလဂၩဂၩဆၧအ့ၪလဒၪဘၪအ မံၩ့အီၪကွ့ၭအၥၭ လၧလံၬမၧၫ့အဖၧၩ့နီၪ, ဆၧခွံၬလၩ့ ဝ့ၫလၧမ့ၪကွံၩအဖၧၩ့နီၪလီၫ."
		},
		"21": {
			"1": "<sup>1</sup> တၭယဒၪဘၪမူၭခိၪအၥၫ့ဒဲဂၪ့ခိၪအၥၫ့လီၫ. အဂဲး ဘဲၫယီၩမူၭခိၪလၧအခၪ့ထံၭ ဒဲဂၪ့ခိၪလၧအခၪ့ထံၭနီၪ",
			"2": "<sup>2</sup> ဖီၩ့ခွံၬယူၭဝ့ၫယူၭတၭ, မၫဆမံၭအီၪလၧၩ့အ့ၬ.- တၭ ယဒၪဘၪဒိၩ့ဆံၫ့ဎံၪယရုစလံၫ့အၥၫ့နီၪ,ဂဲၫလၩ့လၧ ယွၩအအီၪ လၧမူၭခိၪတၭ, အီၪတဲၩ့ဝဲၩအၥၭ ဘဲၫတ လၭမူၭအမုၪအီၪကယၧၩ့အၥၭ လၧအဝၩအဂးအ ၥိၭနီၪလီၫ.",
			"3": "<sup>3</sup> တၭယနါဂၧၫ့ဆၧၥီၫဖၭဒိၪ လၧမူၭခိၪနီၪ, စံၭဝ့ၫဒၪ, ယိခွါ, ယွၩအတဲၩအီၪလၧၦၡၩအကျၩတၭ, အဝ့ၫ ဒၪမိအီၪလၧအဝ့ၫၥံၪအၥိၭနီၪၦၡၩမိကဲၪထၪ့ဝ့ၫအခ့ၫ အၡၩ,ဒဲယွၩအနၫ့ဆါဒၪဝ့ၫ မိအီၪလၧအၥိၭနီၪ, မိကဲၪ",
			"4": "<sup>4</sup> ထၪ့ဝ့ၫလၧအဝ့ၫၥံၪအယွၩလီၫ.- မွဲအထူၭခွံၬအဝ့ၫၥံၪ အမ့ၬထံၫထီးအလူၬ လၧအမ့ၬၥၪအဖၧၩ့တၭ,ဆၧ ၥံၫအီၪလၧၩ့အ့ၬ.ဒဲဆၧၥုၪ့အုၭၥၭအုၭလအီၪလၧၩ့ ဘၪ,ဒဲဆၧဂၪ့ဆၧယၧၩ့ လအီၪလၧၩ့ဘၪ, ဒဲဆၧၥုၪ့ဎဲၫ ၥၭဎဲၫအီၪလၧၩ့ဆ့အ့ၬ. အဂဲးဘဲၫယီၩ ဆၧအီၪလၧအ ခၪ့ထံၭလဖၪနီၪ ဖီၩ့ခွံၬယူၭဝ့ၫယူၭ.",
			"5": "<sup>5</sup> တၭၦဆၧၫ့နၩ့ လၧလးဆီၩ့ဆီအလီၩ့လဂၩနီၪ,စံၭ ဝ့ၫဒၪ,ယိခွါ, ယဒုၭကဲၪထၪ့ဆၧအၥၫ့ ထီးအလူၬလီၫ. တၭမွဲအစံၭယၧၩ, ကွ့ၭဘီၪ,အဂဲးဘဲၫယီၩ ဆၧချဲၩ့လ",
			"6": "<sup>6</sup> ဖၪယီၩ, မွဲအတီၩဒဲမွဲအကြၨၭဆ့လီၫ.- တၭအဝ့ၫဒၪ စံၭယၧၩ, ဆၧမၩယူၭအၥၭယူၭ. ယမွဲက,ဒဲဧ,အ ခၪ့ထံၭဒဲအထုၬလီၫ. ၦလၧဆၧၥူၫအီၩအၥၭလၧ ထံၫနီၪယမိဖ့ၪလၫ့ပျီၩပျီၩ ထံၫထၪ့ဖျိၭအမၧၫ့ပျီၩ",
			"7": "<sup>7</sup> ပျီၩလီၫ.- ၦလၧအမၩနၧၩ့မၩစၪဆၧနီၪမိန့ဘၪၥၫဝ့ၫ ဆၧလဖၪယီၩတၭ, ယမိကဲၪထၪ့အယွၩတၭ, အဝ့ၫဒၪ",
			"8": "<sup>8</sup> နီၪမိကဲၪထၪ့ ယဖိၪခွၫလီၫ.- အ့ၪမွဲၦၥၭမဲၪဆၧ,ဒဲၦ လနဲၩဘၪဆၧ,ဒဲၦမၩဆၧၥၭလိၪ,ဒဲၦမၩၥံၫၦ ၡၩ, ဒဲၦမၩမၪမုၪမၩမၪခွၫ, ဒဲၦမၩဆၧအူၪဆၧ ပီၩ, ဒဲၦဘၩဆၧဂၩ့, ဒဲကယဲၦလၧအချဲၩ့ဘျံၭချဲၩ့ ဘျၪဆၧလဖၪနီၪ, မိန့ဘၪအလး လၧကွံၩဖၧၩ့လၧ မ့ၪဒဲကးအၪ့ဆၧအလးနီၪ, လၧအမွဲဆၧၥံၫနံၫဖၧၫ့လ ဖၧၫ့လီၫ.",
			"9": "<sup>9</sup> တၭအၥီၫ့အီၪဝ့ၫလၧနွ့ၫဂၩအကျၩ လၧအအီၪလၧ လိၫ့နွ့ၫဖျိၪ့ဎွ့ၩဝ့ၫ လၧဆၧၡၪ့ဆၧနၭ လၧခဲၫ့ထုၬနွ့ၫမံၩ့ အကျၩလဂၩ,ဂဲၫလၧယအီၪတၭ, ချဲၩ့ဆၧလၧယၧၩ, စံၭဝ့ၫဒၪ, ဂဲၫထၪ့လၧယီၩဘီၪ, ယမိဒုၭနဲၪနၧၩလၧတ",
			"10": "<sup>10</sup> လၭမူၭအမုၪ, ၥိၪဖိၪအမၫနီၪလီၫ.- တၭမွဲအဆိၬထၪ့ ယၧၩလၧၥၭအဖၧၩ့လၧခိၪလီၩ့ဖၭဒိၪဖၭထီၫအလီၩ့ တၭ,ဒုၭနဲၪယၧၩ လၧဒိၩ့ဆံၫ့ဎံၪ ယရုစလံၫ့ဂဲၫလၩ့လၧ",
			"11": "<sup>11</sup> ယွၩအအီၪလၧမူၭခိၪ,- အီၪဝ့ၫလၧယွၩအလၩအဖၩ့, ဒဲအဆၧဖၩ့လၩ့ဂၬမနံၬလၧအလူဒိၪဎွ့ၩဒိၪ, မၩအ ၥၭဘဲၫနကၥွဲၭဘဲၫမနံၬ လၧအဎံၪဝ့ၫ ဘဲၫလိးဖျီၪၥလၩ",
			"12": "<sup>12</sup> အၥိၭနီၪလီၫ.- တၭအီၪလၧအခိၪဒၧၩ့ဖၭဒိၪဖၭထီၫဒဲ အတရၫ့လဆံၫနံၫဘံၪ့, ဒဲအၥီၫ့လဆံၫနံၫဂၩ အီၪ လၧတရၫ့အဂၩ့ထံၭတၭ,ဆၧအမံၩ့အီၪကွ့ၭအၥၭလၧ အလီၩ့ လၧအမွဲၦအံၫစရ့လၭဖိၪ လဆံၫနံၫဒီၪ့အမံၩ့",
			"13": "<sup>13</sup> လီၫ.- တၭတရၫ့အီၪလၧမုထၪ့လခီၫၥၧၫ့ဘံၪ့, ဒဲတရၫ့ အီၪလၧမုဖၩလခီၫၥၧၫ့ဘံၪ့, ဒဲတရၫ့အီၪလၧမုခံၫ့လခီၫ",
			"14": "<sup>14</sup> ၥၧၫ့ဘံၪ့, ဒဲတရၫ့အီၪလၧမုနုၬလခီၫ ၥၧၫ့ဘံၪ့လီၫ.- တၭ ဒိၩ့အခိၪဒၧၩ့နီၪ အီၪလၧအခၪ့ထံၭအီၪဝ့ၫ လဆံၫနံၫ ထၧၫ့,ဒဲၥိၪဖိၪ အဆၧအၪ့မၧၫ့ဖိၪလဆံၫနံၫဂၩအမံၩ့ အီၪဝ့ၫလၧအလီၩ့လီၫ.",
			"15": "<sup>15</sup> တၭၦလၧအချဲၩ့ဆၧလၧယၥိၭနီၪ အီၪလၧအနိၪထိၪ ထီၫ့,ဘဲၫၥိၭအမိထိၪဒိၩ့,ဒဲအတရၫ့ၥံၪ,ဒဲအခိၪဒၧၩ့",
			"16": "<sup>16</sup> လီၫ.- တၭဒိၩ့နီၪအီၪဝ့ၫလံခီၫ, ဒဲအဖၭထီၫ,ဒဲအဒၪ့ဎၩ့ နီၪအီၪဝ့ၫထီၫဎီၩ့လီၫ. တၭအဆၧထိၪဝ့ၫ လၧနိၪထိၪ နီၪ,အဖၭထီၫဒဲအဒၪ့ဎၩ့, ဒဲအထၪ့ထီၫနီၪ, မွဲစတ့ဒအၧၫ့",
			"17": "<sup>17</sup> လဆံၫနံၫထီၫ့နီၪထီၫဎီၩ့လီၫ.- တၭအဆၧထိၪဝ့ၫအခိၪ ဒၧၩ့နီၪ, မွဲအဖျါလယၩလံဆံၫလံဖျါ, မွဲဝ့ၫၦၡၩအဖျါ, ဘဲၫၦစံၭဆၧအၥိၭ, အၥီၫ့အဖျါလီၫ.",
			"18": "<sup>18</sup> အခိၪဒၧၩ့မၩအၥၭဘဲၫမနံၬနကၥွဲၭတၭ,ဒိၩ့မွဲထီၫ့",
			"19": "<sup>19</sup> ဆံၫ့လၩ့ဂၬနွၫဎံၪဝ့ၫလီၫ.- တၭဒိၩ့ခိၪဒၧၩ့ အခၪ့ထံၭ လဖၪအီၪကယၧၩ့အၥၭ လၧမနံၬကိၭမံၩ့ဒ့ၭလီၫ. အခၪ့ထံၭ လၧအဝံခိၪလထၧၫ့နီၪ, မွဲမနံၬနကၥွဲၭတၭ, နံၫထၧၫ့လထၧၫ့နီၪ, မွဲမနံၬနံၩလၩ, ၥၧၫ့ထၧၫ့လထၧၫ့",
			"20": "<sup>20</sup> နီၪမွဲမဟူၩယၩဘွၩ, လံထၧၫ့လထၧၫ့နီၪ, မွဲမနံၬမၠၬ,- ယဲထၧၫ့လထၧၫ့နီၪ, မွဲမဟူၩယၩထီၩ့အၥၭး ဎူၫထၧၫ့ လထၧၫ့နီၪ, မွဲမဟူၩယၩဝီၩး နွ့ၫထၧၫ့လထၧၫ့နီၪ,မွဲမ နံၬဘၩ့လၫး ဎိၭထၧၫ့လထၧၫ့နီၪ, မွဲမနံၬလၩယ့ၫး ခွံၫထၧၫ့လထၧၫ့နီၪ, မွဲမနံၬအူၩၥဖၩယၩး ဆံၫထၧၫ့လ ထၧၫ့နီၪ,မွဲမနံၬဘၩ့ယ့ၫ, ဆံၫလထၧၫ့လထၧၫ့နီၪ,မွဲမ နံၬလၩဝီၩး လဆံၫနံၫထၧၫ့လထၧၫ့နီၪ,မွဲမနံၬယၩ့ဖီၫ",
			"21": "<sup>21</sup> လီၫ.- တၭတရၫ့လဆံၫနံၫဘံၪ့နီၪ မွဲမနံၬထၫ့မျါလဆံၫ နံၫမံၩ့, တရၫ့လဘံၪ့မနံၬထၫ့မျါလမံၩ့, တရၫ့လဘံၪ့ မနံၬထၫ့မျါလမံၩ့လီၫ. တၭဒိၩ့အဖၧၩ့ၥၭနီၪ မွဲထီၫ့အ ဆံၫ့,ဘဲၫနွၫဖျီၪၥလၩ အၥိၭနီၪလီၫ.",
			"22": "<sup>22</sup> တၭလၧအဖၧၩ့ ယဒၪဘၪဆၧလုအဂံၪ့လအီၪဘၪး အဂဲးဘဲၫယီၩ ကဆါယွၩလၧအၥ့ၪဆၧလူၬ, ဒဲၥိၪဖိၪမွဲ",
			"23": "<sup>23</sup> ဆၧလုအဂံၪ့လီၫ.- တၭမုမ့ၬမွဲဂ့ၩ, လၩမွဲဂ့ၩ, ဖၩ့ထၪ့ လၧဒိၩ့ဖၧၩ့အလးလအီၪဘၪ,အဂဲးဘဲၫယီၩယွၩအ လၩအဖၩ့နီၪဖၩ့ထၪ့ဝ့ၫတၭ,ၥိၪဖိၪမွဲအဆၧဖၩ့လီၫ.",
			"24": "<sup>24</sup> တၭၦဆၨၩလဖၪလၧအထီၩ့လၧဆၧထိးထဲၩ့တၩ့ ထဲၩ့ဝ့ၫနီၪ, မိစဲၪ့ဝ့ၫလၧအဆၧဖၩ့အကျၩတၭ, ဂၪ့ခိၪ အစဎွၩလဖၪဂဲၫဆိၬအဆၧလၩဆၧဖၩ့, ဒဲအဆၧ ယူၭဆၧယၪ့လၧအဖၧၩ့လီၫ.",
			"25": "<sup>25</sup> တၭအတရၫ့ၥံၪလကၭဘံၭထၬဘၪ အၥၭလၧမုဆၫ",
			"26": "<sup>26</sup> လခီၫနီၪ, အဂဲးဘဲၫယီၩမုနၩမိအီၪထီးနီၪအ့ၬ.- တၭ ဆၧမိဂဲၫဆိၬ ၦဆၨၩလဖၪ အဆၧလၩဆၧဖၩ့ ဒဲဆၧ",
			"27": "<sup>27</sup> ယူၭဆၧယၪ့ လၧအဖၧၩ့လီၫ.- တၭဆၧလၧအမၩလ ဆံၫ့ဘၪဒဲအမၩဆၧစံၪစၪ,ဒဲချဲၩ့ဘျံၭချဲၩ့ဘျၪဆၧ လဖၪနီၪလ့ၩနုၬဘၪဝ့ၫနးမံၩ့အ့ၬ. အ့ၪမွဲအမိလ့ၩနုၬ ဘၪဝ့ၫန့ၫၦလၧအမံၩ့ အီၪကွ့ၭအၥၭ လၧၥိၪဖိၪအလံၬ မၧၫ့အဖၧၩ့လဖၪနီၪလီၫ."
		},
		"22": {
			"1": "<sup>1</sup> တၭအဝ့ၫဒၪဒုၭနဲၪယၧၩ လၧထံၫမၧၫ့အချိၬဎံၪဝ့ၫ ဘဲၫလိးဖျီၪၥလၩအၥိၭ, လၧအဂဲၫလၩ့လၧယွၩဒဲၥိၪဖိၪ",
			"2": "<sup>2</sup> အလးဆီၩ့ဆီအအီၪနီၪလီၫ.- တၭလၧအဖၧၩ့ၥၭအ ၥၭကျၩနီၪ,ဒဲလၧထံၫချိၬအလခီၫဒဲလၧလခီၫဒၪနီၪ အီၪဝ့ၫလၧၥံၪ့မၧၫ့လၧအၥၪထၪ့ဝ့ၫလဆံၫနံၫဖၧၫ့, ၥၪ ထၪ့ဝ့ၫလၩလဘံၪ့လဖၧၫ့, လၩလဘံၪ့လဖၧၫ့လီၫ. တၭၥံၪ့အလၪနီၪ မွဲလၧဆၧမၩဘျၪထဲၩ့ ၦဆၨၩလဖၪ",
			"3": "<sup>3</sup> အဂးလီၫ.- တၭဆၧဆိၪအၧၩ့အီၪလၧၩ့နးမံၩ့အ့ၬ. ယွၩ,ဒဲၥိၪဖိၪအလးဆီၩ့ဆီမိအီၪလၧအဖၧၩ့တၭ,အ",
			"4": "<sup>4</sup> ဎီးအၡၩၥံၪမိမၩအဆၧလီၫ.- အဝ့ၫၥံၪမိဒၪဘၪဝ့ၫ အမ့ၬတၭ, အမံၩ့မိအီၪဝ့ၫလၧအဝ့ၫၥံၪနီၪအမ့ၬထုး",
			"5": "<sup>5</sup> ခိၪလီၫ.- တၭမုနၩမိအီၪထီးနီၪအ့ၬ. ဒဲမ့ၪဒိၩ့အဖၩ့, ဒဲမုမ့ၬအဖၩ့နီၪ မၩဝ့ၫအလးလအီၪလၧၩ့ဘၪ, အဂဲး ဘဲၫယီၩကဆါယွၩမၩဖၩ့ထၪ့ဝ့ၫတၭ,အဝ့ၫၥံၪမိပၧၩ့ ဆၧအဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"6": "<sup>6</sup> တၭအဝ့ၫဒၪစံၭယၧၩ, ဆၧချဲၩ့လဖၪယီၩ မွဲအလူ တီၩ,ဒဲအမွဲအတီၩ, ဒဲကဆါ,မီၪၥံၪအၥၭလဖၪအယွၩ နီၪ,အၪ့မၧၫ့လၩ့အၥီၫ့လဂၩဂဲၫဒုၭနဲၪအဎီးအၡၩ",
			"7": "<sup>7</sup> လၧဆၧမိဘၪမၩအၥၭ ချဲၫ့ချဲၫ့လီၫ.-ယိခွါ, ယဂဲၫချဲၫ့ ချဲၫ့လီၫ. ၦလၧအထီးန့မီၪအလူအီၪလၧလံၬဖၧၩ့ ယီၩဘၪဆိၪဂ့ၩဝ့ၫလီၫ.",
			"8": "<sup>8</sup> တၭယၧၩ, စယီဟၫ့ဒၪဘၪ, ဒဲနါဂၧၫ့ဘၪဆၧလဖၪ ယီၩလီၫ. ထီးယနါဂၧၫ့ဒဲယဒၪဘၪတၭ, ယထွံၩလၩ့, ဘဲၫၥိၭယမိဘၩဆၧလၧအၥီၫ့လၧအဒုၭနဲၪယၧၩ လၧ",
			"9": "<sup>9</sup> ဆၧလဖၪယီၩအခၪ့ထံၭလီၫ.- တၭအဝ့ၫစံၭယၧၩ, ထီး လၩ့နၥၭဘဲၫၥိၭနထီးမၩဘဲၫနီၪလဂ့ၩ, ယမွဲဆၧအခ့ၫ အၡၩလၧနၥိၭ, ဒဲအီၪလၧမီၪလဖၪ, နထၧၫ့ဖုဝဲၥံၪအ ကျၩ,ဒဲလၧအထီးန့ဖံၭထၬ လံၬယီၩအလူအထၫတၭး ဘၩထၪ့ယွၩဆံၭ.",
			"10": "<sup>10</sup> တၭအဝ့ၫဒၪစံၭယၧၩ, မီၪအလူအထၫလၧလံၬဖၧၩ့ ယီၩ, စဲၩနဲၪ့ထၬလဂ့ၩးအဂဲးဘဲၫယီၩ အမုအလၩ",
			"11": "<sup>11</sup> လၩ့ဘူၭဝ့ၫယူၭ.- ၦလၧအလတီၩလလီၩ့ဘၪလဂၩ နီၪ, မွဲအအီၪဒၪဝ့ၫ လၧအဆၧလတီၩလလီၩ့ဘၪအဖၧၩ့ ဆံၭ. ၦလၧအအၧၩ့အၥၫ့လဂၩနီၪ, မွဲအအီၪဒၪဝ့ၫလၧ ဆၧအၧၩ့ဆၧၥၫ့အဖၧၩ့ဆံၭ. ၦလၧအတီၩအလီၩ့လ ဂၩနီၪမွဲအအီၪဒၪဝ့ၫလၧအဆၧတီၩဆၧလီၩ့အဖၧၩ့ ဆံၭ.တၭၦလၧအဆံၫ့ဎံၪလဂၩနီၪ, မွဲအအီၪဒၪဝ့ၫလၧ အဆၧဆံၫ့ဎံၪအဖၧၩ့ဆံၭ.",
			"12": "<sup>12</sup> ယိခွါ, ယဂဲၫချဲၫ့ချဲၫ့လီၫ. တၭယဆၧအခိးအ တၩအီၪလၧယၧၩ ဘဲၫၥိၭယမိဖ့ၪလၫ့ၦၡၩဘဲၫအမၩ",
			"13": "<sup>13</sup> ဆၧအၥိၭလဂၩလါလါကိၭဂၩဒ့ၭလီၫ.- ယမွဲက, ဒဲဧ,အခၪ့ထံၭဒဲအထုၬ, အီၪလၧအဝံခိၪထံၭဒဲလၧ ခဲၫ့ထုၬလီၫ.",
			"14": "<sup>14</sup> ၦလၧအအၪ့ဆူၫဝၭ အကီၩ့အၥိၭလဖၪနီၪ, ဘဲၫၥိၭ အမိကြၨၭန့ၥၫ ဆၧလၧၥံၪ့မၧၫ့ ဒဲလ့ၩနုၬလၧတရၫ့လ",
			"15": "<sup>15</sup> ဖၪလၧဒိၩ့အဖၧၩ့နီၪဘၪဆၧဆိၪဂ့ၩဝ့ၫလီၫ.- တၭ ထွံၪၥံၪ,ဒဲၦၥ့ၪဆၧအူၪဆၧပီၩ, ဒဲၦမၩမၪမုၪမၩမၪခွၫ, ဒဲၦမၩၥံၫၦၡၩ, ဒဲၦဘၩဆၧဂၩ့, ဒဲကယဲၦလၧအအဲၪ ဆၧအဘျံၭအဘျၪ ဒဲအချဲၩ့ဘျံၭချဲၩ့ဘျၪဆၧလဖၪအီၪ ဝ့ၫလၧခီၫ့ကိၭဂၩဒ့ၭလီၫ.",
			"16": "<sup>16</sup> ယၧၩ, ယ့ၫရှူၬအၪ့မၧၫ့လၩ့ယၥီၫ့ လ့ၩထိးအၥၭ လၧဆၧနီၪလဖၪလၧနၥံၪအအီၪလၧဆၧအီၪကီၪ့လဖၪ အကျၩလီၫ. ယမွဲစဒၫဝံၭအဝံ,ဒဲအဆၨၩအဆၬ တၭ,ယမွဲၡၪထူဂီၩ ဂိးၡ့ၭဂိးၡီၫလီၫ.",
			"17": "<sup>17</sup> တၭၥၭမုနီၪဒဲတလၭမူၭမုၪစံၭဝ့ၫဒၪ, ဂဲၫဘီၪ.ဒဲၦ လၧအနါဂၧၫ့ဆၧနီၪ စံၭဝ့ၫဒၪ, ဂဲၫဘီၪ, ဒဲၦလၧအၥူၫ အီၩအၥၭလၧထံၫနီၪ,မွဲအဂဲၫဘီၪ. ထီးဒၪၦလၧအ ၥၭအီၪနီၪ,မွဲအမၩန့ထံၫမၧၫ့ပျီၩပျီၩဘီၪ.",
			"18": "<sup>18</sup> ယထိးယၥၭလၧကယဲၦလၧအနါဂၧၫ့ မီၪအလူအီၪ လၧလံၬယီၩအဖၧၩ့လဂၩလါလါ, ဒဲၦအ့ၪအီၪက့ၪအၪ ထၪ့ဆၧယီၩလဖၪလဂၩဂၩတၭ,ယွၩမိအီၪက့ၪအၪ ထၪ့ဆၧၡၪ့ဆၧနၭ လၧအအီၪကွ့ၭအၥၭလၧလံၬယီၩ",
			"19": "<sup>19</sup> အဖၧၩ့လၧအလီၩ့လီၫ.- တၭၦအ့ၪမၩန့ထၪ့ခွံၬမီၪအ လူအီၪလၧလံၬယီၩအဖၧၩ့ လဂၩဂၩနီၪ, ယွၩမိမၩန့ ထၪ့ခွံၬအဝ့ၫဒၪအလးလၧလံၬမၧၫ့အဖၧၩ့, ဒဲလၧဒိၩ့ ဆံၫ့ဎံၪအဖၧၩ့, ဒဲလၧဆၧလၧအကွ့ၭအၥၭ လၧလံၬယီၩ",
			"20": "<sup>20</sup> အဖၧၩ့လီၫ.- ၦလၧအထိးအၥၭ လၧဆၧလဖၪယီၩ,စံၭ ဝ့ၫဒၪ,မွဲယူၭ, ယဂဲၫချဲၫ့ချဲၫ့လီၫ. အၩမံၩ့းမွဲယူၭ, ကဆါယ့ၫရှူၬဧ့, ဂဲၫဆံၭ.",
			"21": "<sup>21</sup> ကဆါယ့ၫရှူၬ ဎဎရံၬၭ အခိးအတၩနီၪ,မွဲအအီၪ လၧၦဆံၫ့ဎံၪၥံၪအၥိၭဆံၭ. ဎအၩမံၩ့.ၭ"
		}
	}
};
module.exports = book;